(1045, 306, 'HildaMip', 'afdima8.7@gmail.com', 'http://www.sibirintim.ru/indi_3162.html', '178.159.37.61', '2018-09-30 20:25:41', '2018-09-30 20:25:41', 'Всем доброго времени суток! Хочу поделиться своей историей,  в попытках найти правильный выход из сложившейся ситуации… В конце мая прошлого года познакомилась на просторах интернета со своим молодым человеком Андреем. Довольно странное было знакомство. Я в то время была одна уже на протяжении почти трех лет. Успела полностью реабилитироваться от своих прошлых тяжёлых отношений,  которые ни к чему серьезному так и не привели… Но сейчас не об этом.  <a href="http://www.sibirintim.com/indi_4983.html" rel="nofollow">фото без</a> \r\nПривела доказательства в виде ссылок на ее автографы на чужой стене. Долго он с ней беседовал и разбирался. А по итогу позвонил мне и поблагодарил,  якобы за то,  что открыла ему глаза на человека,  которому он зря доверял. После этого случая общения с Андреем стало еще больше,  и мы вдвоем стали с нетерпением ждать его возвращения и нашей встречи. Я волновалась очень! Встреча слегка не удалась… Мы пошли погулять,  но через время у Андрея начало крутить живот. Ничего не оставалось делать,  как идти ко мне домой. Мы провели чудесный вечер вдвоем! О многом болтали и смеялись. И вот именно на этом этапе я-то и совершила ошибку…мы с ним переспали. Он остался на ночь у меня,  а утром уехал в свой город (жили мы,  кстати,  в разных городах тогда,  которые находились поблизости друг от друга). В то время я была «на коне» и уверена в себе. Хорошая работа,  спорт,  друзья… А тут появился он,  и я вообще была самым счастливым человеком на земле!', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', '', 0, 0),
