(1047, 306, 'HildaMip', 'afdima8.7@gmail.com', 'http://www.sibirintim.ru/indi_5978.html', '178.159.37.61', '2018-10-01 20:09:40', '2018-10-01 20:09:40', 'он мне изменил. не знаю что делать прощать его или нет. вместе 4 года,  женаты год.у меня ребенок (не от него). квартиру снимаем. говорит что любит,  что не променяет меня ни на кого , но ведь уже променял изменил мне , причем роман их с любовницей длился 3 месяца , пока не спалились. что делать? я вроде его люблю, но измена... мне 27, ему 25.  <a href="http://www.sibirintim.com/indi_5821.html" rel="nofollow">ее фото</a> \r\nСейчас чувствую себя полным посмешищем и все время жду подвоха. Я могу ей отплатить! Подать в прокуратуру заявление,  о том,  что она лезет в чужую семью,  вылить ее фотографии порнографического содержания в сеть….но считаю,  что это глупо и низко. Вот и дошла до того,  что теперь пишу эту историю здесь,  с надеждой найти хоть какой-то выход. Возможно,  со стороны видно будет какие-то моменты,  которые я упустила. Я не хочу никого осуждать,  просто считаю,  что о детях нужно говорить сразу,  я бы полгода своей жизни не поторатила на него и эти бессмысленные отношения', 0, '0', 'Mozilla/5.0 (Windows NT 6.1; Win64; x64) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/67.0.3396.87 Safari/537.36 OPR/54.0.2952.51', '', 0, 0),
(1048, 306, 'Randyvep', 'rishelena85@gmail.com', 'http://put.sibirki.com', '178.159.37.103', '2018-10-06 09:54:22', '2018-10-06 09:54:22', '<a href="http://put.sibirki.com" rel="nofollow">проститутки новосибирска</a> \r\n<a href="http://nsk.siblaguna.org" rel="nofollow">проститутки новосибирска</a> \r\n<a href="http://get.nsexy.ru" rel="nofollow">проститутки новосибирска</a> \r\nМногие мужчины предпочитают платную любовь мимолетным отношениям , если вы проездом в Новосибирске и просто хотите расслабиться, то зачем вам лишние сложности? Например в командировке часто просто некогда тратить время на ухаживания и знакомства с женщинами в традиционных местах, кроме того, такой роман может нести за собой последствия, так как дама может пожелать продолжить отношения. Так же многие мужчины не считают секс с проституткой настоящей изменой, ведь они платят именно за секс, и ничего больше. Если хочется разнообразия в половой жизни, сексуальной разрядки и новых ощущений – не лучше ли воспользоваться интимными услугами проститутки, чем искать романы на стороне?', 0, '0', 'Mozilla/5.0 (Windows NT 6.1) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/66.0.3359.181 Safari/537.36', '', 0, 0),
