(446, 'notifier-cache-Sahifa', '<?xml version="1.0" encoding="UTF-8"?>\n<notifier>\n	<latest>5.5.5</latest>\n	<changelog>\n<![CDATA[\n<strong>Version 5.5.5 - 18-04-2016</strong>\n- Fixed: Color Picker bug in the categories edit page.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- js/tabs.min.js\n- js/tie-scripts.js\n- framework/widgets/widget-weather.php\n- framework/functions/admin/framework-admin.php\n- framework/functions/theme-functions.php\n- framework/functions/translation.php\n- framework/functions/mega-menus.php\n- framework/parts/slider-home.php\n- framework/parts/post-head.php\n- framework/admin/style.css\n\n\n\n<strong>Version 5.5.4 - 16-04-2016</strong>\n- Updated: The theme is now WordPress 4.5 ready.\n- Updated: FitVids library.\n- Fixed: PHP notices in the update notifier module.\n- Fixed: Page search exclude option bug.\n- Fixed: Update notification bug with the child themes.\n- Fixed: Missing translation option for “Nothing Found” in the translation panel.\n- Fixed: Appearance of the post meta in the pages with the post cover.\n- Improved: Weather Widget.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- js/tabs.min.js\n- js/tie-scripts.js\n- framework/widgets/widget-weather.php\n- framework/functions/theme-functions.php\n- framework/functions/translation.php\n- framework/functions/mega-menus.php\n- framework/parts/slider-home.php\n- framework/parts/post-head.php\n- framework/admin/style.css\n\n\n\n<strong>Version 5.5.3 - 28-01-2016</strong>\n- Fixed: PHP notices in the update notifier module.\n\n#Files Updated\n- style.css\n- framework/admin/inc/notifier/update-notifier.php\n\n\n\n<strong>Version 5.5.2 - 27-01-2016</strong>\n- Updated: The theme is now WooCommerce 2.5 ready.\n- improved: Theme Updates notifier.\n- Fixed: Flat share styling issue.\n- Fixed: Breaking News set animation type bug.\n- Fixed: Some PHP notices.\n- Fixed: WooCommerce LightBox bug for single product image.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- js/tie-scripts.js\n- framework/functions/theme-functions.php\n- framework/parts/breaking-news.php\n- framework/admin/inc/notifier/update-notifier.php\n- framework/admin/framework-admin.php\n- Removed: woocommerce/content-product.php\n- Removed: woocommerce/content-product_cat.php\n\n\n\n<strong>Version 5.5.1 - 21-12-2015</strong>\n- Improved: RTL direction of the reading indicator.\n- Updated: Font Awesome Version 4.5.0 ( 20 New Icons ).\n- Updated: Languages files.\n- Updated: InstaNOW Plugin (formerly Instagramy) version 2.0.\n- - NEW FEATURE: New Easier way to authorize your account with Instagram.\n- - NEW FEATURE: Load More feature for the Grid Layout.\n- - NEW FEATURE: Ability to show more than 20 Images.\n- - NEW FEATURE: Flat Images option.\n- - NEW FEATURE: Compatibility with the Visual Composer plugin.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- rtl.css\n- framework/functions/theme-functions.php\n- framework/admin/js/icon-picker.js\n- framework/admin/framework-panel.php\n- framework/admin/framework-admin.php\n- framework/admin/images/ (folder)\n- framework/admin/style.css\n- framework/parts/share.php\n- framework/plugins/ (folder)\n- fonts/fontawesome/ (folder)\n- languages (folder)\n\n\n\n<strong>Version 5.5.0 - 21-11-2015</strong>\n- NEW FEATURE: New typography option for Breaking news label.\n- Updated: Languages files.\n- Improved: Facebook Counter.\n- Improved: feed.press Counter.\n- Improved: Posts Excerpt in the Grid Slider.\n- Improved: RTL elements styles.\n- Improved: Removed TGM notice for users without permissions to install/update plugins.\n- improved: Theme Updates notifier.\n- Improved: iLightBox library code.\n- Improved: One Click Demo data importer.\n- Added: New RTL Demo content XML file.\n- Fixed: Posts Excerpt shortcodes bug.\n- Fixed: Bug when adding an icon for menu items after adding them to the menu.\n- Fixed: Misspelled words.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- rtl.css\n- functions.php\n- js/ilightbox.packed.js\n- framework/functions/arqam-lite.php\n- framework/functions/common-scripts.php\n- framework/functions/theme-functions.php\n- framework/admin/style.css\n- framework/admin/framework-admin.php\n- framework/admin/framework-panel.php\n- framework/admin/js/icon-picker.js\n- framework/admin/framework-admin.php\n- framework/admin/inc/notifier/update-notifier.php\n- framework/admin/inc/importer/tie-importer.php\n- framework/widgets/widget-facebook.php\n- languages (folder)\n\n\n\n<strong>Version 5.4.0 - 12-10-2015</strong>\n- NEW FEATURE: New typography option for titles in the grid slide.\n- Updated: Dribbble API 1.0 - Now you need to set a Client Access Token, check the Documentation for more information.\n- Updated: New OpenWeatherMap API - Now you need to set an API key in the weather widget settings.\n- Updated: Languages files.\n- Updated : Theme documentation.\n- Improved: Weather Widget.\n- Improved: bbPress elements styles.\n- Improved: RTL elements styles.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- rtl.css\n- css/bbpress.css\n- framework/functions/arqam-lite.php\n- framework/widgets/widget-weather.php\n- framework/functions/common-scripts.php\n- framework/admin/framework-panel.php\n- languages (folder)\n\n\n\n<strong>Version 5.3.2 - 16-09-2015</strong>\n- Improved: Theme Accessibility.\n- Improved: Force the word with a lot of chars to fit the container.\n- Improved: Mega menu function to avoid conflict with some plugins.\n- Improved: OG Meta description for posts.\n- Updated: Instagramy plugin.\n- Updated: Taqyeem plugin.\n- Fixed: Posts Excerpt shortcodes bug.\n- Fixed: Video Blocks post link bug.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- header.php\n- framework/functions/theme-functions.php\n- framework/blocks/block-videos.php\n- framework/functions/mega-menus.php\n- framework/parts/featured.php\n- framework/plugins/ (folder)\n\n\n\n<strong>Version 5.3.1 - 23-08-2015</strong>\n- Updated: The theme is now WordPress 4.3 ready.\n- Updated: The theme is now WooCommerce 2.4 ready.\n- Updated: Instagramy plugin.\n- Updated: Taqyeem plugin.\n- Improved: Storing custom post fields value in the DB.\n- Improved: Mega menu save custom fields.\n- Fixed: Menus bug after importing the demo site data.\n- Fixed: WPML scan theme text bug.\n- Fixed: Full width masonry bug on Firefox.\n- Fixed: Flat twitter share button bug on iPhone.\n- Fixed: Twitter share button bug with non latin characters.\n- Fixed: Share bug when the post title containing a special characters.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- functions.php\n- framework/admin/framework-builder.php\n- framework/admin/framework-metaboxes.php\n- framework/functions/theme-functions.php\n- framework/functions/translation.php\n- framework/functions/arqam-lite.php\n- framework/functions/mega-menus.php\n- framework/parts/share.php\n- framework/plugins/ (folder)\n- framework/widgets/ (folder)\n- woocommerce/content-product_cat.php\n- woocommerce/content-product.php\n\n\n\n<strong>Version 5.3.0 - 08-08-2015</strong>\n- NEW FEATURE: Option to enable/disable Smooth Scroll.\n- NEW FEATURE: Shortcode support for custom above and below posts Ads.\n- NEW FEATURE: Visual style option for SoundCloud.\n- NEW FEATURE: Github Social counter.\n- NEW FEATURE: Logo Psd files added in the theme package.\n- Improved: Facebook Counter.\n- Improved: Spaces around posts with covers on mobiles.\n- Improved: RTL Styles of the Mobile menu.\n- Improved: Time Ago Format module and it’s translation.\n- Improved: Theme’s translations.\n- Improved: Views System with multiple post pages.\n- Updated: Languages files.\n- Updated: Font Awesome Version 4.4.0 - 66 New Icons.\n- Updated: TGM plugin Version 2.5.2.\n- Updated: FlexSlider Version 2.5.0.\n- Updated: Instagramy plugin.\n- - NEW FEATURE: Hashtag support.\n- - NEW FEATURE: Activate links of accounts and hashtags in the user bio section.\n- - NEW FEATURE: Activate links of accounts and hashtags in the post caption.\n- - Improved: Plugin Speed and performance by reducing the amount of data stored and fetched from the database by 90%.\n- Fixed: Share bug when the post title containing a special characters.\n- Fixed: Breaking News inactive tab bug.\n- Fixed: Getting Weather data bug for some locations.\n- Fixed: Misspelled words.\n- Removed: Forrst Social counter as Zurb shut down it’s API.\n- And other improvements and minor bug fixes.\n\n#Files Updated\n- style.css\n- rtl.css\n- header.php\n- single.php\n- page.php\n- template-authors\n- template-best-reviews\n- template-blog\n- template-login\n- template-masonry.php\n- template-media.php\n- template-restrict.php\n- template-sitemap.php\n- template-tags.php\n- template-timeline.php\n- wpml-config.xml\n- js/tie-scripts.js\n- fonts/fontawesome/ (folder)\n- languages (folder)\n- framework/plugins/ (folder)\n- framework/functions/arqam-lite.php\n- framework/functions/theme-functions.php\n- framework/functions/translation.php\n- framework/functions/common-scripts.php\n- framework/functions/tie-views.php\n- framework/parts/breaking-news.php\n- framework/parts/post-head.php\n- framework/parts/share.php\n- framework/admin/style.css\n- framework/admin/js/tie.js\n- framework/admin/js/icon-picker.js\n- framework/admin/framework-panel.php\n- framework/admin/framework-admin.php\n- framework/admin/framework-metaboxes.php\n- framework/admin/updates.php\n- framework/admin/inc/tgm/ (folder)\n- framework/widgets/widget-soundcloud.php\n- framework/widgets/widget-twitter.php\n- framework/widgets/widget-weather.php\n\n\n\n<strong>Version 5.2.2 - 30-06-2015</strong>\n- Updated: Youtube API 3.0 - Now you need to get API Key ... check the Documentation for more information.\n- Updated: Theme’s Documentations.\n- Updated: Languages Files.\n\nFiles Updated\n- style.css\n- framework/functions/arqam-lite.php\n\n\n\n<strong>Version 5.2.1 - 24-05-2015</strong>\n- Improved: Performance of the video block query.\n- Improved: Non Youtube and vimeo posts now linked to the post itself when the block’s Lightbox option is active.\n- Fixed: Check also close bug.\n- Fixed: Appearance of the sticky posts in the widgets.\n- And other improvements and minor bug fixes.\n\nFiles Updated\n- style.css\n- js/tie-scripts.js\n- framework/blocks/block-videos.php\n- framework/functions/inc/theme-functions.php\n\n\n\n<strong>Version 5.2.0 - 21-05-2015</strong>\n- NEW FEATURE: Optional reading position indicator.\n- NEW FEATURE: Searchable icon picker for menus.\n- NEW FEATURE: Added Post date to the grid featured slider.\n- NEW FEATURE: Added Self Hosted videos support to the videos blocks.\n- Improved: Theme speed and performance.\n- Improved: One Click Demo data importer.\n- Updated: TGM plugin.\n- Updated: Taqyeem plugin.*\n- Updated: Taqyeem - Buttons Addon.*\n- Updated: Taqyeem - Predefined Criteria Addon.*\n- Updated: Languages files.\n- Fixed: Misspelled words .\n- Fixed: Several PHP notices.\n- Fixed: iPhone menu bug.\n- Fixed: Nested bbpress comments bug.\n- Fixed: Below Header Banner Area bug.\n- Fixed: Below Header Banner Area background bug in WooCommerce pages.\n- Fixed: RTL Self hosted videos player bug.\n- Fixed: RTL sliders pagination separator bug.\n- Fixed: Translation panel custom chars bug.\n- Fixed: Appearance of the top menu items in the mobile menu bug.\n- Fixed: Dropdown menu hover bug with Safari on iPad.\n- Fixed: List shortcodes bug in the HTML block and widget.\n- Fixed: Login widget bug for subdirectories installation.\n- Fixed: Disable WooCommerce lightbox bug.\n- Fixed: Mega menu item position bug in the RTL version.\n- Fixed: Appearance of categories and views icons for pages in the search results.\n- Fixed: Lazy load of the images in footer area bug.\n- And other improvements and minor bug fixes.\n\n* To Update the plugin :\n	1- Go to the “Installed Plugins” page and delete the old plugin version.\n	2- Re-install the plugin from Appearance > “Install Plugins” page.\n\nFiles Updated\n- style.css\n- rtl.css\n- 404.php\n- header.php\n- footer.php\n- comments.php\n- category.php\n- sidebar.php\n- template-timeline.php\n- template-tags.php\n- template-best-reviews.php\n- js/tie-scripts.js\n- fonts/fontawesome/font-awesome.min.css\n- languages (folder)\n- framework/blocks/ (folder)\n- framework/parts/ (folder)\n- framework/plugins/ (folder)\n- framework/admin/inc/importer/ (folder)\n- framework/admin/inc/tgm/ (folder)\n- framework/admin/updates.php\n- framework/admin/inc/style.css\n- framework/admin/custom-slider.php\n- framework/admin/framework-admin.php\n- framework/admin/framework-builder.php\n- framework/admin/framework-metaboxes.php\n- framework/admin/framework-category.php\n- framework/admin/framework-options.php\n- framework/admin/framework-panel.php\n- framework/admin/js/icon-picker.js\n- framework/functions/inc/mega-menus.php\n- framework/functions/inc/theme-functions.php\n- framework/functions/inc/translation.php\n- framework/functions/inc/common-scripts.php\n- framework/widgets/widget-tabbed.php\n- framework/widgets/widget-author.php\n- framework/widgets/widget-slider.php\n- framework/widgets/widget-tabbed.php\n\n- If your current version is 4+ Please replace whole folder. We changed too many files in v5.0.0\n\n\n\n\n<strong>Version 5.1.0 - 26-02-2015</strong>\n- NEW FEATURE: Option to enable/disable the mobile menu.\n- NEW FEATURE: Option to enable/disable the Search bar in the mobile menu.\n- NEW FEATURE: Option to enable/disable the social icons in the mobile menu.\n- NEW FEATURE: Option to enable/disable the Top menu items in the mobile menu.\n- NEW FEATURE: Option to hide the the mobile menu items icons.\n- NEW FEATURE: Option to enable/disable share buttons for pages.\n- NEW FEATURE: Option to disable Arqam Lite.\n- NEW FEATURE: Icon for the home link in the mobile menu.\n- NEW FEATURE: Caption for the LightBox shortcode.\n- Improved: Caption position of the post head image.\n- Improved: Gallery images caption appearance.\n- Improved: Tables style.\n- Improved: Sub Lists styles in the post content area.\n- Improved: OG Data for the homepages.\n- Improved: SEo improvements.\n- Improved: Lists with multiple line style.\n- Improved: Sticky sidebar behaviour when scrolling up and down.\n- Fixed: Page builder bug when the WooCommerce plugin is deactivated.\n- Fixed: Gallery columns bug.\n- Fixed: RTL Related posts style bug in Full width posts.\n- Fixed: special characters bug when share the post on Facebook.\n- Fixed: JS bug in the Arqam Lite options page.\n- Fixed: StumbleUpon and LinkedIn share buttons bug.\n- Fixed: Buttons shortcode target option bug.\n- Fixed: All Known php notices.\n- Fixed: page builder bug when categories names containing a quotes.\n- Fixed: RTL Logo in the sticky Navigation menu position bug.\n- Fixed: Home Link always heightlighted bug when it added to the Main Nav as a page.\n- Fixed: Author hcard bug.\n- Fixed: Full width logo styling bug.\n- Fixed: Sticky sidebars bug with Adsense and other Ad services.\n- Fixed: Images lazy load bug with reCAPTCHA.\n- Fixed: Comments avatar size bug in the theme widgets.\n- Updated: BebasNeue font to fix the accented characters bug.\n- Updated: Font Awesome Version 4.3.0 ( 40 New Icons ).\n- Updated: Theia Sticky Sidebar Js file to latest version.\n- Updated: Theme Documentation - Page speed guide section added.\n- And other improvements and minor bug fixes.\n\nFiles updated\n- style.css\n- rtl.css\n- header.php\n- single.php\n- page.php\n- sidebar.php\n- sidebar-shop.php\n- js/tie-scripts.js\n- fonts/ ( folder)\n- functions.php\n- framework/blocks.php\n- framework/functions/theme-functions.php\n- framework/functions/common-scripts.php\n- framework/functions/arqam-lite.php\n- framework/parts/share.php\n- framework/admin/framework-builder.php\n- framework/admin/framework-panel.php\n- framework/admin/style.css\n- framework/admin/framework-category.php\n- framework/admin/updates.php\n- framework/shortcodes/shortcodes.php\n\n- If your current version is 4+ Please replace whole folder. We changed too many files in v5.0.0\n\n\n<strong>Version 5.0.2 - 10-02-2015</strong>\n- Improved: Videos dimensions before loading the main js file.\n- Improved: Content SlideShow styling before loading the main js file.\n- Improved: Scrolling Block styling before loading the main js file.\n- Fixed: Google Adsense responsive bug on some devices.\n- Fixed: Text Decoration styling option bug.\n- Fixed: Footer styling options bug.\n- Fixed: UberMwnu stick Menu option bug.\n- Fixed: Mega Menus Arrows in the mobile menu.\n- Fixed: Styling bug in the (Recent posts and check also) mega menu option.\n- Fixed: Installing required plugins bug with Sahifa Child themes.\n- And other improvements and minor bug fixes.\n\nFiles updated\n- style.css\n- js/tie-scripts.js\n- framework/widgets/widget-video.php\n- framework/functions/mega-menus.php\n- framework/functions/common-scripts.php\n- Framework/functions/theme-functions.php\n\n- If your current version is 4+ Please replace whole folder. We changed too many files in v5.0.0\n\n\n<strong>Version 5.0.1 - 08-02-2015</strong>\n- Fixed: The mobile menu Close Bug on mobiles.\n- Fixed: Tabs Shortcode bug.\n- Fixed: TGM_Bulk_Installer bug when trying to install the recommended plugins.\n- Fixed: The Full width images bug.\n- Fixed: Bug in the lightbox.\n- Fixed: Bug in the translation panel.\n- Fixed: Top share buttons text color.\n- Fixed: Breaking news custom background color.\n- And other improvements and minor bug fixes.\n\nFiles updated\n- header.php\n- style.css\n- js/tie-scripts.js\n- framework/functions/translation.php\n- framework/functions/common-scripts.php\n- framework/functions/theme-functions.php\n- framework/admin/framework-admin.php\n- framework/admin/framework-builder.php\n- framework/admin/framework-panel.php\n- framework/shortcodes/ ( folder )\n\n- If your current version is 4+ Please replace whole folder. We changed too many files in v5.0.0\n\n\n<strong>Version 5.0.0 - 06-02-2015</strong>\n- NEW FEATURE: New Mega menus module with 3 different layouts.\n- NEW FEATURE: Option to add icons for the main nav menu item.\n- NEW FEATURE: Full width layout.\n- NEW FEATURE: New boxed layout.\n- NEW FEATURE: Grid Featured Posts Slider.\n- NEW FEATURE: Lazy Load for images with option to enable/disable it.\n- NEW FEATURE: Views system.\n- NEW FEATURE: Out of canvas mobile menu.\n- NEW FEATURE: Live Search with option to enable/disable it.\n- NEW FEATURE: New WooCommerce block in the Page builder with 2 layouts.\n- NEW FEATURE: Removed the old review system and Integrate Taqyeem Plugin save 16$.\n- NEW FEATURE: Option to add a custom title for the review box .\n- NEW FEATURE: Review for custom post types.\n- NEW FEATURE: Taqyeem - Predefined Criteria Addon save 6$\n- NEW FEATURE: Integrated Taqyeem Buttons Addon save 5$.\n- NEW FEATURE: Fly check also box with option to set its position, number of posts and query type.\n- NEW FEATURE: Option to disable the Fly check also box for specific posts .\n- NEW FEATURE: Masonry Page Template.\n- NEW FEATURE: Media Page Template .\n- NEW FEATURE: Removed the old Social Counter module and Integrate Arqam Lite Social Counter Plugin.\n- NEW FEATURE: Google+ Page Followers.\n- NEW FEATURE: Delicious Followers.\n- NEW FEATURE: Forrst Followers.\n- NEW FEATURE: RSS Subscribers Number ( Feedpress.it / Manual ).\n- NEW FEATURE: Option for colored social counter icons.\n- NEW FEATURE: Option for colored border social counter icons.\n- NEW FEATURE: New animation effect social counter.\n- NEW FEATURE: Weather Widget.\n- NEW FEATURE: New Shortcode GUI.\n- NEW FEATURE: Set custom title for the about author box shortcode.\n- NEW FEATURE: New style for the Timeline page template.\n- NEW FEATURE: Timeline layout for archives.\n- NEW FEATURE: Masonry with sidebar layout for archives .\n- NEW FEATURE: Option to set custom layout for categories pages .\n- NEW FEATURE: Option to customize the layout of each category\n- NEW FEATURE: Option to set custom layout for tags pages .\n- NEW FEATURE: Option to set custom layout for Authors pages .\n- NEW FEATURE: Option to set custom layout for search results pages .\n- NEW FEATURE: Show the search bar in mobiles.\n- NEW FEATURE: New option to set the number of related posts in the full width pages.\n- NEW FEATURE: Option to show most viewed posts in the posts list widget.\n- NEW FEATURE: Option to show most viewed posts in the Tabbed widget.\n- NEW FEATURE: Icons for post meta info.\n- NEW FEATURE: Ad Space below the header.\n- NEW FEATURE: New Media uploader.\n- NEW FEATURE: Smooth Scroll effect.\n- NEW FEATURE: New modern dashboard styles.\n- NEW FEATURE: Typography option for Blockquotes.\n- NEW FEATURE: Ability to add multiple Categories tabs box.\n- NEW FEATURE: Ability to change the position of Categories tabs boxes.\n- NEW FEATURE: Ability to add more than twitter widget with different accounts.\n- NEW FEATURE: Option to show social icons in Gray without background.\n- NEW FEATURE: Soundcloud match post and theme color.\n- NEW FEATURE: Modern Flat share Buttons.\n- NEW FEATURE: Colored read more button.\n- NEW FEATURE: Allow zoom on mobiles.\n- NEW FEATURE: Custom slider multiple uploader.\n- NEW FEATURE: Option to set the background color of the main navigation and the inner border.\n- NEW FEATURE: Options to show the search and social icons in the header top area .\n- NEW FEATURE: Option to hide thumbnails in categories blocks.\n- NEW FEATURE: Added Lightbox library.\n- NEW FEATURE: Option to enable Lightbox automatically for all images in the post content area.\n- NEW FEATURE: Option to choose the lightbox skin ( 6 skins available ).\n- NEW FEATURE: Option to enable/disable thumbnails in lightbox.\n- NEW FEATURE: Option to show arrows in lightbox.\n- NEW FEATURE: Option to show the videos in the video block in lightbox.\n- NEW FEATURE: 404 Error page redesigned.\n- NEW FEATURE: Add class for all ads spaces to use it with adblock plugins.\n- NEW FEATURE: Icons for Buttons shortcode .\n- NEW FEATURE: Homepage boxes colors.\n- NEW FEATURE: New Responsive Version.\n- NEW FEATURE: New Menu CSS animation.\n- NEW FEATURE: Remove Query Strings From Static Resources to improve the load speed.\n- NEW FEATURE: Added 10 new background patterns.\n- NEW FEATURE: New design for tabs, toggle shortcodes.\n- NEW FEATURE: Added cart icon to main nav with option to disable it.\n- NEW FEATURE: Added a Timeline Widget.\n- NEW FEATURE: Author cover image.\n- NEW FEATURE: Cover posts layout.\n- NEW FEATURE: Parallax effect.\n- NEW FEATURE: New position for the related posts module.\n- NEW FEATURE: New today''s date design.\n- NEW FEATURE: Support for Self Hosted Videos.\n- NEW FEATURE: Full width images style.\n- NEW FEATURE: New Smart Stick Navigation.\n- NEW FEATURE: Option to show site logo in the Sticky Navigation.\n- NEW FEATURE: Print styles for posts .\n- NEW FEATURE: Added light bulb, thumbs up, thumbs down, plus, minus, heart and cons lists shortcode.\n- NEW FEATURE: New 7 colors for highlight text shortcode.\n- NEW FEATURE: New 5 Dividers styles shortcode.\n- NEW FEATURE: New Padding shortcode.\n- NEW FEATURE: Sticky Sidebar with option to enable/disable, and option to disable it on some pages.\n- NEW FEATURE: Option to set custom background for the mega menu.\n- NEW FEATURE: Added Translation tab to TiePanel.\n- NEW FEATURE: Option to show the tag description.\n- NEW FEATURE: Option to change the order of tabs in tabbed widget .\n- NEW FEATURE: Added share buttons to the pages.\n- NEW FEATURE: Option to add Custom Social Networks.\n- NEW FEATURE: Content Slideshow shortcode.\n- NEW FEATURE: Added Instagramy plugin save 15$.\n- NEW FEATURE: Option to use post''s short link in share buttons.\n- NEW FEATURE: Builder in pages.\n- NEW FEATURE: Translatable backend.\n- NEW FEATURE: New Timeline block in the homepage builder.\n- NEW FEATURE: New Post Content block in the homepage builder.\n- NEW FEATURE: New big thumb block in the homepage builder.\n- NEW FEATURE: New masonry block in the homepage builder .\n- NEW FEATURE: Hide box title if the title field is empty.\n- NEW FEATURE: Option to show share buttons in recent posts blocks.\n- NEW FEATURE: Option to set slider type for each category.\n- NEW FEATURE: Option to set slider animation and speed for each category.\n- NEW FEATURE: Option to set slider posts number for each category.\n- NEW FEATURE: RTL Dashboard Support.\n- NEW FEATURE: New Design for Categories widget.\n- NEW FEATURE: New Design for WooCommerce pages.\n- NEW FEATURE: New Modern design for tables.\n- NEW FEATURE: New Design for bbpress.\n- NEW FEATURE: New Design for buddypress .\n- NEW FEATURE: New Design for Comments section.\n- NEW FEATURE: New Design for Add Comment form .\n- NEW FEATURE: Logo Margin bottom option.\n- NEW FEATURE: Display the number of comments in popular posts widgets.\n- NEW FEATURE: Font awesome 4.2.0 Added.\n- NEW FEATURE: Added new Foursquare icon.\n- Improved: Theme Speed.\n- Improved: Default WordPress widgets style.\n- Improved: Highlight the shop page in the main nav when browsing a product.\n- improved: Theme Updates notifier.\n- Improved: SSL issues.\n- Improved: Images and captions.\n- Improved: Twitter widget design.\n- Improved: Theme overall clean design.\n- Improved: bbPress Widget style.\n- Improved: Child theme issues.\n- Improved: Custom slider columns added.\n- Improved: Replace main nav bg image with color.\n- Improved: Videos widget.\n- Improved: Flex Slider navigation style.\n- Improved: Theme files organisation.\n- Improved: Check list and stars, loading font icon.\n- Improved: Blockquote style.\n- Improved: Buttons shortcode style.\n- Improved: Scrolling box.\n- Improved: Flickr widget.\n- Improved: Search widget.\n- Improved: About author box.\n- Improved: Authors page layout.\n- Improved: Best reviews page layout.\n- Improved: Responsive videos.\n- Improved: Readable css and js codes.\n- Fixed: All known php notices.\n- Fixed: Breaking News ticker Bug.\n- Fixed: Box shadow bug.\n- Fixed: Highlight home menu item on WPML languages home pages.\n- Fixed: Exclude pages from search bug with bbPress.\n- fixed: bug in the import/export feature.\n- Fixed: Spelling issues.\n- Fixed: Bug in flexSlider horizontal rtl.\n- Fixed: Store the default data after installing the theme.\n- Fixed: OG title bug with some plugins.\n- Removed: Feed Page Template, use [feed] shortcode instead.\n- Removed: Timthumb for security reasons.\n- Updated: Flex slider.\n- And other improvements and minor bug fixes.\n\nFiles updated\n- Please replace whole folder. We changed too many files in this version.\n\n\n]]>\n	</changelog>\n</notifier>\n', 'yes'),
