(6431, 818, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">THIẾT BỊ CHUYỂN MẠCH MẠNG VIELINA-SW.01</span></strong></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">Thiết bị VIELINA-SW.01 có chức năng chuyển mạch dữ liệu, mở rộng kết nối dữ liệu, thu phát các tín hiệu vô tuyến bằng Wifi, Zigbee, chuyển đổi dữ liệu từ RS485 sang Ethernet.\r\n- Chuyển mạch mạng vòng Ethernet: tốc độ 1000Mbps.\r\n- Thu phát không dây:\r\n+ Wifi: bán kính thu phát 70 ÷ 100m.\r\n+ Zigbee: bán kính thu phát 70 ÷ 100m.\r\n- Phương pháp kết nối:\r\n+ Cáp quang: 3 cổng, tốc độ 1000Mbps\r\n+ Cáp quang: 02 cổng 100Mbps\r\n+ Cáp đồng: 02 cổng 2Mbps\r\n+ Cáp đồng: 04 cổng 100Mbps\r\n+ Cáp đồng: 02 cổng RS485\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Dạng bảo vệ: </span><span class="fontstyle0">Ex d [iaMa] I Mb</span><span class="fontstyle2">.\r\n- Cấp bảo vệ vỏ: IP54.\r\n- Điện áp cấp: 127/380/660VAC.\r\n- Ắc quy: 12V/7000mAh.\r\n- Thông số của các mạch ra an toàn tia lửa:\r\nU</span><span class="fontstyle2">0 </span><span class="fontstyle2">= 6,2VDC; I</span><span class="fontstyle2">0 </span><span class="fontstyle2">= 255mA; C</span><span class="fontstyle2">0 </span><span class="fontstyle2">≤ 1000µF; L</span><span class="fontstyle2">0 </span><span class="fontstyle2">≤ 10mH.\r\n- Kích thước: (530x410x184)mm.\r\n- Điều kiện làm việc:\r\nNhiệt độ làm việc: -20°C ÷ 40°C. Độ ẩm: &lt; 95% RH, không đọng sương.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">MÁY CHUYỂN ĐỔI MẠNG ETHERNET CÔNG NGHIỆP</span></strong></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">Thiết bị cung cấp một số chức năng quản lý mạng cao cấp:\r\n- Thiết lập mạng vòng (SW-Ring), VLAN, trunking, QOS, giám định chỉ tiêu, cổng phản chiếu, cảnh báo và nâng cấp phần mền trực tuyến. Thiết lập vòng mạng (SW-Ring) với mục đích tạo ra độ dự trữ, phân chia tài nguyên và nâng cao độ tin cậy cho hệ thống mạng (thời gian tự động phục hồi &lt;20ms).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Nguồn cung cấp: 100~240VAC/DC.\r\n- Dòng điện đầu vào: 0.25A (@110VAC/VDC.\r\n- Công suất tiêu thụ có tải: 18W.\r\n- Tương thích chuẩn: IEEE802.3, IEEE802.3u, IEEE802.1p,…\r\n- Cổng hỗ trợ:\r\n+ Cổng điện RJ45.\r\n+ Cổng quang 1000Base-FX.\r\n+ Cổng gỡ lỗi: phương thức gỡ lỗi (RS-232), RJ45\r\n+ Cổng cảnh báo: 2bit Terminal block\r\n- Băng thông trao đổi: 12.8G.\r\n- Môi trường làm việc:\r\n+ Nhiệt độ hoạt động: -40°C ÷ 75°C\r\n+ Độ ẩm trung bình: &lt; 95% (không ngưng tụ).</span></span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;'),
