(6450, 819, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">CAMERA IP PHÒNG NỔ VIELINA-CMR.xx</span></strong></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">Đây là camera IP hồng ngoại phòng nổ cố định sử dụng trong môi trường hầm lò. Thiết bị sử dụng 2 phương thức truyền tín hiệu video bằng cáp quang hoặc dây mạng phòng nổ để truyền dữ liệu hình ảnh về trung tâm điều khiển.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Có cổng nối cáp quang singlemode và cáp mạng RJ45.\r\n- Tiêu chuẩn an toàn: </span><span class="fontstyle0">ExdI</span><span class="fontstyle2">.\r\n- Độ phân giải: 2.0 Megapixel.\r\n- Cảm biến: 1/3" Progressive Scan CMOS.\r\n- Tầm xa hồng ngoại nhìn đêm: </span><span class="fontstyle0">30m</span><span class="fontstyle2">.\r\n- Chống nhiễu kỹ thật số DNR.\r\n- Chống ngược sáng kỹ thật số WDR.\r\n- Cắt lọc hồng ngoại: ICR.\r\n- Giao thức: TCP/IP, ICMP, HTTP, HTTPS, FTP, DHCP, DNS, DDNS, RTP, RTSP, RTCP, PPPoE, NTP, UPnP, SMTP, SNMP, IGMP, 802.1X, QoS, IPv6.\r\n- Tương thích hệ thống: ONVIF, PSIA, CGI.\r\n- Điện áp nguồn cung cấp: AC127V.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Khả năng ứng dụng:\r\n</span><span class="fontstyle2">Camera IP hồng ngoại được ứng dụng trong việc giám sát theo dõi quá trình làm việc khai thác trên trong hầm lò, tại đường lò dọc vỉa, đường lò xuyên vỉa, vị trí cổng vào/ra khu vực công tác, trạm biến áp, hầm bơm...).</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">CAMERA IP KHÔNG DÂY</span></strong></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">thiết bị thu thập dữ liệu bằng hình ảnh thông qua camera di động có dạng đèn lò (trang bị trên mũ bảo hộ) và truyền về trung tâm bằng\r\nsóng wifi thông qua các trạm thu phát sóng và mạng truyền dẫn. Hệ thống cập nhật trực tuyến hình ảnh tại hiện trường trong lò về phòng điều hành trung trung tâm.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Camera CCD độ nhạy sáng thấp, độ nét cao.\r\n- Độ phân giải hình ảnh theo thời gian thực: 720P/D1/CIF/QCIF.\r\n- Khả năng quan sát: &gt; 20 mét (trong điều kiện hầm lò không có ánh sáng).\r\n- Tần số vô tuyến không dây: 2.4 Ghz (1EEE 802.11a/ b / g).\r\n- Khoảng cách thu phát với Trạm thu phát lặp: ≥ </span><span class="fontstyle0">150m.\r\n</span><span class="fontstyle2">- Pin sạc: Lithium 12V/3000mAh\r\n- Thời gian sử dụng của pin: ≥ 8 tiếng.\r\n- Loại phòng nổ: an toàn tia lửa\r\n- Trọng lượng: 0.5 kg\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Khả năng ứng dụng:\r\n</span><span class="fontstyle2">Camera IP không dây được thiết kế để sử dụng trong môi trường hầm lò được cán bộ, nhân viên mang theo mình khi đi thực hiện hỗ trợ cho công tác cứu hộ, cứu nạn, sửa chữa, khắc phục sự cố.... hay giám sát quản lý hiện trường.</span></span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;'),
