(6470, 820, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">ĐIỆN THOẠI DI ĐỘNG DÙNG TRONG HẦM LÒ\r\n</span></strong></span><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">Thiết bị điện thoại di động dùng trong hầm lò là thiết bị thông tin liên lạc nhỏ gọn, có thể mang bên người, các thao tác đơn giản dễ sử dụng. Công suất tiêu hao năng lượng thấp, thời gian chờ tương đối dài nên thiết bị đảm bảo hoạt động tốt trong ca làm việc, Thiết bị có độ nhạy thu cao nên có thể đảm bảo cự ly liên lạc với trạm phát sóng lên đến 150m. Ngoài ra thiết bị sử dụng pin sạc nên cho phép nạp điện lại khi cần thiết.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Dạng bảo vệ nổ: </span><span class="fontstyle0">ExibI</span><span class="fontstyle2">.\r\n- Ắc quy: 3.7V/1200mAh.\r\n- Thời gian đàm thoại khi pin đã được sạc đầy không ít hơn 6 giờ, thời gian chờ là không ít hơn 100 giờ.\r\n- Công suất truyền: ≤19 dBm.\r\n- Độ nhạy tiếp thu ≤-85 dBm.\r\n- Tần số hoạt động: 2.4GHz, 5.8GHz.\r\n- Tiêu chuẩn truyền thông: IEEE802.11a/b/g\r\n- Trọng lượng: ~200g.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Khả năng ứng dụng:\r\n</span><span class="fontstyle2">Điện thoại di động được sử dụng trong hầm lò cán bộ công nhân viên mang theo khi thực hiện hỗ trợ trong công tác cứu hộ hay khảo sát hiện trường để liên lạc với trung tâm.</span></span>\r\n\r\n&nbsp;\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">THIẾT BỊ ĐO KHÍ ĐA THÔNG SỐ </span><span class="fontstyle2">VIELINA-ĐTS.04\r\n</span></strong></span><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle3">• </span><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">- Thiết bị đo 4 thông số: CH</span><span class="fontstyle2">4</span><span class="fontstyle2">, CO, CO</span><span class="fontstyle2">2 </span><span class="fontstyle2">và O</span><span class="fontstyle2">2</span><span class="fontstyle2">.\r\n- Báo động bằng âm thanh và ánh sáng nhấp nháy.\r\n- Cài đặt ngưỡng cảnh báo.\r\n- Lưu các giá trị cảnh báo.\r\n- Truyền dữ liệu không dây: 2.4 Ghz (IEEE 802.11a/ b / g).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Dạng bảo vệ nổ: </span><span class="fontstyle0">ExiaI</span><span class="fontstyle2">.\r\n- Ắc quy: Pin Lithium 3.7V/1100mAh cho phép hoạt động 8h.\r\n- Điện áp cung cấp: U</span><span class="fontstyle2">max </span><span class="fontstyle2">= 3.7VDC.\r\n- Dòng điện tiêu thụ: I</span><span class="fontstyle2">max </span><span class="fontstyle2">= 82mA.\r\n- Sensor CH</span><span class="fontstyle2">4</span><span class="fontstyle2">:\r\n+ Dải đo: 0 ÷ 5% CH</span><span class="fontstyle2">4</span><span class="fontstyle2">.\r\n+ Sai số: (0 ÷ 2,5)% ±0,1%; (2,5 ÷ 5)% ±0,3%.\r\n- Sensor CO:\r\n+ Dải đo: (0 ÷ 1000)ppm CO.\r\n+ Sai số: (0 ÷ 200)ppm ±5ppm; (200 ÷ 100)% ±25ppm.\r\n- Sensor O</span><span class="fontstyle2">2</span><span class="fontstyle2">: Dải đo: (0 ÷ 30)% CO</span><span class="fontstyle2">2</span><span class="fontstyle2">.\r\n- Sensor CO</span><span class="fontstyle2">2</span><span class="fontstyle2">: Dải đo: 0 ÷ 5% CO</span><span class="fontstyle2">2</span><span class="fontstyle2">.\r\n- Kích thước: (130 x 60 x 32) mm.\r\n- Trọng lượng: ~ 0,3kg.\r\n</span><span class="fontstyle0">Khả năng ứng dụng:\r\n</span><span class="fontstyle2">Thiết bị đo khí đa thông số thiết kế sử dụng trong môi trường hầm lò giúp công nhân viên mỏ linh động trong việc đo đạc thông số khí\r\ntrong những đường lò mà không lắp đặt các trạm khí cố định.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">TRẠM THU PHÁT LẶP </span><span class="fontstyle2">VIELINA-WAPM</span></strong></span>\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle3">• </span><span class="fontstyle0"><strong>Tính năng</strong>:\r\n</span><span class="fontstyle2">Thiết bị có chức năng thu phát sóng không dây (wifi 2.4GHz, 5.8GHz) với Thiết bị thu thập thông tin đầu cuối đa phương tiện và máy đo khí đa thông số không dây, đảm bảo thông tin thoại hai chiều giữa nhân viên cứu hộ và chỉ huy.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Dạng bảo vệ nổ: </span><span class="fontstyle0">ExiamI</span><span class="fontstyle2">.\r\n- Ắc quy: 12V/11000mAh cho phép hoạt động &gt; 12h.\r\n- Nguồn cung cấp đầu ra ATTL: U</span><span class="fontstyle2">i </span><span class="fontstyle2">= 12VDC; I</span><span class="fontstyle2">i </span><span class="fontstyle2">= 0.4A; L</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 35mH; C</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 33µF.\r\n- Tần số hoạt động: 2.4GHz, 5.8GHz.\r\n- Khoảng cách lặp không dây giữa 2 bộ: </span><span class="fontstyle0">1000m </span><span class="fontstyle2">LOS.\r\n- Bán kính thu phát sóng không dây: </span><span class="fontstyle0">150m </span><span class="fontstyle2">LOS.\r\n- Tiêu chuẩn truyền thông: IEEE 802.11a/ b/g</span><span class="fontstyle2">.\r\n</span><span class="fontstyle2">- Cổng kết nối: 02 cổng quang 100Mbps.\r\n- Kích thước: (240 x 200 x 100)mm.\r\n- Trọng lượng: ~2.5kg.\r\n- Điều kiện sử dụng:\r\n+ Nhiệt độ môi trường: 0°C ÷ 40°C.\r\n+ Độ ẩm tương đối: ≤ 95 %\r\n+ Sử dụng trong môi trường hầm lò.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">THIẾT BỊ ĐẦU CUỐI ĐA PHƯƠNG TIỆN </span><span class="fontstyle2">VIELINA.CMRM\r\n</span></strong><span class="fontstyle0"><strong>Tính năng</strong>:\r\n</span><span class="fontstyle2">Thiết bị tích hợp bao gồm: camera IP không dây, tích hợp micro, loa, đèn led phát sáng dùng để thu thập hình ảnh, trao đổi thông tin thoại hai chiều. Thiết bị có chức năng thu phát wifi để truyền dữ liệu về trung tâm chỉ huy.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- Dạng bảo vệ nổ: </span><span class="fontstyle0">ExiamI</span><span class="fontstyle2">.\r\n- Ắc quy: 12V/3000mAh cho phép hoạt động &gt; 8h.\r\n- Đầu ra an toàn tia lửa: U</span><span class="fontstyle2">i </span><span class="fontstyle2">= 12.6VDC; I</span><span class="fontstyle2">i </span><span class="fontstyle2">= 0.4A; L</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 33mH; C</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 0µF.\r\n- Tần số vô tuyến không dây: 2.4 Ghz (1EEE 802.11a/b/g).\r\n- Khoảng cách quan sát: </span><span class="fontstyle0">&gt;20m</span><span class="fontstyle2">.\r\n- Tai nghe/ micro có đặc tính chống ồn tốt.\r\n- Độ phân giải hình ảnh theo thời gian thực: 720P/D1/CIF/QCIF.\r\n- Trọng lượng: 0.5kg.\r\n- Điều kiện sử dụng:\r\n+ Nhiệt độ môi trường: 0°C ÷ 40°C.\r\n+ Độ ẩm tương đối: ≤ 95 %\r\n+ Sử dụng trong môi trường hầm lò.</span></span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;'),
