(6492, 821, 'hinh_anh', '<span style="font-family: arial, helvetica, sans-serif;"><span style="font-size: 14pt;"><strong><span style="font-size: 12pt;">PHẦN MỀM TRUNG TÂM</span>\r\n</strong></span>Máy tính chủ được đặt tại phòng điều khiển <span class="fontstyle0">trung tâm cài đặt phần mềm hệ thống phát thanh. Tại đây có thể quản lý toàn bộ các thiết\r\nbị của hệ thống đang hoạt động dưới hầm lò và thực hiện các chức năng như: phát thông báo, hướng dẫn sơ tán công nhân khi có sự cố dưới\r\nhầm lò, phát thanh xuống các phân trạm cũng như các thùng loa âm ly trực tiếp hay một khung giờ cố định trước. Phát những bản nhạc có sẵn hay trực tuyến theo từng khu vực khác nhau trong cùng một thời điểm.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">PHÂN TRẠM PHÁT THANH AN TOÀN TIA LỬA VIELINA-PTM.AT\r\n</span></strong><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">- Phát tín hiệu âm thanh hay thông tin từ phòng điều khiển trung tâm.\r\n- Đàm thoại hai chiều với phân trạm khác và phòng điều khiển trung tâm.\r\n- Phát thông báo tới một hay tất cả phân trạm trong hệ thống.\r\n- Truyền tín hiệu âm thanh tới các thùng loa âm ly phòng nổ được kết nối cùng.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- </span><span class="fontstyle2">Dạng bảo vệ: </span><span class="fontstyle0">Ex[ia]I</span><span class="fontstyle2">.\r\n- Cấp bảo vệ vỏ: IP54.\r\n- Thông số nguồn vào: U</span><span class="fontstyle2">i </span><span class="fontstyle2">= 12VDC; I</span><span class="fontstyle2">i </span><span class="fontstyle2">= 0.9A; L</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 0,5mH; C</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 0µF.\r\n- Công suất loa: 10Wx2.\r\n- Truyền thông mạng Ethernet: cáp quang/cáp điện.\r\n- Kích thước: (380 x 331 x 142)mm.\r\n- Trọng lượng: 10kg.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">THÙNG LOA ÂM LY PHÒNG NỔ VIELINA-PTM.PN\r\n</span></strong><span class="fontstyle0"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle2">- Phát tín hiệu âm thanh từ phòng điều khiển trung tâm hay từ phân trạm phát thanh an toàn tia lửa thông qua cáp điện hoặc cáp\r\nquang.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle2">- </span><span class="fontstyle2">Dạng bảo vệ: </span><span class="fontstyle0">Exd[ia]I</span><span class="fontstyle2">.\r\n- Nguồn cấp: 380/660VAC ±10%; 1 pha.\r\n- Thông số nguồn vào: U</span><span class="fontstyle2">i </span><span class="fontstyle2">= 3.6VDC; I</span><span class="fontstyle2">i </span><span class="fontstyle2">= 36mA; L</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 1,04mH; C</span><span class="fontstyle2">i </span><span class="fontstyle2">≈ 62µF.\r\n- Công suất loa: 10Wx2.\r\n- Truyền thông mạng Ethernet: cáp quang/cáp điện.\r\n- Pin dự phòng: 12V 4000mAh, thời gian làm việc sau khi pin nạp đầy: 2h.\r\n- Kích thước: (440 x 430 x 180)mm.\r\n- Trọng lượng: 35kg.</span></span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;'),
