(6510, 822, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">PHẦN MỀM MÁY TÍNH TRUNG TÂM</span></strong> </span>\r\n<span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> Phần mềm máy tính chủ trung tâm cho phép:\r\n+ Thu thập dữ liệu và hiển thị trên màn hình sơ đồ đường lò, cập nhật sơ đồ đường lò, di chuyển các vị trí đo trên bản đồ để phù hợp với hiện trạng khai thác mỏ.\r\n+ Lưu trữ các thông tin về số liệu đo theo thời gian, thông tin về đầu đo (thời điểm lắp đặt, thời điểm hiệu chuẩn…), thông tin về cảnh báo, trạng thái đóng cắt điện.\r\n+ Thực hiện thống kê, lưu trữ và tạo các mẫu báo cáo phục vụ in ấn. </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">TỦ ĐIỀU KHIỂN VIELINA-WS</span><span class="fontstyle2">40</span></strong> </span>\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">• </span><span class="fontstyle2">Chức năng</span><span class="fontstyle3">:\r\n- Thu thập kết quả từ các đầu đo đặt trong hầm lò thông qua RS485 (cáp quang/đồng).\r\n- Gửi kết quả đo tới máy tính chủ điều khiển qua mạng LAN.\r\n- Thiết lập các tham số cài đặt cho tủ điều khiển và các đầu đo như ngưỡng cảnh báo, ngưỡng cắt điện, thông tin của đầu đo.\r\n- Cho phép thiết lập điều khiển đóng cắt điện liên động.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật</span><span class="fontstyle3">:\r\n- Số lượng kênh đo: 40 (có thể mở rộng).\r\n- Giao thức truyền thông: RS485.\r\n- Phương pháp kết nối: Cáp quang/ đồng.\r\n- Chu kỳ cập nhật dữ liệu: 8s.\r\n- Cảnh báo tại từng vị trí đầu đo trên màn hình đèn báo trên tủ tương ứng.\r\n- Nguồn cấp: 220VAC.\r\n- Kích thước:(1500 x 650 x 700) mm.</span> </span>\r\n\r\n<span class="fontstyle0">THIẾT BỊ NGUỒN VÀ ĐIỀU KHIỂN ĐÓNG CẮT VIELINA-PCO.</span><span class="fontstyle2">01</span>\r\n<strong><span class="fontstyle0">Chức năng</span></strong><span class="fontstyle2">:\r\n- Dùng để thực hiện các lệnh điều khiển từ các đầu đo khí mêtan đưa tới các atomát đóng cắt điện.\r\n</span><strong><span class="fontstyle0">Đặc tính kỹ thuật</span></strong><span class="fontstyle2">:\r\n- Dạng bảo vệ: </span><span class="fontstyle0">Exd[ia]I</span><span class="fontstyle2">.\r\n- Điện áp cấp: 127/380/660VAC.\r\n- Ắc quy: 12V/7000mAh, cho phép khả năng lưu điện ≥ 2h\r\n- Tín hiệu vào điều khiển: 12VDC cách ly quang.\r\n- Điện áp chuyển mạch cho phép: 7000VAC.\r\n- Tiếp điểm chuyển mạch: rơ le.</span>\r\n\r\n<strong> <span class="fontstyle0">THIẾT BỊ GIÁM SÁT MÔI TRƯỜNG MỎ\r\n</span></strong><span style="font-size: 10pt;"><strong><span class="fontstyle0">ĐẦU ĐO KHÍ MÊ TAN: VIELINA-CH</span></strong></span><span class="fontstyle0"><span style="font-size: 10pt;"><strong>4</strong></span>\r\n</span><span class="fontstyle2">- Dùng để đo và cảnh báo khí mêtan.\r\n- Dải đo: (</span><span class="fontstyle0">0</span><span class="fontstyle2">÷</span><span class="fontstyle0">100)% CH</span><span class="fontstyle0">4</span><span class="fontstyle0">.\r\n</span><span class="fontstyle2">- Sai số: (0÷2,5)% ± 0,1% CH</span><span class="fontstyle2">4</span><span class="fontstyle2">; (2,5÷5)% ± 0,3% CH</span><span class="fontstyle2">4</span><span class="fontstyle2">; (5÷100)% ± 3% CH</span><span class="fontstyle2">4</span><span class="fontstyle2">.\r\n- Hiển thị bằng LED hoặc LCD.\r\n- Truyền thông: Tần số 5kHz÷10kHz÷12kHz. Truyền thông RS485.\r\n- Điện áp làm việc: 12VDC.\r\n- Dòng tiêu thụ:&lt; 250mA.\r\n- Dạng bảo vệ: </span><span class="fontstyle0">ExiaI</span><span class="fontstyle2">.\r\n- Kích thước: (260 x 85 x 137)mm.</span>\r\n\r\n<strong><span class="fontstyle0">ĐẦU ĐO KHÍ CACBON MONOXIT: VIELINA-CO\r\n</span></strong><span class="fontstyle0">- Dùng để đo và cảnh báo khí CO.\r\n- Dải đo: (</span><span class="fontstyle2">0÷1000) ppm CO</span><span class="fontstyle0">.\r\n- Sai số: ±(2÷25) ppm CO.\r\n- Hiển thị bằng LED hoặc LCD.\r\n- Tự động cảnh báo bằng còi, đèn và truyền tín hiệu về trung tâm.\r\n- Truyền thông bằng: Tần số 5kHz÷10kHz÷12kHz. Truyền thông RS485.\r\n- Điện áp làm việc: 12VDC.\r\n- Dòng tiêu thụ:&lt; 250mA.\r\n- Dạng bảo vệ: </span><span class="fontstyle2">ExiaI</span><span class="fontstyle0">.\r\n- Kích thước: (260 x 85 x 137)mm.\r\n- Trọng lượng: 2kg.</span>\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;\r\n\r\n&nbsp;'),
