(6590, 826, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>TỦ ĐIỀU KHIỂN CỬA GIÓ TỰ ĐỘNG VIELINA-WDA</strong>\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle3">Tủ điều khiển cửa gió có chức năng tự động điều khiển:\r\n- Tự động phát hiện người hay tàu để ra lệnh đóng mở cửa gió.\r\n- Thực hiện đóng mở cửa gió với chế độ bằng tay thông qua các nút bấm để điều khiển.\r\n- Bộ điều khiển cửa gió hoạt động liên tục 24/24 giờ.\r\n- Khi có người hoặc tàu thì bộ điều khiển mới cho động cơ bơm dầu chạy, thực hiện mở đóng cửa xong thì động cơ bơm dầu lại dừng.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Dạng bảo vệ: </span><span class="fontstyle2">Ex d [ia Ma] I Mb.\r\n</span><span class="fontstyle3">- Nguồn cung cấp: 380/660Vac (±5%), 50Hz;\r\n- Công suất lớn nhất 10KVA với 02 động cơ bơm cùng chạy.\r\n- Nguồn ra an toàn tia lửa: U</span><span class="fontstyle3">o </span><span class="fontstyle3">= 24Vdc; I</span><span class="fontstyle3">o </span><span class="fontstyle3">= 90mA;P</span><span class="fontstyle3">o</span><span class="fontstyle3">=4,3W\r\n- Điều kiện sử dụng:\r\n+ Nhiệt độ: 0°C ÷ 40°C.\r\n+ Độ ẩm tương đối: 95% RH; không đọng hơi nước.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">BỘ NGUỒN THỦY LỰC\r\n</span></strong><span class="fontstyle0">• </span><span class="fontstyle2"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle3">- Bộ nguồn thủy lực hoạt động theo lệnh điều khiển từ tủ điều khiển cửa gió tự động (VIELINA-WDA).\r\n- Điều khiển đóng mở bằng van tay trong trường hợp mất điện hoặc nguyên nhân khác.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Nguồn cung cấp: 380/660VAC - 3pha.\r\n- Lưu lượng dầu: 28L/phút.\r\n- Dung tích thùng chứa: 100lit.\r\n- Van:\r\n+ Van điều khiển điện phòng nổ.\r\n+ Van an toàn.\r\n- Đồng hồ báo áp lực dầu.\r\n- Xi lanh dầu: Φ63 – hành trình 500mm.\r\n- Dây nối mền 15m và khớp nối nhanh.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">BỘ CẢM BIẾN PHÁT HIỆN VẬT THỂ\r\n</span></strong><span class="fontstyle0">• </span><span class="fontstyle2"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle3">- Phát tín hiệu cho tủ điều khiển cửa gió khi phát hiện có vật thể đi qua khu vực cửa.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Cảm biến thu phát hồng ngoại.\r\n- Nguồn cấp:12÷24 VDC.\r\n- Dòng điện: 45mA (MAX).\r\n- Khoảng cách đo: 4m.</span></span>'),
