(6977, 879, 'dac_tinh_san_pham', '<strong><span style="font-family: arial, helvetica, sans-serif;">Phần mềm trung tâm</span></strong>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0">Phần mềm giám sát điều khiển từ xa trên máy tính của Hệ thống giám sát và điều khiển trạm quạt thông gió gồm:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Giám sát, hiện thị và lưu trữ toàn bộ các thông tin về giá trị đo lường: nhiệt độ, áp suất, tốc độ gió, lưu lượng gió, thông số điện áp và dòng điện 3 pha của động cơ quạt; tình trạng hoạt động và thời gian hoạt động của các quạt gió.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Cho phép người vận hành điều khiển chạy/dừng quạt gió từ xa thông qua màn hình giao diện của phần mềm hệ thống.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Giám sát góc mở van gió và cho phép đóng/mở góc mở van gió để điều tiết lưu lượng gió từ Phòng điều hành trung tâm.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Đặt lịch chạy trạm quạt theo quy định vận hành thông gió mỏ.</span></span>\r\n\r\n<strong><span style="font-family: arial, helvetica, sans-serif;">TỦ GIÁM SÁT VÀ ĐIỀU KHIỂN VIELINA-DKG\r\n</span></strong><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0">• </span><span class="fontstyle2">Chức năng:\r\n</span><span class="fontstyle3">Tủ VIELINA-DKG.01 giám sát và hiển thị các thông số của hai trạm quạt gió:\r\n+ Nhiệt độ ba cuộn dây, ổ bi.\r\n+ Áp suất.\r\n+ Độ rung dọc và ngang động cơ.\r\n+ Lưu lượng gió.\r\n+ Góc mở van cửa gió.\r\n+ Điện áp và dòng điện của động cơ quạt.\r\nTủ VIELINA-DKG.01 có chức năng giám sát điều khiển tự động, bằng tay, từ xa hệ thống trạm quạt gió.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Nguồn vào: 3 pha 380 VAC.\r\n- Truyền thông:\r\n+ Mạng RS485 bằng cáp điện;\r\n+ Mạng ETHERNET bằng cáp quang 100Mbps.\r\n- Bộ nhớ CPU: 100 KB.\r\n- Đồng hồ V/A, rơle bảo vệ, aptomat, đèn báo, còi, nút ấn, chuyển mạch, màn hình hiển thị.\r\n- Kích thước: (1500 x 650 x 1400)mm.\r\n- Trọng lượng: ~100 kg</span></span>\r\n\r\n&nbsp;'),
