(7012, 890, 'dac_tinh_san_pham', '<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>PHẦN MỀM TRUNG TÂM</strong>\r\n</span><span class="fontstyle0">- Quản lý thông tin về nhân sự. Cho phép theo dõi vị trí của người lao động tại một số khu vực xác định trên bản đồ hầm lò theo thời gian thực.\r\n- Lưu thông tin về quá trình di chuyển của người lao động qua các khu vực có đặt thiết bị giám sát.\r\n- Tìm kiếm, tra cứu vị trí người lao động một cách nhanh chóng, dễ dàng.\r\n- Thống kê, báo cáo về quản lý người trong hầm lò theo nhiều tiêu chí.\r\n- Sao lưu, phục hồi dự phòng dữ liệu.\r\n- Có thể kiểm soát tối đa ≤ 10.000 thẻ.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong>TRẠM PHÁT THANH AN TOÀN LỬA VIELINA-PTM.AT\r\n</strong><span class="fontstyle0">• </span><span class="fontstyle2"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle3">Đây là thiết bị tích hợp dùng để thu thập dữ liệu của tín hiệu thẻ, thu phát sóng di động, kết nối với các thiết bị đo lường điều khiển khác qua mạng RS485. Thiết bị đầu cuối là thiết bị trung gian để truyền tải dữ liệu hai chiều giữa các thiết bị người dùng với trung tâm điều khiển.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Dạng bảo vệ nổ: </span><span class="fontstyle2">Ex d [ia] I Mb</span><span class="fontstyle3">.\r\n- Nguồn cấp: 127/380/660VAC (50Hz).\r\n- Cổng mạng giao tiếp: 4 cổng 100MB, 2 cổng VDSL, 1 cổng RS 485.\r\n- Bán kính truyền thông không dây:\r\n+ Wifi: ≥</span><span class="fontstyle2">150m</span><span class="fontstyle3">;\r\n+ Zigbee: &gt;</span><span class="fontstyle2">100m</span><span class="fontstyle3">.\r\n- Giao thức truyền thông: TCP/IP, VDSL.\r\n- Dải tần làm việc: 2,4GHz.\r\n- Nguồn dự phòng: cho phép hoạt động ≥2h.\r\n- Kích thước: (510 x 434 x 214)mm.\r\n- Trọng lượng: 60kg.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>THẺ ĐỊNH VỊ VIELINA-TAG.01</strong>\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2"><strong>Chức năng</strong>:\r\n</span><span class="fontstyle3">Thẻ định vị được trang bị cho các nhân viên khi làm việc trong lò. Thẻ có chức năng định danh nhân viên trong hệ thống giám sát, định vị nhân sự. Thông qua thẻ nhân viên có thể phát tín hiệu lên trung tâm và nhận tín hiệu từ trung tâm với tín hiệu cảnh báo rung.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Đặc tính kỹ thuật:\r\n</span><span class="fontstyle3">- Cấp bảo vệ nổ: </span><span class="fontstyle2">ExiaI</span><span class="fontstyle3">.\r\n- Cấp bảo vệ vỏ: IP54.\r\n- Nguồn cấp: Pin 3.3V- 1000mAh\r\n- Thông số nguồn vào: U</span><span class="fontstyle3">i </span><span class="fontstyle3">= 3.3VDC; I</span><span class="fontstyle3">i </span><span class="fontstyle3">= 55mA; L</span><span class="fontstyle3">i </span><span class="fontstyle3">≈ 1mH; C</span><span class="fontstyle3">i </span><span class="fontstyle3">≈ 0µF.\r\n- Tần số hoạt động: 2.4GHz.\r\n-Công suất đầu ra tần số: 0dBm.\r\n- Tốc độ truyền thông: 1Mbps.\r\n- Khoảng cách truyền tối thiểu: </span><span class="fontstyle2">100m</span><span class="fontstyle3">.\r\n- Kích thước: (58x18x70)mm.\r\n- Trọng lượng: khoảng 80g.</span></span>\r\n\r\n&nbsp;'),
