oá.</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Giới thiệu chung', '', 'inherit', 'open', 'open', '', '293-revision-v1', '', '', '2016-04-25 09:17:26', '2016-04-25 09:17:26', '', 293, 'http://elatec.com.vn/?p=300', 0, 'revision', '', 0),
