(307, 1, '2016-04-25 09:47:03', '2016-04-25 09:47:03', 'Chức năng\r\nTại Quyết định số 170/QĐ-VĐT ngày 02/08/2007 của Viện trưởng Viện Nghiên cứu Điện tử, Tin học, Tự động hoá về việc thành lập Công ty TNHH một thành viên Phát triển Công nghệ Điện tử, Tự động hóa. Chức năng nhiệm vụ của Viện được quy định như sau:\r\nA. Chức năng\r\nCông ty TNHH một thành viên Phát triển Công nghệ Điện tử, Tự động hóa là cơ quan nghiên cứu triển khai KHCN thuộc lĩnh vực Điện tử, Tự động hoá.\r\nB. Nhiệm vụ\r\n- Nghiên cứu chiến lược, quy hoạch và chính sách phát triển KHCN ngành Điện tử, Tự động hoá.\r\n- Tổ chức triển khai thực hiện các công trình, dự án, đề tài nghiên cứu KHCN và kinh tế ngành Điện tử, Tự động hoá.\r\n- Phối hợp với các cơ quan đơn vị có liên quan bồi dưỡng chuyên môn cho đội ngũ cán bộ KHCN của Viện và tổ chức đào tạo sau đại học, trên đại học cho các đối tượng có nhu cầu.\r\n- Tổ chức các hoạt động thông tin KHCN và kinh tế ngành Điện tử, Tự động hoá.\r\n- Tham gia xây dựng quy trình, quy phạm, tiêu chuẩn nhà nước, tiêu chuẩn và định mức kinh tế - kỹ thuật ngành, giám định các công trình KHCN thuộc lĩnh vực Điện tử, Tự động hoá.\r\n- Phát triển các quan hệ hợp tác về nghiên cứu trong lĩnh vực Điện tử, Tự động hoá với các tổ chức, cá nhân trong nước và nước ngoài.\r\n- Tư vấn về quản lý, chuyển giao công nghệ, các hoạt động dịch vụ công nghiệp, sản xuất thử nghiệm các sản phẩm thuộc các đề tài nghiên cứu.', 'Chức năng và nhiệm vụ', '', 'inherit', 'open', 'open', '', '306-revision-v1', '', '', '2016-04-25 09:47:03', '2016-04-25 09:47:03', '', 306, 'http://elatec.com.vn/?p=307', 0, 'revision', '', 0),
