(310, 1, '2016-04-25 09:55:42', '2016-04-25 09:55:42', '<table id="table2" border="0" width="100%" cellspacing="3" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><strong>Tự động hóa</strong></td>\r\n<td valign="top"></td>\r\n</tr>\r\n<tr>\r\n<td valign="top">- Thiết kế chế tạo và triển khai ứng dụng các hệ thống SCADA vào các ngành năng lượng, dầu khí, khai khoáng, môi trường.\r\n- Thiết kế chế tạo và triển khai ứng dụng DCS để điều khiển các quá trình trong các ngành công nghiệp, nông nghiệp, nuôi trồng và chế biến nông thuỷ sản, hoá chất, xử lý nước thải.\r\n\r\n- Thiết kế chế tạo và triển khai ứng dụng các hệ thống tự động định lượng và cấp liệu trong các ngành công nghiệp.\r\n\r\n- Xây dựng các ứng dụng thời gian thực sử dụng PLC, máy tính PC và hệ thống nhúng.\r\n\r\n- Xây dựng các hệ thống giám sát video và điều khiển từ xa.\r\n\r\n- Xây dựng hệ thống tự động hoá tích hợp điều hành sản xuất với quản lý doanh nghiệp.</td>\r\n<td valign="top"><img src="http://vielina.com/Uploads/Articles/Images/gioithieu/automation1.gif" alt="" width="221" height="169" />\r\n\r\n- Thiết kế chế tạo các hệ thống đa xử lý, các Robot công nghiệp.\r\n\r\n- Mô hình hoá và Điều khiển trên cơ sở lý thuyết tập mờ, mạng noron nhân tạo và các thuật toán di truyền.\r\n- Thiết kế chế tạo, lắp đặt và bảo trì các hệ thống tự động hoá để cải tạo, nâng cấp các dây chuyền sản xuất cũ.</td>\r\n</tr>\r\n<tr>\r\n<td colspan="2"><img src="http://vielina.com/Uploads/Articles/Images/gioithieu/automation2.gif" alt="" width="411" height="285" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n<div>\r\n<table id="table4" border="0" width="100%" cellspacing="3" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td valign="top">\r\n<strong>Kỹ thuật điện tử </strong></td>\r\n<td valign="top"></td>\r\n</tr>\r\n<tr>\r\n<td valign="top">- Thiết kế các mạch IC chuyên dụng dùng công nghệ FPGA.\r\n- Thiết kế, chế tạo các thiết bị điện tử y tế.\r\n\r\n- Thiết kế, chế tạo các thiết bị điện tử chuyên dụng trong các ngành công nghiệp.\r\n\r\n- Thiết kế, chế tạo và lắp đặt các hệ thống thu thập, xử lý và truyền số liệu.\r\n\r\n- Thiết kế, chế tạo các loại mạch in từ 2 lớp đến 7 lớp chất lượng cao.\r\n\r\n- Thiết kế chế tạo các thiết bị phục vụ đào tạo các chuyên ngành Điện, Điện tử Viễn thông, Tự động hoá và Cơ điện tử.</td>\r\n<td valign="top"><img src="http://vielina.com/Uploads/Articles/Images/gioithieu/xquang.gif" alt="" /></td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<div>\r\n<table id="table6" border="0" width="100%" cellspacing="3" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><strong>Công nghệ Thông tin </strong></td>\r\n<td valign="top"></td>\r\n</tr>\r\n<tr>\r\n<td valign="top">- Phát triển phương pháp tạo phần mềm tự động dựa vào mã nguồn mở\r\n- Phát triển các phần mềm, giải pháp dựa trên nền công nghệ Internet / Intranet / bộ duyệt.\r\n\r\n- Phát triển các phần mềm điều khiển công nghiệp.\r\n\r\n- Phát triển các ứng dụng dựa trên nền khách/chủ và mạng máy tính.\r\n\r\n- Phát triển giải pháp CNTT dành cho các doanh nghiệp vừa và nhỏ.</td>\r\n<td valign="top"><img src="http://vielina.com/Uploads/Articles/Images/gioithieu/it.gif" alt="" width="204" height="132" />\r\n\r\n- Phát triển các hệ thống quản lý trong y tế và hệ thống quản lý trong trường học\r\n\r\n- Đào tạo phổ cập và đào tạo nâng cao về CNTT.</td>\r\n</tr>\r\n</tbody>\r\n</table>\r\n</div>\r\n<table id="table8" border="0" width="100%" cellspacing="3" cellpadding="2">\r\n<tbody>\r\n<tr>\r\n<td valign="top"><strong>Cơ điện tử </strong></td>\r\n<td valign="top"></td>\r\n</tr>\r\n<tr>\r\n<td valign="top">- Robotics và ứng dụng\r\n\r\n- Ứng dụng công nghệ CAD/CAM trong thiết kế chế tạo các hệ thống CNC và CNC thông minh phục vụ ngành công nghiệp chế tạo máy.\r\n- Nghiên cứu thiết kế chế tạo các Robot làm việc trong môi trường độc hại và không an toàn</td>\r\n<td valign="top"><img src="http://vielina.com/Uploads/Articles/Images/gioithieu/codientu.GIF" alt="" width="224" height="145" /></td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Lĩnh vực chuyên môn', '', 'inherit', 'open', 'open', '', '309-revision-v1', '', '', '2016-04-25 09:55:42', '2016-04-25 09:55:42', '', 309, 'http://elatec.com.vn/?p=310', 0, 'revision', '', 0),
