(324, 1, '2016-04-25 10:17:54', '2016-04-25 10:17:54', 'Phòng nghiên cứu phát triển\r\n\r\nTrưởng phòng: TS. Nguyễn Thế Vinh\r\nĐiện thoại liên hệ: 0914871304\r\nEmail: ntvcie@yahoo.com\r\nĐịa chỉ phòng làm việc: 04, Dốc K10, Ngõ 445, Lạc Long Quân, Tây Hồ, Hà Nội\r\n\r\nĐiện thoại: 04.2581705 ( Máy lẻ 116)\r\n\r\nEmail: tkkt@elatec.com.vn\r\n\r\nTiềm lực phát triển:\r\n\r\nPhòng Chuyển giao công nghệ hiện có 9 cán bộ, trong đó có 4 TS 5 KS chuyên ngành điều khiển, đo lường, tự động hoá, và công nghệ thông tin.\r\nCác hướng nghiên cứu chính:\r\n\r\n- Tham gia xây dựng định hướng chiến lược phát triển Công ty, Viện và ngành điện tử, cơ điện tử, tự động hoá.\r\n\r\n- Nghiên cứu, tiếp thu các tiến bộ KHKT trong nước và trên thế giới\r\n\r\n- Nghiên cứu các loại công nghệ nền, công nghệ cơ bản thuộc lĩnh vực điện tử, cơ điện tử, và đo lường, tự động hoá.\r\n\r\n- Xây dựng thuyết minh, tham dự tuyển chọn các nhiệm vụ KHCN các cấp và chủ trì thực hiện các nhiệm vụ này khi được chọn.\r\n\r\n- Thực hiện chức năng tư vấn, thẩm định đề tài dự án, các dây chuyền công nghệ thuộc lĩnh vực điện tử, cơ điện tử, tự động hoá và các dịch vụ KHKT khác.\r\n\r\n- Tham gia đào tạo nguồn nhân lực KHCN theo chức năng, nhiệm vụ đào tạo của Công ty và Viện.', 'Phòng nghiên cứu và phát triển', '', 'inherit', 'open', 'open', '', '323-revision-v1', '', '', '2016-04-25 10:17:54', '2016-04-25 10:17:54', '', 323, 'http://elatec.com.vn/?p=324', 0, 'revision', '', 0),
