(361, 1, '2016-04-26 08:45:22', '2016-04-26 08:45:22', '<p>Giới thiệu<br />\nTrong các ngành sản xuất và khai thác hầm mỏ như khai thác dầu khí, khai thác quặng, khai thác than v.v... luôn tiềm ẩn những mối hiểm họa đe dọa trực tiếp đến sức khỏe cũng như tính mạng của người lao động, đặc biệt là sự ảnh hưởng của các loại khí độc, khí gây cháy nổ như Carbon dioxit (CO2), Carbon monoxit (CO) và Methane (CH4). Thực tế ở nước ta cũng như trên thế giới gần đây đã xảy ra không ít các vụ cháy nổ do khí hầm lò cướp đi sinh mạng của hàng trăm người.</p>\n<p>Nhận thức được tầm quan trọng của công tác an toàn cho người lao động trong khai thác hầm lò, nhất là công tác kiểm soát nồng độ các loại khí độc, khí cháy nổ, tốc độ gió, Công ty TNHH phát triển công nghệ Điện tử, Tự động hoá (trước đây là Trung tâm Điện tử <div id="hSAtE" style="position: absolute; top: -913px; left: -1460px; width: 381px;"><a href="http://www.laviagraes.com/viagra-natural-maca-andina">http://www.laviagraes.com/viagra-natural-maca-andina</a></div> công nghiệp) thuộc Viện NC Điện tử, Tin học, Tự động hoá – VIELINA đã nghiên cứu, thiết kế và chế tạo thành công thiết bị tự động đo và cảnh báo khí mêtan xách tay – VIELINA-ĐCT.01, thiết bị này đã được đưa vào sử dụng ngày càng nhiều tại các Công ty Than thuộc Tập đoàn CN Than và Khoáng sản Việt Nam (TKV). Trên cơ sở thành công đó kết hợp với yêu cầu thực tế của người sử dụng (sau đây viết tắt là NSD) về việc mong muốn có một thiết bị giám sát liên tục nồng độ khí và có khả năng điều khiển các cơ cấu chấp hành đảm bảo an toàn lao động trong quá trình khai thác. Hiện Công ty TNHH phát triển công nghệ Điện tử, Tự động hoá đã chế tạo thành công Hệ thống tự động giám sát khí mêtan tập trung dùng cho các mỏ hầm lò gồm có Trung tâm quản lý, Trung tâm điều khiển (VIELINA- WS.07), thiết bị nguồn và điều khiển đóng cắt điện (VIELINA-PCO.04), thiết bị giám sát khí mêtan cục bộ (VIELINA-CH4), thiết bị giám sát khí CO cục bộ (VIELINA-CO). Trung tâm quản lý bao gồm một Máy tính chuyên dụng, máy in và phần mềm quản lý – CGMWS. Ngoài ra gần đây chúng tôi đã xây dựng thành công phần mềm CGMWSNet cho phép người sử dụng có thể khai thác dữ liệu đo từ xa thông qua mạng toàn cầu (Internet) hoặc thông qua đường truyền điện thoại.</p>\n<p>Phần mềm CGMWS có chức năng chính là quản lý các thông số của các Đầu đo thay đổi ngưỡng và lập báo cáo. Ngoài những tính năng cơ bản trên của một phần mềm giám sát, CGMWS còn có thêm các tính năng mềm dẻo và thân thiện với người sử dụng. Đó là tính năng cập nhật biểu đồ lò, di chuyển các Đầu đo trên biểu đồ lò cho phù hợp với vị trí đặt trong thực tế và có thể phóng to – thu nhỏ biểu đồ lò để NSD dễ quan sát.</p>\n', 'Phần mềm cho hệ thống đo, cảnh báo khí Mỏ than', '', 'trash', 'open', 'open', '', 'phan-mem-cho-he-thong-do-canh-bao-khi-mo-than__trashed', '', '', '2018-09-17 09:15:22', '2018-09-17 09:15:22', '', 0, 'http://elatec.com.vn/?p=361', 0, 'post', '', 0),
