(403, 1, '2016-05-16 05:25:10', '2016-05-16 05:25:10', '<a href="http://elatec.com.vn/wp-content/uploads/2016/05/4.png"><img class=" size-full wp-image-404 aligncenter" src="http://elatec.com.vn/wp-content/uploads/2016/05/4.png" alt="4" width="195" height="183" /></a>\r\n\r\nBộ giám sát thiết bị điện VIELINA- GSĐ được sử dụng trong hầm lò để giám sát trạng thái hoạt động của các thiết bị cơ điện. Bộ giám sát VIELINA- GSĐ được thiết kế có thể tích hợp được với các Hệ thống giám sát tập trung hầm lò và Hệ thống giám sát môi trường hầm lò.\r\n\r\n<b>ĐẶC </b><b>TÍNH KỸ </b><b>THUẬT</b>\r\n<ul>\r\n	<li>Hiển thị trạng thái hoạt động của thiết bị điện bằng LED</li>\r\n	<li>Phát hiện dòng điện xoay chiều một pha hoặc ba pha nhỏ nhất là 5A</li>\r\n	<li>Cổng kết nối truyền thông RS485 hoặc Ethernet tới máy tính trung tâm để giám sát từ xa</li>\r\n	<li>Thiết kế và chế tạo theo tiêu chuẩn TCVN 7079-0 và TCVN 7079-11 dùng trong hầm lò</li>\r\n</ul>\r\n&nbsp;<a href="http://911-essay.com">911-essay.com</a>', 'Bộ giám sát thiết bị điện sử dụng trong khai thác hầm lò', '', 'trash', 'open', 'open', '', 'bo-giam-sat-thiet-bi-dien-su-dung-trong-khai-thac-ham-lo__trashed', '', '', '2018-09-17 09:15:10', '2018-09-17 09:15:10', '', 0, 'http://elatec.com.vn/?p=403', 0, 'post', '', 0),
