(587, 1, '2017-05-15 02:00:11', '2017-05-15 02:00:11', '<table width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="414">  Công ty TNHH Một thành viên Phát triển Công nghệ Điện tử, Tự động hóa (ELATEC Co. ltd) tiền thân là Trung tâm Điện tử Công nghiệp trực thuộc Viện NC Điện tử, Tin học, Tự động hóa. Công ty được thành lập chính thức ngày 2/8/2007 theo quyết định số 170/QĐ-VĐT của Viện Trưởng Viện NC Điện tử, Tin học, Tự động hóa và được Sở Kế hoạch Đầu tư Hà Nội cấp giấy phép kinh doanh số 0104001844 ngày 31/08/2007. Công ty là cơ quan tiêu biểu của Viện trong nghiên cứu triển khai KHCN cũng như áp dụng các nghiên cứu KHCN vào sản xuất.Ngay từ <a href="http://cialisfrance24.com/">cialisfrance24.com</a> những ngày đầu mới thành lập, Lãnh đạo Công ty đã rất chú trọng việc hoạch định chiến lược phát triển, xây dựng tiềm lực KHCN cả về cơ sở vật chất, cả về nguồn lực con người, nhằm hoàn thành tốt nhiệm vụ KHCN.Song song với việc thực hiện các nhiệm vụ NCKH &amp; PTCN Công ty đã và đang đào tạo nhiều học viên đại học và sau đại học, trong đó hàng chục học viên đã bảo vệ thành công luận văn tốt nghiệp đại học và sau đại học. Kết quả nghiên cứu khoa học của nhiều đề tài đã được chuyển thành các dự án SXTN để tiếp tục hoàn thiện và chuyển giao cho các cơ sở sản xuất và trường học, góp phần quan trọng cho sự nghiệp Công nghiệp hoá và Hiện đại hoá đất nước.</td>\r\n<td width="244"> <a href="http://elatec.com.vn/wp-content/uploads/2016/04/12.jpg"><img class="  alignnone wp-image-289" src="http://elatec.com.vn/wp-content/uploads/2016/04/12-177x300.jpg" alt="12" width="272" height="462" /></a></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2" width="658">     Hiện nay với vai trò là cơ quan chủ trì nhiều đề tài nghiên cứu KHCN cấp Nhà nước và cấp Bộ về Điện tử, Tự động hoá công tác nghiên cứu phát triển và triển khai ứng dụng là nhiệm vụ ưu tiên hàng đầu của Công ty. Bên cạnh việc nghiên cứu ứng dụng, Công ty tập trung chủ yếu vào nghiên cứu phát triển các công nghệ nền của hệ thống các ngà