(751, 1, '2018-04-15 16:45:57', '2018-04-15 16:45:57', '<table width="100%">\r\n<tbody>\r\n<tr>\r\n<td width="414">  Công ty TNHH Một thành viên Phát triển Công nghệ Điện tử, Tự động hóa (ELATEC Co. ltd) tiền thân là Trung tâm Điện tử Công nghiệp trực thuộc Viện NC Điện tử, Tin học, Tự động hóa. Công ty được thành lập chính thức ngày 2/8/2007 theo quyết định số 170/QĐ-VĐT của Viện Trưởng Viện NC Điện tử, Tin học, Tự động hóa và được Sở Kế hoạch Đầu tư Hà Nội cấp giấy phép kinh doanh số 0104001844 ngày 31/08/2007. Công ty là cơ quan tiêu biểu của Viện trong nghiên cứu triển khai KHCN cũng như áp dụng các nghiên cứu KHCN vào sản xuất.Ngay từ những ngày đầu mới thành lập, Lãnh đạo Công ty đã rất chú trọng việc hoạch định chiến lược phát triển, xây dựng tiềm lực KHCN cả về cơ sở vật chất, cả về nguồn lực con người, nhằm hoàn thành tốt nhiệm vụ KHCN.Song song với việc thực hiện các nhiệm vụ NCKH &amp; PTCN Công ty đã và đang đào tạo nhiều học viên đại học và sau đại học, trong đó hàng chục học viên đã bảo vệ thành công luận văn tốt nghiệp đại học và sau đại học. Kết quả nghiên cứu khoa học của nhiều đề tài đã được chuyển thành các dự án SXTN để tiếp tục hoàn thiện và chuyển giao cho các cơ sở sản xuất và trường học, góp phần quan trọng cho sự nghiệp Công nghiệp hoá và Hiện đại hoá đất nước.</td>\r\n<td width="244"> <a href="http://elatec.com.vn/wp-content/uploads/2016/04/12.jpg"><img class="  alignnone wp-image-289" src="http://elatec.com.vn/wp-content/uploads/2016/04/12-177x300.jpg" alt="12" width="272" height="462" /></a></td>\r\n</tr>\r\n<tr>\r\n<td colspan="2" width="658">     Hiện nay với vai trò là cơ quan chủ trì nhiều đề tài nghiên cứu KHCN cấp Nhà nước và cấp Bộ về Điện tử, Tự động hoá công tác nghiên cứu phát triển và triển khai ứng dụng là nhiệm vụ ưu tiên hàng đầu của Công ty. Bên cạnh việc nghiên cứu ứng dụng, Công ty tập trung chủ yếu vào nghiên cứu phát triển các công nghệ nền của hệ thống các ngành công nghệ cao thuộc lĩnh vực Điện tử, Tin học, Tự động hoá.</td>\r\n</tr>\r\n</tbody>\r\n</table>', 'Giới thiệu chung', '', 'inherit', 'open', 'open', '', '293-revision-v1', '', '', '2018-04-15 16:45:57', '2018-04-15 16:45:57', '', 293, 'http://elatec.com.vn/?p=751', 0, 'revision', '', 0),
(782, 1, '2018-09-17 04:38:33', '2018-09-17 04:38:33', '<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;"> GIỚI THIỆU HỆ THỐNG</span>\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 14pt;">       Mô hình của hệ thống điều khiển giám sát tập trung xây dựng phục vụ quản lý, giám\r\nsát điều hành tập trung tại phòng điều khiển trung tâm của mỏ. Tại đây có thể giám sát\r\nvà điều khiển từ xa các hệ thống thiết bị trong lò hoặc ngoài mặt bằng, đồng thời có thể\r\nphân phối dữ liệu trao đổi dữ liệu từ xa được cấp hoặc phân quyền theo nhu cầu của\r\nngười dùng hay từng bộ phận, phân xưởng.</span>\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;">CẤU TRÚC HỆ THỐNG</span>\r\n\r\n<span style="font-family: ''times new roman'', times, serif; font-size: 14pt;"> <span class="fontstyle0">Mô hình hệ thống được chia làm ba nhóm:\r\n</span><span class="fontstyle2">- Nhóm các hệ thống quản lý tập trung bao gồm:\r\n</span><span class="fontstyle0">+ Hệ thống quản lý chấm công, mượn trả đèn lò, bình tự cứu, quản lý ăn ca...\r\n+ Hệ thống cân băng tải, cân xe ô tô\r\n+ Hệ thống kiểm soát trạm bảo vệ\r\n</span><span class="fontstyle2">- Nhóm các hệ thống điều khiển, giám sát trên mặt bằng bao gồm:\r\n</span><span class="fontstyle0">+ Hệ thống màn hình ghép công nghiệp kích thước lớn\r\n+ Hệ thống điều khiển giám sát trạm điện\r\n+ Hệ thống điều khiển giám sát trạm khí nén\r\n+ Hệ thống điều khiển giám sát trạm quạt\r\n</span><span class="fontstyle2">- Nhóm các hệ thống điều khiển giám sát dưới lò:\r\n</span><span class="fontstyle0">+ Hệ thống mạng vòng Ethernet cáp quang công nghiệp trong lò\r\n+ Hệ thống giám sát bằng hình ảnh\r\n+ Hệ thống thông tin liên lạc vô tuyến, thông tin cứu hộ cứu nạn, ứng cứu khắc phục sự\r\ncố\r\n+ Hệ thống phát thanh mỏ\r\n+ Hệ thống giám sát khí mỏ\r\n+ Hệ thống giám sát, định vị người trong hầm lò\r\n+ Hệ thống tự động điều khiển bơm thoát nước mỏ\r\n+ Hệ thống tự động hóa băng tải\r\n+ Hệ thống điều khiển cửa gió tự động.</span></span>\r\n\r\n&nbsp;\r\n\r\n<hr />\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span>', 'Sản phẩm', '', 'publish', 'closed', 'closed', '', 'san-pham', '', '', '2018-09-20 09:27:55', '2018-09-20 09:27:55', '', 0, 'http://elatec.com.vn/?page_id=782', 0, 'page', '', 0),
