(803, 1, '2018-09-20 09:22:16', '2018-09-20 09:22:16', '<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;"> GIỚI THIỆU HỆ THỐNG</span>\n\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 14pt;"> Mô hình của hệ thống điều khiển giám sát tập trung xây dựng phục vụ quản lý, giám\nsát điều hành tập trung tại phòng điều khiển trung tâm của mỏ. Tại đây có thể giám sát\nvà điều khiển từ xa các hệ thống thiết bị trong lò hoặc ngoài mặt bằng, đồng thời có thể\nphân phối dữ liệu trao đổi dữ liệu từ xa được cấp hoặc phân quyền theo nhu cầu của\nngười dùng hay từng bộ phận, phân xưởng.</span>\n\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;">CẤU TRÚC HỆ THỐNG</span>', 'Sản phẩm', '', 'inherit', 'closed', 'closed', '', '782-autosave-v1', '', '', '2018-09-20 09:22:16', '2018-09-20 09:22:16', '', 782, 'http://elatec.com.vn/?p=803', 0, 'revision', '', 0),
(804, 1, '2018-09-20 09:21:26', '2018-09-20 09:21:26', '<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;"> GIỚI THIỆU HỆ THỐNG</span>\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 14pt;"> Mô hình của hệ thống điều khiển giám sát tập trung xây dựng phục vụ quản lý, giám\r\nsát điều hành tập trung tại phòng điều khiển trung tâm của mỏ. Tại đây có thể giám sát\r\nvà điều khiển từ xa các hệ thống thiết bị trong lò hoặc ngoài mặt bằng, đồng thời có thể\r\nphân phối dữ liệu trao đổi dữ liệu từ xa được cấp hoặc phân quyền theo nhu cầu của\r\nngười dùng hay từng bộ phận, phân xưởng. </span>', 'Sản phẩm', '', 'inherit', 'closed', 'closed', '', '782-revision-v1', '', '', '2018-09-20 09:21:26', '2018-09-20 09:21:26', '', 782, 'http://elatec.com.vn/?p=804', 0, 'revision', '', 0),
(805, 1, '2018-09-20 09:23:54', '2018-09-20 09:23:54', '<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;"> GIỚI THIỆU HỆ THỐNG</span>\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 14pt;"> Mô hình của hệ thống điều khiển giám sát tập trung xây dựng phục vụ quản lý, giám\r\nsát điều hành tập trung tại phòng điều khiển trung tâm của mỏ. Tại đây có thể giám sát\r\nvà điều khiển từ xa các hệ thống thiết bị trong lò hoặc ngoài mặt bằng, đồng thời có thể\r\nphân phối dữ liệu trao đổi dữ liệu từ xa được cấp hoặc phân quyền theo nhu cầu của\r\nngười dùng hay từng bộ phận, phân xưởng.</span>\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;">CẤU TRÚC HỆ THỐNG</span>\r\n\r\n<span style="font-family: ''times new roman'', times, serif; font-size: 14pt;"> <span class="fontstyle0">Mô hình hệ thống được chia làm ba nhóm:\r\n</span><span class="fontstyle2">- Nhóm các hệ thống quản lý tập trung bao gồm:\r\n</span><span class="fontstyle0">+ Hệ thống quản lý chấm công, mượn trả đèn lò, bình tự cứu, quản lý ăn ca...\r\n+ Hệ thống cân băng tải, cân xe ô tô\r\n+ Hệ thống kiểm soát trạm bảo vệ\r\n</span><span class="fontstyle2">- Nhóm các hệ thống điều khiển, giám sát trên mặt bằng bao gồm:\r\n</span><span class="fontstyle0">+ Hệ thống màn hình ghép công nghiệp kích thước lớn\r\n+ Hệ thống điều khiển giám sát trạm điện\r\n+ Hệ thống điều khiển giám sát trạm khí nén\r\n+ Hệ thống điều khiển giám sát trạm quạt\r\n</span><span class="fontstyle2">- Nhóm các hệ thống điều khiển giám sát dưới lò:\r\n</span><span class="fontstyle0">+ Hệ thống mạng vòng Ethernet cáp quang công nghiệp trong lò\r\n+ Hệ thống giám sát bằng hình ảnh\r\n+ Hệ thống thông tin liên lạc vô tuyến, thông tin cứu hộ cứu nạn, ứng cứu khắc phục sự\r\ncố\r\n+ Hệ thống phát thanh mỏ\r\n+ Hệ thống giám sát khí mỏ\r\n+ Hệ thống giám sát, định vị người trong hầm lò\r\n+ Hệ thống tự động điều khiển bơm thoát nước mỏ\r\n+ Hệ thống tự động hóa băng tải\r\n+ Hệ thống điều khiển cửa gió tự động</span></span>\r\n\r\n<span class="fontstyle0" style="font-family: ''times new roman'', times, serif; font-size: 18pt;">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span>', 'Sản phẩm', '', 'inherit', 'closed', 'closed', '', '782-revision-v1', '', '', '2018-09-20 09:23:54', '2018-09-20 09:23:54', '', 782, 'http://elatec.com.vn/?p=805', 0, 'revision', '', 0);
