(812, 1, '2018-09-24 09:00:26', '2018-09-24 09:00:26', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>CẤU TRÚC HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle2">Hệ thống quản lý tự mượn quần áo, đèn lò, bình tự cứu gồm:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thẻ từ ứng với thông tin từng cán bộ công nhân viên.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Các bộ đọc thẻ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống các barie kiểm soát vào ra của nhà đèn.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát người ra, vào.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.\r\n</span><span class="fontstyle0">\r\n<strong><span style="font-size: 14pt;">CHỨC NĂNG HỆ THỐNG</span></strong>\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cho phép cán bộ công nhân viên mượn, trả các vật dụng cần thiết để đi vào lò tự\r\nđộng bằng việc quẹt thẻ qua các bộ đọc thẻ\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động đóng mở barie, một người/ 1 lần/1 cổng\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Báo cáo thống kê, kiểm soát, hiển thị số lượng người mượn trả trên phần mềm theo\r\nca kíp.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thông tin hệ thống là cơ sở để quản lý đối chiếu với hệ thống quản lý người ra vào\r\nlò.</span> </span>', 'HT quản lý tự mượn quần áo, đèn lò, bình tự cứu', 'Hệ thống quản lý tự mượn quần áo, đèn lò, bình tự cứu là hệ thống quản lý việc mượn trả các vật dụng cần thiết cho cán bộ công nhân viên như quần áo, ủng, đèn lò, bình tự cứu…tự động thông qua việc quét qua các đầu đọc được lắp đặt tại các cửa mượn và cửa trả.', 'publish', 'closed', 'closed', '', 'he-thong-quan-ly-cham-cong-muon-tra-den-lo-binh-tu-cuu-quan-ly-an-ca', '', '', '2018-10-09 07:38:33', '2018-10-09 07:38:33', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=812', 0, 'san_pham', '', 0),
(813, 1, '2018-09-24 09:00:44', '2018-09-24 09:00:44', '<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><span style="font-size: 12pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle2">Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua\r\ntrạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển\r\nthan, tăng tốc độ lưu thông. Hệ thống cũng tích hợp chức năng nhận dạng biến số xe\r\nTất cả dữ liệu hệ thống đọc được sẽ được lưu trữ đồng bộ lên cơ sở dữ liệu giúp người\r\nvận hành có thể tổng hợp, khai thác dữ liệu dễ dàng, đồng thời hệ thống hỗ trợ theo dõi\r\nqua Internet.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\r\n</span><span class="fontstyle0"><span style="font-size: 12pt;"><strong>CẤU TRÚC HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle2">Hệ thống gồm:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Barie điện chế độ điều khiển tự động hoặc bán tự động.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cân ô tô (có thể dùng sẵn của mỏ ).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát xe.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><span style="font-size: 14pt;"><strong><span style="font-size: 12pt;">CHỨC NĂNG HỆ THỐNG\r\n</span></strong></span></span></span><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle3">• </span><span class="fontstyle2">Tự động mở barie khi có xe chuẩn bị vào cân.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng xe qua biển số xe và thẻ UHF.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận diện vị trí xe trên cân.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động ổn định trọng lượng.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mã hóa phiếu cân bằng mã QR code.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Xem dữ liệu báo cáo từ xa (dữ liệu báo cáo được tập trung và xem trên web).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ hình ảnh biển số xe và toàn cảnh xe khi qua cân.</span></span>', 'Hệ thống cân băng tải, cân xe ô tô', 'Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua trạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển than, tăng tốc độ lưu thông.', 'publish', 'closed', 'closed', '', 'he-thong-can-bang-tai-can-xe-o-to', '', '', '2018-10-09 08:36:05', '2018-10-09 08:36:05', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=813', 0, 'san_pham', '', 0),
(814, 1, '2018-09-24 09:01:02', '2018-09-24 09:01:02', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle2">Hàng ngày có rất nhiều phương tiện ô tô qua lại và ra vào công trường bao gồm xe\r\nđưa đón cán bộ công nhân, xe vận chuyển vật liệu, xe vận chuyển than. Hiện nay hầu hết\r\ncác cửa ra vào có bố trí các nhân viên bảo vệ kiểm soát ghi chép biển số, thời điểm ra\r\nvào bằng tay, gác chắn barie đóng mở bằng tay hoặc bán tự động. Để khắc phục những\r\nhạn chế của phương pháp barie kéo tay truyền thống giải pháp đề xuất là lắp đặt các thiết\r\nbị kỹ thuật số giám sát, kiểm soát tự động các phương tiện qua cổng.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\r\n</span><span class="fontstyle0"><strong><span style="font-size: 14pt;">CẤU TRÚC HỆ THỐNG</span></strong>\r\n</span><span class="fontstyle2">Hệ thống kiểm soát ra vào tại trạm bảo vệ khai trường có cấu trúc:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mạng Ethenet kết nối các thiết bị và máy tính.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống barie đóng mở kiểm soát phương tiện vào ra mỏ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera nhận dạng xe và lưu trữ biển số xe ra vào.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển và cấu hình hệ thống.\r\n</span><span class="fontstyle0">\r\n<span style="font-size: 14pt;"><strong>CHỨC NĂNG HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển đóng mở barie bằng nút bấm nhanh chóng dễ dàng.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng biến số xe cơ giới khi qua cổng.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Báo cáo, thống kê, đối chiếu số liệu tức thời, trong các ca sản xuất.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ video từ camera để kiểm tra khi cần.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\r\n</span><span style="font-size: 14pt;"><strong><span class="fontstyle0">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span> </strong></span></span>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-tram-bao-ve.png"><img class="alignnone size-medium wp-image-870" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-tram-bao-ve-300x214.png" alt="" width="300" height="214" /></a>', 'Hệ thống kiểm soát trạm bảo vệ', 'Hàng ngày có rất nhiều phương tiện ô tô qua lại và ra vào công trường bao gồm xe đưa đón cán bộ công nhân, xe vận chuyển vật liệu, xe vận chuyển than. Hiện nay hầu hết các cửa ra vào có bố trí các nhân viên bảo vệ kiểm soát ghi chép biển số, thời điểm ra vào bằng tay, gác chắn barie đóng mở bằng tay hoặc bán tự động. ', 'publish', 'closed', 'closed', '', 'he-thong-kiem-soat-tram-bao-ve', '', '', '2018-10-08 07:53:16', '2018-10-08 07:53:16', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=814', 0, 'san_pham', '', 0),
(815, 1, '2018-09-24 09:01:24', '2018-09-24 09:01:24', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống hiển thị màn hình ghép ma trận LCD được cung cấp theo yêu cầu thiết kế\r\n(3x4 hoặc 4x6 với màn hình 46", 55"), khoảng cách ghép giữa các màn hình nhỏ. Đây là\r\nkỹ thuật hiển thị LCD tiên tiến nhất trên thế giới, với kỹ thuật xử lý đồ họa đa hình ảnh,\r\nkỹ thuật chuyển đổi thông tin được ứng dụng tổng hợp đồng nhất, hình thành hệ thống\r\nmàn hình LCD có độ nét cao, điều khiển thông minh, phương pháp thao tác tiên tiến.\r\nThông qua hệ thống màn hình ghép ma trận LCD có thể hiển thị trên màn hình lớn tín\r\nhiệu từ các máy tính, tín hiệu hình ảnh từ camera, thông số dữ liệu của các hệ thống, ...</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát màn hình công nghiệp gồm các bộ phận cấu thành:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Các màn hình công nghiệp: Mỗi màn hình có kích thước 46" hay 55", độ phân giải\r\ncao Full HD 1920x1080. Khoảng cách ghép giữa các màn hình: 3.5÷ 5.5mm\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Bộ ma trận VGA/HDMI: để lựa chọn các tín hiệu vào, cho phép lựa chọn và điều\r\nkhiển ra đồng thời nhiều luồng đi tới màn hình.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Bộ điều khiển liên kết: Dùng để ghép màn hình hoặc chia màn hình thông qua máy\r\ntính điều khiển.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống kết hợp kỹ thuật giám sát truyền hình công nghiệp và kỹ thuật xử lý hình\r\nảnh, thực hiện xử lý tức thời hệ thống giám sát hình ảnh, lưu giữ và phát lại.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống có thể đấu nối với cổng kết nối khác nhau để hiển thị các thông tin lên\r\nmàn hình như VGA, HDMI, DVI...\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống có thể lựa chọn các nguồn dữ liệu để hiển thị lên màn hình thông qua bộ\r\nđiều khiển ma trận. Dùng các thao tác trên phần mềm để điều khiển hiển thị hình ảnh\r\nmong muốn khi cần thiết, dễ dàng phóng to hay thu nhỏ khi cần thiết.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ CẤU TRÚC HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-man-hinh-ghep-cong-nghiep.png"><img class="alignnone size-medium wp-image-876" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-man-hinh-ghep-cong-nghiep-300x235.png" alt="" width="300" height="235" /></a>', 'Hệ thống màn hình ghép công nghiệp', 'Hệ thống hiển thị màn hình ghép ma trận LCD được cung cấp theo yêu cầu thiết kế (3x4 hoặc 4x6 với màn hình 46", 55"), khoảng cách ghép giữa các màn hình nhỏ. Đây là kỹ thuật hiển thị LCD tiên tiến nhất trên thế giới, với kỹ thuật xử lý đồ họa đa hình ảnh, kỹ thuật chuyển đổi thông tin được ứng dụng tổng hợp đồng nhất, hình thành hệ thống\r\nmàn hình LCD có độ nét cao, điều khiển thông minh, phương pháp thao tác tiên tiến.\r\nThông qua hệ thống màn hình ghép ma trận LCD có thể hiển thị trên màn hình lớn tín\r\nhiệu từ các máy tính, tín hiệu hình ảnh từ camera, thông số dữ liệu của các hệ thống, ...', 'publish', 'closed', 'closed', '', 'he-thong-man-hinh-ghep-cong-nghiep-kich-thuoc-lon', '', '', '2018-10-08 08:08:55', '2018-10-08 08:08:55', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=815', 0, 'san_pham', '', 0),
(816, 1, '2018-09-24 09:01:44', '2018-09-24 09:01:44', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát điều khiển các trạm biến áp và trạm phân phối từ xa qua mạng\r\ninternet và mạng LAN. Cho phép điều khiển từ xa các thiết bị đóng cắt ngoài trời đảm\r\nbảo an toàn khi thời tiết xấu. Liên động tự động chuyển nguồn cho trạm bơm và trạm\r\nquạt khi có sự cố mất một nguồn hoặc liên động khóa các trường hợp điều khiển sai\r\n(nếu có). Ngoài ra còn quản lý hiệu quả tiêu thụ điện năng trong sản xuất.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span></strong><span class="fontstyle0">\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị sơ đồ đơn tuyến hệ thống điện của trạm biến áp 35KV, 6KV và các trạm\r\nphân phối.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị các thông số điện năng cơ bản như: dòng điện các pha, điện áp các pha,\r\ncông suất phản kháng, công suất hiệu dụng, cos phi, tần số,...\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị trạng thái các máy cắt.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị các thông số thống kê về thời gian vận hành, số lần đóng/cắt để phục vụ\r\nbảo trì.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cài đặt các tham số cấu hình hệ thống.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cảnh báo khi có sự cố.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Lưu trữ các thông số điện năng và lưu trữ cảnh báo.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Báo cáo thống kê thông số điện năng và báo cáo cảnh báo.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động gửi báo cáo và cảnh báo vào email của người vận hành, quản lý.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Có các công cụ phân tích dữ liệu hiệu quả như dashboard, online trend.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> GIAO DIỆN PHẦN MỀM HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tram-dien.png"><img class="alignnone size-medium wp-image-878" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tram-dien-300x172.png" alt="" width="300" height="172" /></a>\r\n\r\n&nbsp;', 'Hệ thống điều khiển giám sát trạm điện', 'Hệ thống giám sát điều khiển các trạm biến áp và trạm phân phối từ xa qua mạng internet và mạng LAN. Cho phép điều khiển từ xa các thiết bị đóng cắt ngoài trời đảm bảo an toàn khi thời tiết xấu. Liên động tự động chuyển nguồn cho trạm bơm và trạm quạt khi có sự cố mất một nguồn hoặc liên động khóa các trường hợp điều khiển sai\r\n(nếu có). Ngoài ra còn quản lý hiệu quả tiêu thụ điện năng trong sản xuất.', 'publish', 'closed', 'closed', '', 'he-thong-dieu-khien-giam-sat-tram-dien', '', '', '2018-10-08 08:12:01', '2018-10-08 08:12:01', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=816', 0, 'san_pham', '', 0),
(817, 1, '2018-09-24 09:02:03', '2018-09-24 09:02:03', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống GSĐK trạm khí nén là hệ thống đồng bộ hoạt động các trạm khí nén. Tự\r\nđộng điều khiển bật/tắt các trạm khí nén khi có sự thay đổi của áp suất và theo quy trình\r\nvận hành nâng cao hiệu suất hoạt động của thiết bị. Đưa ra dự báo tình trạng hoạt động\r\ncủa trạm và các cảnh báo kịp thời khi có sự cố.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\r\n</span><span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Trạm DCS1.1 sẽ được đặt tại nhà máy nén khí.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính chủ đặt tại phòng điều khiển trung tâm sẽ trao đổi dữ liệu với DCS1.1 qua\r\nmạng cáp quang. Máy tính chủ cài đặt phần mềm có các chức năng cho hệ thống giám\r\nsát điều khiển trạm nén khí.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống điều khiển sẽ gồm 02 CPU kiểm tra giám sát chéo nhau và 01 màn hình\r\nhiển thị tại khu vực.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\r\n</span><strong><span class="fontstyle0">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span></strong><span class="fontstyle0">\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Chức năng phần mềm điều khiển PLC của trạm DCS1.1\r\n</span><span class="fontstyle2">- Có hai chế độ điều khiển từ PLC:\r\n+ Tự động hoàn toàn (Full Auto – FAUT): Điều khiển tự động hoàn toàn trạm khí nén\r\ntheo setpoint áp suất đặt trước.\r\n+ Bán tự động (Half Auto – HAUT): Điều khiển các máy nén khí từ xa qua Internet,\r\nmạng LAN và màn hình chạm TP.\r\n- Điều khiển luân phiên máy nén khí, tự động dừng khi chạy không tải.\r\n- Thu thập dữ liệu về dòng điện, điện áp cấp máy nén khí phục vụ cho chuẩn đoán tình\r\ntrạng của máy.\r\n- Cảnh báo các sự cố qua đèn, còi tại chỗ và đưa về hiển thị trên PC và TP.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Chức năng cơ bản của phần mềm trên TP của trạm DCS1.1\r\n</span><span class="fontstyle2">- Điều khiển hoàn toàn tự động, cho phép giảm thiểu nhân công vận hành.\r\n- Giám sát điều khiển qua mạng internet và mạng LAN.\r\n- Điều khiển chống sốc cho máy nén khí.\r\n- Tự động gửi báo cáo và cảnh báo vào email.\r\n- Giám sát chéo CPU và dự phòng online cảnh báo SMS khi có một CPU bị sự cố.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ CẤU TRÚC HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-khi-nen.png"><img class="alignnone size-medium wp-image-883" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-khi-nen-300x115.png" alt="" width="300" height="115" /></a>', 'Hệ thống điều khiển giám sát trạm khí nén', 'Hệ thống GSĐK trạm khí nén là hệ thống đồng bộ hoạt động các trạm khí nén. Tự động điều khiển bật/tắt các trạm khí nén khi có sự thay đổi của áp suất và theo quy trình vận hành nâng cao hiệu suất hoạt động của thiết bị. Đưa ra dự báo tình trạng hoạt động của trạm và các cảnh báo kịp thời khi có sự cố.', 'publish', 'closed', 'closed', '', 'he-thong-dieu-khien-giam-sat-tram-khi-nen', '', '', '2018-10-08 08:25:44', '2018-10-08 08:25:44', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=817', 0, 'san_pham', '', 0),
(818, 1, '2018-09-24 09:02:46', '2018-09-24 09:02:46', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống mạng Ethernet cáp quang công nghiệp được thiết kế trên cơ sở cấu trúc\r\nmạng vòng Ethernet, đây là là mạng đường trục của toàn bộ hệ thống giám sát điều\r\nkhiển tập trung. Hệ thống cho phép truyền tải toàn bộ thông tin, dữ liệu hai chiều giữa\r\ncác thiết bị với trung tâm điều khiển và ngược lại qua hệ thống cáp quang của các hệ\r\nthống con khác.\r\nHệ thống mạng Ethernet cáp quang công nghiệp sẽ linh hoạt trong thiết kế theo từng\r\ncấu hình ứng dụng khác nhau.</span> </span>\r\n\r\n<strong><span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span> </span></strong>\r\n<span style="font-family: arial, helvetica, sans-serif;">Hệ thống mạng Ethernet cáp quang công nghiệp có cấu trúc:</span>\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">• </span><span class="fontstyle0">Cáp quang kết nối trên mặt bằng và dưới hầm lò.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Kết nối các thiết bị chuyển mạch mạng vòng (Server) dưới lò với nhau và với bộ\r\nchuyển mạch tốc độ cao trên mặt bằng.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong> CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Cấu trúc mạng vòng đảm bảo tính dự phòng cao, các dữ liệu truyền tải trên hệ thống\r\ncó thể đi theo hai hướng tới trung tâm điều khiển.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Hệ thống có thiết bị chuyển mạch mạng vòng (Server) có cấu hình mạnh, tốc độ cho\r\nphép lên đến 1000Mbps và kết nối với các thiết bị theo chuẩn giao thức TCP/IP.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Mỗi Server có thể đấu nối với 7 thiết bị khác (giao thức TCP/IP). Server có nguồn\r\ndự phòng nên hệ thống đảm bảo làm việc liên tục không bị gián đoạn (tối thiểu 2h)</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-Ethernet-cap-quang-cong-nghiep.png"><img class="alignnone size-medium wp-image-885" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-Ethernet-cap-quang-cong-nghiep-300x188.png" alt="" width="300" height="188" /></a>', 'HT mạng vòng Ethernet cáp quang công nghiệp trong lò', 'Hệ thống mạng Ethernet cáp quang công nghiệp được thiết kế trên cơ sở cấu trúc mạng vòng Ethernet, đây là là mạng đường trục của toàn bộ hệ thống giám sát điều khiển tập trung. Hệ thống cho phép truyền tải toàn bộ thông tin, dữ liệu hai chiều giữa các thiết bị với trung tâm điều khiển và ngược lại qua hệ thống cáp quang của các hệ thống con khác.', 'publish', 'closed', 'closed', '', 'he-thong-mang-vong-ethernet-cap-quang-cong-nghiep-trong-lo', '', '', '2018-10-09 07:38:20', '2018-10-09 07:38:20', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=818', 0, 'san_pham', '', 0),
(819, 1, '2018-09-24 09:03:05', '2018-09-24 09:03:05', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống dùng để giám sát liên tục trong quá trình sản xuất và khai thác, để theo dõi các hoạt động, hỗ trợ cho công tác an toàn và điều hành sản xuất, kiểm soát các hoạt động cả trên mặt bằng và dưới lò. Hệ thống có thể theo dõi hình ảnh ở các khu vực quan trọng cần giám sát (như trạm bảo vệ, sân kho vật tư, nhà chờ bến xe, các vị trí hầm bơm, băng tải, máng cào, tời trục...) đồng thời tự động lưu trữ dữ liệu hình ảnh để làm dữ liệu, thuận tiện trong tìm kiếm hay xử lý công việc liên quan khi cần thiết.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong><span class="fontstyle2">\r\n</span><span class="fontstyle3">Hệ thống giám sát bằng hình ảnh bao gồm: hệ thống camera; hệ thống truyền dẫn, điều khiển; hệ thống hiển thị và lưu trữ.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống camera</span><span class="fontstyle3">: Thu nhận dữ liệu hình ảnh, xử lý hình ảnh, số hóa và thông qua mạng lưới truyền dẫn để truyền hình ảnh đến trung tâm điều khiển.\r\n- </span><span class="fontstyle6">Trên mặt bằng</span><span class="fontstyle3">:\r\n+ Camera cầu màu toàn phương vị.\r\n+ Camera cố định.\r\n- </span><span class="fontstyle6">Dưới hầm lò</span><span class="fontstyle3">:\r\n+ Camera hồng ngoại phòng nổ.\r\n+ Camera IP không dây.\r\nCác tín hiệu camera (dùng camera IP) được kết nối trực tiếp với thiết bị chuyển mạch mạng bằng cáp quang.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống truyền dẫn tín hiệu</span><span class="fontstyle3">: Truyền dẫn tín hiệu hình ảnh từ các camera về trung tâm điều khiển, đồng thời truyền các tín hiệu điều khiển từ trung tâm tới các camera. Cáp quang chống cháy dùng trong lò, cáp quang thông dụng trên mặt đất, cáp đồng trục, cổng nối dữ liệu, bộ chuyển đổi quang điện, bộ giải mã. Truyền dẫn tín hiệu thông qua hệ thống Ethernet cáp quang công nghiệp.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống lưu trữ, hiển thị và điều khiển</span><span class="fontstyle3">:\r\n- Hệ thống được lưu trữ trong đầu ghi video có nhiều ổ cứng dung lượng lớn.\r\n- Hiển thị: Hình ảnh được hiển thị trên hệ thống màn hình ghép.\r\n</span><span class="fontstyle0">CHỨC NĂNG HỆ THỐNG\r\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Hiển thị hình ảnh từ các camera giám sát lên màn hình máy tính, màn hình lớn lắp đặt tại phòng điều hành trung tâm\r\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Lưu trữ các video theo thời gian để kiểm tra theo dõi\r\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Tương thích với nhiều dòng camera khác nhau.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-bang-hinh-anh.png"><img class="alignnone size-medium wp-image-887" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-bang-hinh-anh-300x300.png" alt="" width="300" height="300" /></a>', 'Hệ thống giám sát bằng hình ảnh', 'Hệ thống dùng để giám sát liên tục trong quá trình sản xuất và khai thác, để theo dõi các hoạt động, hỗ trợ cho công tác an toàn và điều hành sản xuất, kiểm soát các hoạt động cả trên mặt bằng và dưới lò. Hệ thống có thể theo dõi hình ảnh ở các khu vực quan trọng cần giám sát (như trạm bảo vệ, sân kho vật tư, nhà chờ bến xe, các vị trí hầm bơm,\r\nbăng tải, máng cào, tời trục...) đồng thời tự động lưu trữ dữ liệu hình ảnh để làm dữ liệu,\r\nthuận tiện trong tìm kiếm hay xử lý công việc liên quan khi cần thiết.', 'publish', 'closed', 'closed', '', 'he-thong-giam-sat-bang-hinh-anh', '', '', '2018-10-08 08:43:41', '2018-10-08 08:43:41', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=819', 0, 'san_pham', '', 0),
(820, 1, '2018-09-24 09:03:25', '2018-09-24 09:03:25', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Đây là một hệ thống dùng để cung cấp thông tin về hình ảnh, âm thanh trực tiếp từ hiện trường trong lò - nơi xảy ra sự cố, về trung tâm chỉ huy cứu hộ. Hệ thống được thiết kế sử dụng kết hợp 02 phương thức truyền thông cáp quang và phát lặp wifi phù hợp với điều kiện hầm lò Việt Nam là nhỏ, hẹp và nhiều khúc cua. Tại trung tâm cứu hộ, Ban chỉ huy cứu hộ hoàn toàn quan sát trên phần mềm các hình ảnh từ các Thiết bị thu thập thông tin đầu cuối đa phương tiện gắn trên mũ nhân viên cứu hộ, biết được tình trạng xuất khí tại nơi xảy ra sự cố và có thể được trao đổi, chỉ huy trực tiếp với nhân viên cứu hộ qua điện thoại di động hoặc micro gắn trên mũ</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle5"><span class="fontstyle0"><strong>CẤU TRÚC  HỆ THỐNG</strong>\r\n</span></span><span class="fontstyle4">• </span><span class="fontstyle2">Trên mặt bằng</span><span class="fontstyle5">:\r\n- Tổng đài điện thoại VoIP, bàn điện thoại viên; máy tính chủ cài đặt phần mềm quản lý và điều khiển cuộc gọi; phần mềm hiển thị hình ảnh; </span><span class="fontstyle5">loa và micro để nghe và phát lệnh xuống khu vực sự cố</span><span class="fontstyle5">.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle2">Dưới hầm lò</span><span class="fontstyle5">:\r\n- Điện thoại di động dùng trong hầm lò.\r\n- May đo khí cầm tay đa thông số.\r\n- Thiết bị đầu cuối đa phương tiện: có camera di động dạng đèn lò, micro và loa\r\n- Các bộ thu phát tín hiệu Wifi:\r\n+ Các thiết bị tích hợp lắp đặt cố định: thiết bị đầu cuối VIELINA-SW.02; thiết bị chuyển mạch mạng vòng VIELINA-SW.01.\r\n+ Các thiết bị di động: thiết bị thu phát lặp VIELINA-WAPM được triển khai di động tới các vị trí chưa có sóng wifi.\r\n</span><span class="fontstyle5">+ Dây cáp quang loại nhỏ nhẹ tiện mang vác, di chuyển</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Dữ liệu về nồng độ các loại khí (CH4, CO, O2, CO2) thông qua các máy đo khí đa thông số mang bên người và hình ảnh trực tiếp từ hiện trường theo thời gian thực thông qua các camera IP không dây gắn trên mũ của nhân viên cứu hộ được thu thập, truyền về là lưu trữ bằng phần mềm tại trung tâm ứng cứu trên mặt bằng.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hỗ trợ đàm thoại 02 chiều qua các điện thoại di động hầm lò.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Truyền thông bằng hệ thống cáp quang kéo dài từ trên mặt bằng xuống đảm bảo tốc độ truyền cao ổn định, ít nhiễu, cho phép kết nối nhiều thiết bị đồng thời.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Khoảng cách lặp không dây giữa các trạm thu phát lặp lên tới 1000m và truyền không dây tới các thiết bị thu wifi tới 150m.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Các thiết bị mang theo trong lò đều có trang bị ắc qui cho phép hoạt động trong nhiều giờ.</span></span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thong-tin-cuu-ho-cuu-nan.png"><img class="alignnone size-medium wp-image-889" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thong-tin-cuu-ho-cuu-nan-300x260.png" alt="" width="300" height="260" /></a>', 'HT thông tin cứu hộ cứu nạn, ứng cứu khắc phục sự cố', 'Đây là một hệ thống dùng để cung cấp thông tin về hình ảnh, âm thanh trực tiếp từ hiện trường trong lò - nơi xảy ra sự cố, về trung tâm chỉ huy cứu hộ. Hệ thống được thiết kế sử dụng kết hợp 02 phương thức truyền thông cáp quang và phát lặp wifi phù hợp với điều kiện hầm lò Việt Nam là nhỏ, hẹp và nhiều khúc cua.', 'publish', 'closed', 'closed', '', 'he-thong-thong-tin-lien-lac-vo-tuyen-thong-tin-cuu-ho-cuu-nan-ung-cuu-khac-phuc-su-co', '', '', '2018-10-09 07:38:11', '2018-10-09 07:38:11', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=820', 0, 'san_pham', '', 0);
