(821, 1, '2018-09-24 09:03:45', '2018-09-24 09:03:45', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống Phát thanh được thiết kế theo tiêu chuẩn, quy cách an toàn trong môi trường mỏ hầm lò. Hệ thống sử dụng trong các trường hợp sơ tán khẩn cấp khi có sự cố, phát thông báo các bản tin hoạt động của mỏ, tuyên truyền giáo dục ý thức, kỷ luật lao động hay các bản nhạc nhằm tạo tâm lý sảng khoái, thoải mái cho người lao động trước, trong và sau mỗi ca làm việc mệt nhọc. Hệ thống ứng dụng công nghệ mạng Ethernet cáp quang để truyền âm thanh từ Máy tính chủ tại Phòng điều khiển trung tâm tới các Phân trạm phát thanh từ đó phát tới các thùng loa âm ly hay chiều ngược lại. Hệ thống phát thanh có thể quản lý lên tới 100 Phân trạm.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\r\nHệ thống phát thanh trong mỏ hầm lò cấu hình bao gồm:\r\n<span class="fontstyle2">• </span><span class="fontstyle3">Trên mặt bằng</span>: Máy chủ cài đặt phần mềm của hệ thống, để giám sát, điều khiển và quản lý các thiết bị của hệ thống; loa gọi tìm kiếm.\r\n<span class="fontstyle2">• </span><span class="fontstyle3">Dưới hầm lò</span>:\r\n- Phân trạm phát thanh an toàn tia lửa VIELINA-PTM.AT.\r\n- Thùng loa âm ly phòng nổ VIELINA-PTM.PN.\r\nCác phân trạm phát thanh và thùng loa âm ly được đặt dọc theo đường lò, các khu khai thác. Hệ thống truyền dẫn âm thanh thông qua mạng vòng ethernet cáp quang.\r\n</span><span class="fontstyle2">\r\n</span><span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Từ phòng điều tiết trung tâm có thể thông báo các bản tin xuống tất cả các phân trạm phát thanh và âm ly trong hầm lò hay một khu vực được lựa chọn. Trong cùng một thời điểm có thể phát các bản tin khác nhau đồng thời tới các khu vực khác nhau.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trao đổi, liên lạc trực tiếp hai chiều từ trung tâm tới một phân trạm phát thanh cụ thể và chiều ngược lại hay hai phân trạm với nhau.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Hệ thống được quản lý, giám sát điều khiển một cách trực quan từ phòng trung tâm.</span></span>\r\n\r\n<span class="fontstyle4" style="font-family: arial, helvetica, sans-serif;">\r\n<strong> <span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG</span>\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-phat-thanh.png"><img class="alignnone size-medium wp-image-894" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-phat-thanh-300x221.png" alt="" width="300" height="221" /></a>\r\n</strong></span>\r\n\r\n&nbsp;', 'Hệ thống phát thanh mỏ', 'Hệ thống Phát thanh được thiết kế theo tiêu chuẩn, quy cách an toàn trong môi trường mỏ hầm lò. Hệ thống sử dụng trong các trường hợp sơ tán khẩn cấp khi có sự cố, phát thông báo các bản tin hoạt động của mỏ, tuyên truyền giáo dục ý thức, kỷ luật lao động hay các bản nhạc nhằm tạo tâm lý sảng khoái, thoải mái cho người lao động trước,\r\ntrong và sau mỗi ca làm việc mệt nhọc.', 'publish', 'closed', 'closed', '', 'he-thong-phat-thanh-mo', '', '', '2018-10-08 09:19:41', '2018-10-08 09:19:41', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=821', 0, 'san_pham', '', 0),
(822, 1, '2018-09-24 09:04:06', '2018-09-24 09:04:06', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát khí mỏ kiểm soát liên tục về tình trạng xuất khí đồng thời đưa ra cảnh báo cũng như ra lệnh điều khiển ngắt các nguồn điện có thể phát sinh nguy hiểm về cháy nổ một cách kịp thời. Hệ thống cho phép quản lý, giám sát, lưu trữ các dữ liệu cũng như thông tin hoạt động của hệ thống. Các hệ thống đầu đo, cảm biến hoạt động liên tục 24/24h và hệ thống nguồn điện dự phòng đảm bảo hoạt động ngay cả khi mất điện lưới.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span>\r\n<span class="fontstyle0">Hệ thống giám sát khí mỏ bao gồm:\r\n</span></strong><span class="fontstyle2">• </span><span class="fontstyle3">Trên mặt bằng:\r\n</span><span class="fontstyle0">- </span><span class="fontstyle4">Máy tính chủ điều khiển</span><span class="fontstyle0">: Được cài đặt phần mềm của hệ thống đặt tại Phòng quan trắc dùng để cấu hình hệ thống, điều hành mọi hoạt động của hệ thống như cài đặt ngưỡng cảnh báo, ngưỡng cắt điện, cho phép đầu đo điều khiển đóng cắt liên động. Ngoài ra phần mềm cho phép thu thập, hiển thị dữ liệu trên giao diện có đường lò, lưu trữ thông tin cần thiết theo thời gian, thống kê và phục vụ in ấn.\r\n</span><span class="fontstyle4">- Máy tính khách</span><span class="fontstyle0">: Đặt tại các phòng ban hoặc các cán bộ có liên quan để theo dõi số liệu đo phục vụ cho công tác điều hành sản xuất. Máy tính được kết nối thông qua mạng LAN.\r\n</span><span class="fontstyle4">- Tủ điều khiển giám sát trung tâm</span><span class="fontstyle0">: Được đặt tại phòng quan trắc dùng để cài đặt cấu hình hệ thống, điều khiển và giám sát các đầu đo, tự động cảnh báo khi có đầu đo của hệ thống vượt ngưỡng.\r\n</span><span class="fontstyle2">• </span><strong><span class="fontstyle3">Dưới hầm lò</span></strong><span class="fontstyle0">:\r\n- Các thiết bị đầu đo khí: CH4, CO, CO2, O2, H2, tốc độ gió, nhiệt độ, hạ áp,… lắp đặt tại các vị trí cần giám sát trong lò.\r\n- Thiết bị nguồn và điều khiển đóng cắt liên động.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong>\r\n<span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span>\r\n</strong><span class="fontstyle0">Hệ thống đảm bảo chức năng kiểm soát khí mỏ tự động và hoạt động liên lục 24/24 giờ.\r\n- Các dữ liệu đo được hiển thị tại chỗ và truyền về trung tâm phục vụ giám sát, cảnh báo và lưu trữ số liệu.\r\n- Vị trí và số liệu đo được hiển thị trực quan trên màn hình sơ đồ đường lò, dễ dàng cập nhật và di chuyển vị trí phù hợp với hiện trạng khai thác.\r\n- Các đầu đo, tủ điều khiển và máy tính điều khiển đều có tín hiệu cảnh bằng còi và đèn.</span> </span>\r\n<span style="font-family: arial, helvetica, sans-serif;">- Hệ thống có chức năng điều khiển đóng cắt điện tự động khi nồng độ khí vượt <span class="fontstyle0">ngưỡng cảnh báo nguy hiểm đặt trước. Các tín hiệu giải trừ được thực hiện tại máy tính hoặc tủ điều khiển trung tâm.\r\n- Các đầu đo có thể được cài đặt cấu hình ở chế độ hoạt động độc lập hoặc đồng bộ với hệ thống.\r\n- Hệ thống có giao diện tiếng Việt dễ dàng vận hành, sử dụng.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG</span>\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-khi-mo.png"><img class="alignnone size-medium wp-image-896" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-khi-mo-300x177.png" alt="" width="300" height="177" /></a></strong></span>\r\n\r\n&nbsp;', 'Hệ thống giám sát khí mỏ', 'Hệ thống giám sát khí mỏ kiểm soát liên tục về tình trạng xuất khí đồng thời đưa ra cảnh báo cũng như ra lệnh điều khiển ngắt các nguồn điện có thể phát sinh nguy hiểm về cháy nổ một cách kịp thời. Hệ thống cho phép quản lý, giám sát, lưu trữ các dữ liệu cũng như thông tin hoạt động của hệ thống. Các hệ thống đầu đo, cảm biến hoạt động liên tục 24/24h và hệ thống nguồn điện dự phòng đảm bảo hoạt động ngay cả khi mất điện lưới.', 'publish', 'closed', 'closed', '', 'he-thong-giam-sat-khi-mo', '', '', '2018-10-08 09:30:56', '2018-10-08 09:30:56', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=822', 0, 'san_pham', '', 0),
(823, 1, '2018-09-24 09:04:26', '2018-09-24 09:04:26', '<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'HT giám sát, định vị người trong hầm lò', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'publish', 'closed', 'closed', '', 'he-thong-giam-sat-dinh-vi-nguoi-trong-ham-lo', '', '', '2018-10-09 07:38:03', '2018-10-09 07:38:03', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=823', 0, 'san_pham', '', 0),
(824, 1, '2018-09-24 09:04:46', '2018-09-24 09:04:46', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống tự động điều khiển bơm thoát nước mỏ dùng cho các mỏ hầm lò có các tính năng tự động điều khiển bơm theo mức nước trong bể chứa, tự động điều khiển đóng mở các van, điều khiển động cơ bơm hoạt động luân phiên theo lịch lập sẵn. Có các tính năng điều khiển từ xa hoặc điều khiển tại chỗ, giám sát tình trạng hoạt động của hệ thống và có các chế độ bảo vệ tự động, đồng thời đưa ra các cảnh báo đến người dùng.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> CẤU TRÚC HỆ THỐNG </span></strong>\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">Hệ thống tự động điều khiển bơm thoát nước mỏ gồm ba thành phần chính:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tại phòng điều hành trung tâm</span><span class="fontstyle0">: Máy tính chủ cài đặt phần mềm hệ thống.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Dưới hầm lò</span><span class="fontstyle0">:\r\n+ Tủ giám sát điều khiển trung tâm (tủ GSĐKTT </span><span class="fontstyle0">VIELINA-ĐTT.PN</span><span class="fontstyle0">): 01 tủ.\r\n+ Tủ giám sát điều khiển khu vực (tủ GSĐKKV </span><span class="fontstyle0">VIELINA-ĐKV.PN</span><span class="fontstyle0">): tương ứng vào số lượng máy bơm.\r\n+ Các cảm biến: mức nước, lưu lượng, nhiệt độ, áp suất.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;">CHỨC NĂNG HỆ THỐNG\r\n</span></strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;">• </span><span class="fontstyle2" style="font-family: arial, helvetica, sans-serif;">Tính năng điều khiển</span><span class="fontstyle3" style="font-family: arial, helvetica, sans-serif;">:\r\n</span><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle3">- Điều khiển tự động: Các máy bơm được vận hành tự động theo đúng quy trình vận hành bơm của Mỏ. Số lượng máy bơm làm việc phụ thuộc vào mực nước trong hầm.\r\n- Điều khiển từ xa: Nhân viên vận hành có thể thao tác điều khiển từ xa tại phòng giám sát trên mặt bằng để lựa chọn đóng mở các tổ bơm.\r\n- Điều khiển tại chỗ: Tại mỗi bơm có một tủ VIELINA-ĐKV.PN, nhân viên vận hành có thể bấm nút đóng/ mở tại tủ giám sát điều khiển khu vực để ra lệnh điều khiển đóng hoặc mở các van mồi và van điều tiết.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Tính năng bảo vệ</span><span class="fontstyle3">:\r\n- Bảo vệ bơm trong các trường hợp:\r\n+ Ngắn mạch, quá tải, quá áp, mất pha,… thông qua khởi động mềm.\r\n+ Khi thiếu áp lực.\r\n+ Bị khí lọt vào buồng bơm.\r\n- Bảo vệ van năng suất:\r\n+ Bảo vệ ngắn mạch.\r\n+ Bảo vệ quá tải.\r\n+ Bảo vệ mất pha, sai pha.\r\n+ Kiểm tra cách điện trước khi khởi động.</span> </span>\r\n<span class="fontstyle0">• </span><span class="fontstyle2">Tính năng giám sát từ xa thông số hầm bơm</span><span class="fontstyle3">:\r\n- Mức nước tại hồ thu.\r\n- Lưu lượng nước tại đường ống đẩy.\r\n- Nhiệt độ các bơm.\r\n- Góc mở van năng suất.\r\n- Mức nước trong bình mồi nước.\r\n- Theo dõi các trạng thái hoạt động của van năng suất, máy bơm.\r\n- Tích hợp camera IP đặt tại hầm bơm để theo dõi hình ảnh hầm bơm.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Tính năng dự phòng</span><span class="fontstyle3">:\r\n- Dự phòng truyền thông.\r\n- Dự phòng chế độ điều khiển:\r\n+ Trong trường hợp Tủ VIELINA-ĐTT.PN bị sự cố, thì tất cả các Tủ VIELINA-ĐKV.PN sẽ tự động chuyển sang chế độ điều khiển tự động tại chỗ.\r\n+ Trong trường hợp Tủ VIELINA-ĐKV.PN bị sự cố về tính năng điều khiển tại chỗ thì người vận hành có thể chuyển chế độ của Tủ VIELINA-ĐKV.PN sang chế độ vận hành bằng tay, và điều khiển bằng các nút bấm trên tủ.</span>\r\n\r\n<strong> <span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG</span></strong>\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thoat-nuoc-ham-lo.png"><img class="alignnone size-medium wp-image-897" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thoat-nuoc-ham-lo-300x251.png" alt="" width="300" height="251" /></a>', 'HT tự động điều khiển bơm thoát nước mỏ', 'Hệ thống tự động điều khiển bơm thoát nước mỏ dùng cho các mỏ hầm lò có các tính năng tự động điều khiển bơm theo mức nước trong bể chứa, tự động điều khiển đóng mở các van, điều khiển động cơ bơm hoạt động luân phiên theo lịch lập sẵn. Có các tính năng điều khiển từ xa hoặc điều khiển tại chỗ, giám sát tình trạng hoạt động của hệ thống và có các chế độ bảo vệ tự động, đồng thời đưa ra các cảnh báo đến người dùng.', 'publish', 'closed', 'closed', '', 'he-thong-tu-dong-dieu-khien-bom-thoat-nuoc-mo', '', '', '2018-10-09 07:37:15', '2018-10-09 07:37:15', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=824', 0, 'san_pham', '', 0),
(825, 1, '2018-09-24 09:05:07', '2018-09-24 09:05:07', '<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'Hệ thống tự động hóa băng tải', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'publish', 'closed', 'closed', '', 'he-thong-tu-dong-hoa-bang-tai', '', '', '2018-09-27 07:33:30', '2018-09-27 07:33:30', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=825', 0, 'san_pham', '', 0),
(826, 1, '2018-09-24 09:05:29', '2018-09-24 09:05:29', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống điều khiển cửa gió tự động đảm nhiệm việc tự động mở/đóng cửa khi có người hoặc các phương tiện qua lại, đồng thời các trạng thái hoạt động của hệ thống được hiển thị, cảnh báo thông qua màn hình giám sát tại trung tâm. Hệ thống gồm có các cảm biến tự động nhận biết có người hoặc phương tiện đến gần cửa để tủ điều khiển ra lệnh điều khiển mở/đóng cửa thông qua bộ điều khiển thủy lực.</span>\r\n\r\n<strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong><span class="fontstyle3">\r\n</span><span class="fontstyle4">Cấu trúc hệ thống gồm 2 phần:\r\n</span><span class="fontstyle5">• </span><span class="fontstyle4">Phần trên mặt bằng là máy tính có cài đặt phần mềm giám sát trạng thái hoạt động của các cửa gió tự động trong lò.\r\n</span><span class="fontstyle5">• </span><span class="fontstyle2">Phần dưới hầm lò:\r\n</span><span class="fontstyle4">- Các cảm biến tự động nhận biết có người hay phương tiện đến gần,\r\n- Tủ điều khiển ra lệnh điều khiển bơm dầu, đóng mở van cấp dầu cho xy lanh điều khiển đóng mở cửa gió.</span>\r\n\r\n<span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống có các chức năng sau:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Tự động điều khiển: </span><span class="fontstyle2">Tự động phát hiện có người và tàu để ra lệnh đóng mở cửa.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Điều khiển bằng tay</span><span class="fontstyle2">: Ngoài tính năng tự động, hệ thống cho phép đóng mở cửa bằng tay.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trạng thái khẩn cấp</span><span class="fontstyle2">: Trong quá trình cửa đang đóng lại mà gặp vật cản, hệ thống sẽ điều khiển cửa gió mở cửa trở lại và đóng lại sau khi người hoặc phương tiện đã đi qua do hệ thống tích hợp cảm biến va chạm.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trạng thái sự cố</span><span class="fontstyle2">: Trong trường hợp có sự cố mất điện đột ngột, bộ phận bơm dầu và các van không hoạt động thì người dùng có thể sử dụng các van xả tay kết hợp với kết cấu cửa gió ngược khi đó sức người có thể đóng mở cửa gió được.</span>\r\n\r\n<strong> <span class="fontstyle0">MÔ HÌNH HỆ THỐNG</span>\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-cua-gio-tu-dong.png"><img class="alignnone size-medium wp-image-899" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-cua-gio-tu-dong-300x157.png" alt="" width="300" height="157" /></a></strong>', 'Hệ thống điều khiển cửa gió tự động', 'Hệ thống điều khiển cửa gió tự động đảm nhiệm việc tự động mở/đóng cửa khi có người hoặc các phương tiện qua lại, đồng thời các trạng thái hoạt động của hệ thống được hiển thị, cảnh báo thông qua màn hình giám sát tại trung tâm. Hệ thống gồm có các cảm biến tự động nhận biết có người hoặc phương tiện đến gần cửa để tủ điều khiển ra lệnh điều khiển mở/đóng cửa thông qua bộ điều khiển thủy lực.', 'publish', 'closed', 'closed', '', 'he-thong-dieu-khien-cua-gio-tu-dong', '', '', '2018-10-08 09:43:40', '2018-10-08 09:43:40', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=826', 0, 'san_pham', '', 0),
(827, 1, '2018-09-24 09:07:18', '2018-09-24 09:07:18', '<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'Hệ thống tự động vận chuyển than', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'publish', 'closed', 'closed', '', 'he-thong-tu-dong-van-chuyen-than', '', '', '2018-09-27 07:27:58', '2018-09-27 07:27:58', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=827', 0, 'san_pham', '', 0),
(828, 1, '2018-09-24 09:07:46', '2018-09-24 09:07:46', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát và điều khiển tự động toàn bộ các công đoạn của quá trình xử lý nước thải. Các thiết bị như máy bơm, máy khuấy, máy cào rác, máy thổi khí … được giám sát, điều khiển hoàn toàn tự động. Phần mềm có nhiều chức năng như: cảnh báo, lưu trữ, thống kê, bảo mật và cấu hình hệ thống.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>TÍNH NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống tự động hóa sử dụng bộ điều khiển trung tâm PLC SIMATIC S7 của Siemen và các chuẩn truyền thông công nghiệp như Profibus,\r\nEthernet…Thiết bị đo môi trường là thiết bị chuyên dụng sử dụng của hãng nổi tiếng thế giới như E+H, HACH,…, có độ chính xác, ổn định cao. Tính năng kỹ thuật chính:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển luân phiên và điều khiển theo lịch đặt trước.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển tự động thay thế dự phòng nóng thiết bị.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Chuẩn đoán / dự báo tình trạng thiết bị.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Nhận dạng mô hình tự động.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ đưa các tri thức / kinh nghiệm phục vụ điều khiển và chuẩn đoán lỗi.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ phân tích dữ liệu bằng dashboard và đồ thị online.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Gửi báo cáo và cảnh báo tự động qua email.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thông số như độ pH, DO, mức nước tại các bể được giám sát và điều khiển liên tục.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ giám sát điều khiển từ xa qua mạng Internet.</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2"><strong><span class="fontstyle0">KHẢ NĂNG ỨNG DỤNG</span></strong>\r\n</span><span class="fontstyle2">Hệ thống ứng dụng trong các hệ thống xử lý nước thải sản xuất than.</span> </span>', 'Hệ thống tự động xử lý nước thải', 'Hệ thống giám sát và điều khiển tự động toàn bộ các công đoạn của quá trình xử lý nước thải. Các thiết bị như máy bơm, máy khuấy, máy cào rác, máy thổi khí … được giám sát, điều khiển hoàn toàn tự động. Phần mềm có nhiều chức năng như: cảnh báo, lưu trữ, thống kê, bảo mật và cấu hình hệ thống.', 'publish', 'closed', 'closed', '', 'he-thong-tu-dong-xu-ly-nuoc-thai', '', '', '2018-10-08 09:47:32', '2018-10-08 09:47:32', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=828', 0, 'san_pham', '', 0),
(829, 1, '2018-09-24 09:08:30', '2018-09-24 09:08:30', '<strong>Lorem Ipsum</strong> is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'HT quan trắc môi trường nước trong sản xuất than', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'publish', 'closed', 'closed', '', 'he-thong-quan-trac-moi-truong-nuoc-trong-san-xuat-than', '', '', '2018-10-09 07:37:00', '2018-10-09 07:37:00', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=829', 0, 'san_pham', '', 0),
(830, 1, '2018-09-24 09:09:11', '2018-09-24 09:09:11', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">AUSView (Automation System View) là một môi trường phát triển tích hợp (Integrated Development Environment) dùng để xây dựng các loại ứng dụng sau cho ngành than:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống giám sát điều khiển và thu thập dữ liệu tập trung.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Giao diện người máy (HMI).</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>TÍNH NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">AUSVIEW hoàn toàn do Việt Nam làm chủ từ thiết kế đến lập trình.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Phát triển trên các công nghệ nền tảng hiện đại, có tính xu hướng như .Net, WPF.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Thư viện đối tượng đồ họa phong phú (gần 2000 đối tượng) và có thể mở rộng.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Sử dụng đồ họa vector, cho hình ảnh giao diện đẹp;\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ các chuẩn truyền thông tiêu chuẩn quốc tế: OPC, MODBUS, ETHERNET,….Kết nối được với thiết bị phần cứng của đa số các hãng tự động hóa trên thế giới.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ chuẩn truyền thông phi tiêu chuẩn theo yêu cầu khách hàng trên cơ sở phát triển các driver riêng cho các thiết bị phi tiêu chuẩn;\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Khả năng tích hợp các công nghệ khác: GIS, bản đồ số, truyền thông không dây\r\n(GPRS, SMS,…)\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Khả năng liên kết với các ứng dụng khác: Word, Excel, …\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cho phép xây dựng nhanh ứng dụng chỉ bằng kéo thả đối tượng đồ họa và cấu hình (Graphical Programming) mà không cần lập trình code.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cho phép rút ngắn tới 90% thời gian xây dựng ứng dụng.\r\nHỗ trợ kiến trúc mở (Open Architechture) viết mã tác vụ tùy biến bằng ngôn ngữ C#;</span></span>\r\n\r\n<span class="fontstyle3" style="font-family: arial, helvetica, sans-serif;"><strong><span class="fontstyle0">KHẢ NĂNG ỨNG DỤNG</span></strong>\r\nHệ thống ứng dụng trong các hệ thống xử lý nước thải sản xuất than. </span>', 'HT công cụ phát triển cho hệ SCADA ngành than', 'AUSView (Automation System View) là một môi trường phát triển tích hợp (Integrated Development Environment) dùng để xây dựng các loại ứng dụng sau cho\r\nngành than:\r\n• Hệ thống giám sát điều khiển và thu thập dữ liệu tập trung.\r\n• Giao diện người máy (HMI).', 'draft', 'closed', 'closed', '', 'he-thong-cong-cu-phat-trien-cho-he-scada-nganh-than', '', '', '2018-10-09 07:59:24', '2018-10-09 07:59:24', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=830', 0, 'san_pham', '', 0),
