(841, 1, '2018-10-08 09:48:53', '2018-10-08 09:48:53', '<span class="fontstyle0">GIỚI THIỆU HỆ THỐNG\n</span><span class="fontstyle2">AUSView (Automation System View) là một môi trường phát triển tích hợp (Integrated Development Environment) dùng để xây dựng các loại ứng dụng sau cho ngành than:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống giám sát điều khiển và thu thập dữ liệu tập trung.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Giao diện người máy (HMI).</span>\n\n<span class="fontstyle0">TÍNH NĂNG HỆ THỐNG\nKHẢ NĂNG ỨNG DỤNG\n</span><span class="fontstyle2">• </span><span class="fontstyle3">AUSVIEW hoàn toàn do Việt Nam làm chủ từ thiết kế đến lập trình.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Phát triển trên các công nghệ nền tảng hiện đại, có tính xu hướng như .Net, WPF.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Thư viện đối tượng đồ họa phong phú (gần 2000 đối tượng) và có thể mở rộng.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Sử dụng đồ họa vector, cho hình ảnh giao diện đẹp;\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ các chuẩn truyền thông tiêu chuẩn quốc tế: OPC, MODBUS,\nETHERNET,….Kết nối được với thiết bị phần cứng của đa số các hãng tự động hóa trên\nthế giới.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ chuẩn truyền thông phi tiêu chuẩn theo yêu cầu khách hàng trên cơ sở phát\ntriển các driver riêng cho các thiết bị phi tiêu chuẩn;\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Khả năng tích hợp các công nghệ khác: GIS, bản đồ số, truyền thông không dây\n(GPRS, SMS,…)\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Khả năng liên kết với các ứng dụng khác: Word, Excel, …\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cho phép xây dựng nhanh ứng dụng chỉ bằng kéo thả đối tượng đồ họa và cấu hình\n(Graphical Programming) mà không cần lập trình code.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cho phép rút ngắn tới 90% thời gian xây dựng ứng dụng.\nHỗ trợ kiến trúc mở (Open Architechture) viết mã tác vụ tùy biến bằng ngôn ngữ C#;\nHệ thống ứng dụng trong các hệ thống xử lý nước thải sản xuất than.</span>', 'Hệ thống công cụ phát triển cho hệ SCADA ngành than', 'AUSView (Automation System View) là một môi trường phát triển tích hợp (Integrated Development Environment) dùng để xây dựng các loại ứng dụng sau cho\nngành than:\n• Hệ thống giám sát điều khiển và thu thập dữ liệu tập trung.\n• Giao diện người máy (HMI).', 'inherit', 'closed', 'closed', '', '830-autosave-v1', '', '', '2018-10-08 09:48:53', '2018-10-08 09:48:53', '', 830, 'http://elatec.com.vn/?p=841', 0, 'revision', '', 0),
