(856, 1, '2018-09-27 08:16:09', '2018-09-27 08:16:09', '<label> Tên của bạn (Bắt buộc)\r\n    [text* your-name] </label>\r\n\r\n<label> Hòm thư (Bắt buộc)\r\n    [email* your-email] </label>\r\n\r\n<label> Tiêu đề (Bắt buộc)\r\n    [text* your-subject] </label>\r\n\r\n<label> Nội dung (Bắt buộc)\r\n    [textarea* your-message] </label>\r\n\r\n[submit "Gửi"]\n1\nCông ty TNHH MTV phát triển công nghệ điện tử, tự động hóa "[your-subject]"\n[your-name] <wordpress@elatec.com.vn>\nvutatthanh1787@gmail.com\nFrom: [your-name] <[your-email]>\r\nSubject: [your-subject]\r\n\r\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nHộp thư này được gửi từ Công ty TNHH MTV phát triển công nghệ điện tử, tự động hóa (http://elatec.com.vn)\nReply-To: [your-email]\n\n1\n\n\nCông ty TNHH MTV phát triển công nghệ điện tử, tự động hóa "[your-subject]"\nCông ty TNHH MTV phát triển công nghệ điện tử, tự động hóa <wordpress@elatec.com.vn>\n[your-email]\nMessage Body:\r\n[your-message]\r\n\r\n-- \r\nThis e-mail was sent from a contact form on Công ty TNHH MTV phát triển công nghệ điện tử, tự động hóa (http://elatec.com.vn)\nReply-To: thanhtung.ictu@gmail.com\n\n\n\nThư của bạn đã gửi thành công.\nĐã có lỗi xảy ra! Vui lòng kiểm tra lại.\nOne or more fields have an error. Please check and try again.\nCó lỗi trong quá trình gửi! Vui lòng thử lại.\nBạn phải chấp nhận các điều khoản và điều kiện trước khi gửi tin nhắn của bạn.\nBạn phải điền đầy đủ thông tin bắt buộc.\nVượt quá kí tự cho phép.\nKí tự quá ngắn.\nĐịnh dạng ngày không chính xác.\nThe date is before the earliest one allowed.\nThe date is after the latest one allowed.\nThere was an unknown error uploading the file.\nYou are not allowed to upload files of this type.\nThe file is too big.\nThere was an error uploading the file.\nThe number format is invalid.\nThe number is smaller than the minimum allowed.\nThe number is larger than the maximum allowed.\nThe answer to the quiz is incorrect.\nYour entered code is incorrect.\nThe e-mail address