(859, 1, '2018-09-28 04:17:35', '2018-09-28 04:17:35', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua\r\ntrạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển\r\nthan, tăng tốc độ lưu thông. Hệ thống cũng tích hợp chức năng nhận dạng biến số xe\r\nTất cả dữ liệu hệ thống đọc được sẽ được lưu trữ đồng bộ lên cơ sở dữ liệu giúp người\r\nvận hành có thể tổng hợp, khai thác dữ liệu dễ dàng, đồng thời hệ thống hỗ trợ theo dõi\r\nqua Internet.</span>\r\n\r\n<span class="fontstyle2">\r\n</span><span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống gồm:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Barie điện chế độ điều khiển tự động hoặc bán tự động.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cân ô tô (có thể dùng sẵn của mỏ ).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát xe.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span>\r\n\r\n<span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động mở barie khi có xe chuẩn bị vào cân.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng xe qua biển số xe và thẻ UHF.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận diện vị trí xe trên cân.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động ổn định trọng lượng.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mã hóa phiếu cân bằng mã QR code.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Xem dữ liệu báo cáo từ xa (dữ liệu báo cáo được tập trung và xem trên web).\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ hình ảnh biển số xe và toàn cảnh xe khi qua cân.</span>', 'Hệ thống cân băng tải, cân xe ô tô', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'publish', 'closed', 'closed', '', 'he-thong-quan-ly-tap-chung', '', '', '2018-10-09 08:36:09', '2018-10-09 08:36:09', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=859', 0, 'san_pham', '', 0),
(860, 1, '2018-09-28 04:18:41', '2018-09-28 04:18:41', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.</span>\r\n\r\n<strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong>\r\n<span class="fontstyle0">Hệ thống giám sát, định vị nhân sự cấu trúc bao gồm:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Máy chủ cài đặt phần mềm của hệ thống, để giám sát, điều khiển và quản lý, lưu trú hay tra cứu thông tin nhân viên tại phòng điều khiển trung tâm.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thiết bị đầu cuối VIELINA-SW.02: chứa đầu đọc thẻ được bố trí tại các cửa lò, dọc theo đường lò.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thẻ giám sát và định vị nhân viên VIELINA-TAG.01: Được mỗi nhân viên mang bên mình khi làm việc. Hệ thống còn có mạng lưới cáp quang kết nối với thiết bị chuyển mạch mạng vòng.</span>\r\n\r\n<strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span></strong>\r\n<span class="fontstyle0">•</span> <span class="fontstyle0">Giám sát</span><span class="fontstyle2">: Mỗi cán bộ, nhân viên xuống lò đều mang thẻ định vị riêng tương ứng với mã số cá nhân của từng người. Thông qua các trạm đọc hệ thống sẽ giám sát được thời điểm ra vào lò, định vị được vị trí hiện tại của người mang thẻ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Quản lý</span><span class="fontstyle2">: Thống kê, kiểm soát tổng số nhân viên làm việc trong lò hay từng phòng ban, số nhân viên làm thêm giờ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tìm kiếm, cảnh báo</span><span class="fontstyle2">: Hệ thống có chức năng tìm gọi bất kì một nhân viên đang mang thẻ từ trung tâm điều khiển. Cũng từ thẻ định vị nhân viên có thể bấm nút khẩn cấp để gọi lên phòng điều hành trung tâm.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tra cứu</span><span class="fontstyle2">: Hỗ trợ tra cứu quỹ đạo di chuyển của từng nhân viên làm việc trong lò.</span>\r\n\r\n<strong><span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG\r\n</span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo.png"><img class="alignnone size-medium wp-image-892" src="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo-300x196.png" alt="" width="300" height="196" /></a>', 'Hệ thống điều khiển giám sát dưới lò', 'Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.', 'publish', 'closed', 'closed', '', 'he-thong-dieu-khien-giam-sat-duoi-lo', '', '', '2018-10-09 08:38:10', '2018-10-09 08:38:10', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=860', 0, 'san_pham', '', 0),
(861, 1, '2018-09-28 04:19:15', '2018-09-28 04:19:15', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\r\n</span><span class="fontstyle2">Hệ thống Giám sát điều khiển tập trung toàn bộ các hệ thống công nghệ chính trong\r\nsản xuất than như: trạm biến áp, trạm phân phối điện, trạm bơm, trạm nén khí, trạm\r\nquạt, trạm cân, trạm băng tải,…..trên nền tảng các công nghệ CMCN 4.0.</span> </span>\r\n\r\n<span style="font-size: 14pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">CÁC HỆ THỐNG CON</span></strong></span>\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ nền tảng công nghệ internet vạn vật kết nối (IoT), cho phép giám sát và điều\r\nkhiển từ xa các thiết bị / máy móc qua mạng internet và mạng LAN.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Ứng dụng trí tuệ nhân tạo (mạng nơron, hệ thống mờ, …) trong quá trình giám sát\r\nđiều khiển, chuẩn đoán, cảnh báo.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ các công cụ phân tích dữ liệu hiệu quả như dashboard, trend phục vụ hỗ trợ\r\nra quyết định.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động tính toán các chỉ số hiệu quả của quá trình sản xuất hoặc thiết bị trong thời\r\ngian thực để điều chỉnh kịp thời.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Các trạm điều khiển phân tán DCS có khả năng tự trị cao, thực hiện chia sẻ thông\r\ntin để tăng khả năng xử lý, tính toán và dự phòng cảnh báo.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động điều khiển thay thế khi có tài nguyên dự phòng như: tự động chuyển\r\nnguồn điện cho trạm bơm/quạt, tự động đưa thiết bị dự phòng vào hoạt động, tự động\r\nthay thế CPU, ...\r\n</span></span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle4"><span style="font-size: 14pt;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span> </strong></span>\r\n</span><span class="fontstyle3">Hệ thống giám sát điều khiển tập trung trên mặt bằng bao gồm:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống màn hình ghép công nghiệp.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm điện.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm khí nén.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm quạt.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống hoàn toàn có thể tích hợp thêm các hệ thống khác có giao thức TCP/IP\r\nkết nối Ethernet.</span> </span>\r\n\r\n<span class="fontstyle0" style="font-family: arial, helvetica, sans-serif; font-size: 14pt;"> SƠ ĐỒ CẤU TRÚC HỆ THỐNG </span>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tren-mat-bang.png"><img class="alignnone size-medium wp-image-874" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tren-mat-bang-300x185.png" alt="" width="300" height="185" /></a>', 'HT điều khiển giám sát trên mặt bằng', 'Hệ thống Giám sát điều khiển tập trung toàn bộ các hệ thống công nghệ chính trong sản xuất than như: trạm biến áp, trạm phân phối điện, trạm bơm, trạm nén khí, trạm quạt, trạm cân, trạm băng tải,…..trên nền tảng các công nghệ CMCN 4.0.', 'publish', 'closed', 'closed', '', 'he-thong-dieu-khien-giam-sat-tren-mat-bang', '', '', '2018-10-09 07:35:51', '2018-10-09 07:35:51', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=861', 0, 'san_pham', '', 0),
(862, 1, '2018-09-28 04:22:28', '2018-09-28 04:22:28', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát và điều khiển tự động toàn bộ các công đoạn của quá trình xử lý nước thải. Các thiết bị như máy bơm, máy khuấy, máy cào rác, máy thổi khí … được giám sát, điều khiển hoàn toàn tự động. Phần mềm có nhiều chức năng như: cảnh báo, lưu trữ, thống kê, bảo mật và cấu hình hệ thống.</span>\r\n\r\n<span class="fontstyle0"><strong>TÍNH NĂNG HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống tự động hóa sử dụng bộ điều khiển trung tâm PLC SIMATIC S7 của Siemen và các chuẩn truyền thông công nghiệp như Profibus,\r\nEthernet…Thiết bị đo môi trường là thiết bị chuyên dụng sử dụng của hãng nổi tiếng thế giới như E+H, HACH,…, có độ chính xác, ổn định cao. Tính năng kỹ thuật chính:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển luân phiên và điều khiển theo lịch đặt trước.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển tự động thay thế dự phòng nóng thiết bị.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Chuẩn đoán / dự báo tình trạng thiết bị.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Nhận dạng mô hình tự động.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ đưa các tri thức / kinh nghiệm phục vụ điều khiển và chuẩn đoán lỗi.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ phân tích dữ liệu bằng dashboard và đồ thị online.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Gửi báo cáo và cảnh báo tự động qua email.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thông số như độ pH, DO, mức nước tại các bể được giám sát và điều khiển liên tục.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hỗ trợ giám sát điều khiển từ xa qua mạng Internet.</span>\r\n\r\n<span class="fontstyle2"><strong><span class="fontstyle0">KHẢ NĂNG ỨNG DỤNG</span></strong>\r\n</span><span class="fontstyle2">Hệ thống ứng dụng trong các hệ thống xử lý nước thải sản xuất than.</span>', 'Hệ thống tự động xử lý nước thải', '', 'publish', 'closed', 'closed', '', 'cac-he-thong-khac', '', '', '2018-10-09 08:31:12', '2018-10-09 08:31:12', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=862', 0, 'san_pham', '', 0),
