(865, 1, '2018-10-08 07:44:34', '2018-10-08 07:44:34', '<strong><span style="font-family: arial, helvetica, sans-serif; font-size: 18pt;">Giới thiệu về hệ thống: </span></strong>\r\n\r\n<span class="fontstyle0" style="font-family: arial, helvetica, sans-serif; font-size: 14pt;"> Hệ thống quản lý suất ăn là hệ thống quản lý CBCNV vào ra được lắp đặt tại các\r\nnhà ăn của công ty, xí nghiệp nhằm kiểm soát lượng người vào, ra nhà ăn giúp cho việc\r\nkiểm soát số lượng xuất ăn hợp lý.\r\nHệ thống được thực hiện qua các máy nhận dạng bằng vân tay hoặc khuôn mặt đi\r\nkèm với hệ thống barie flap tự động được lắp đặt tại lối vào nhà ăn. </span>\r\n\r\n<strong><span style="font-family: arial, helvetica, sans-serif; font-size: 18pt;">Cấu trúc hệ thống: </span></strong>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif; font-size: 14pt;"> <span class="fontstyle0">Hệ thống quản lý suất ăn có cấu trúc:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Mạng Ethenet kết nối các thiết bị và máy tính\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Các máy nhận dạng bằng vân tay hoặc khuôn mặt.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Hệ thống barie flap đóng mở kiểm soát người vào ra.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Hệ thống camera giám sát người ra vào.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span> </span>\r\n\r\n<strong><span style="font-family: arial, helvetica, sans-serif; font-size: 18pt;">Chức năng hệ thống: </span></strong>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif; font-size: 14pt;"> <span class="fontstyle0">• </span><span class="fontstyle2">Kiểm tra, nhận dạng cán bộ công nhân viên vào, ra ăn uống tại nhà ăn nhằm hạn\r\nchế tình trạng thừa thiếu.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Quản lý, kiểm soát số suất ăn theo từng ca.\r\n</span><span class="fontstyle0">• </span><span class="fontstyle2">Thống kê, lưu trữ số suất ăn, cung cấp thông tin cho công tác quản lý cán bộ làm\r\nviệc tại công ty.</span> </span>\r\n\r\n<strong><span style="font-family: arial, helvetica, sans-serif; font-size: 18pt;">Sơ đồ cấu trúc hệ thống: </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/Quan-ly-dang-ky-suat-an-cong-nghiep.png"><img class="alignnone wp-image-866" src="http://elatec.com.vn/wp-content/uploads/2018/10/Quan-ly-dang-ky-suat-an-cong-nghiep-300x217.png" alt="" width="334" height="241" /></a>', 'HT quản lý, đăng ký suất ăn công nghiệp', 'Hệ thống quản lý suất ăn là hệ thống quản lý CBCNV vào ra được lắp đặt tại các\r\nnhà ăn của công ty, xí nghiệp nhằm kiểm soát lượng người vào, ra nhà ăn giúp cho việc\r\nkiểm soát số lượng xuất ăn hợp lý.\r\nHệ thống được thực hiện qua các máy nhận dạng bằng vân tay hoặc khuôn mặt đi\r\nkèm với hệ thống barie flap tự động được lắp đặt tại lối vào nhà ăn.', 'publish', 'closed', 'closed', '', 'he-thong-quan-ly-dang-ky-suat-an-cong-nghiep', '', '', '2018-10-09 07:35:38', '2018-10-09 07:35:38', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=865', 0, 'san_pham', '', 0),
(866, 1, '2018-10-08 07:41:13', '2018-10-08 07:41:13', '', 'Quan ly dang ky suat an cong nghiep', '', 'inherit', 'open', 'closed', '', 'quan-ly-dang-ky-suat-an-cong-nghiep', '', '', '2018-10-08 07:41:13', '2018-10-08 07:41:13', '', 865, 'http://elatec.com.vn/wp-content/uploads/2018/10/Quan-ly-dang-ky-suat-an-cong-nghiep.png', 0, 'attachment', 'image/png', 0),
(867, 1, '2018-10-08 07:49:42', '2018-10-08 07:49:42', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>CẤU TRÚC HỆ THỐNG</strong></span>\n</span><span class="fontstyle2">Hệ thống quản lý tự mượn quần áo, đèn lò, bình tự cứu gồm:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thẻ từ ứng với thông tin từng cán bộ công nhân viên.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Các bộ đọc thẻ.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống các barie kiểm soát vào ra của nhà đèn.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát người ra, vào.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.\n</span><span class="fontstyle0">\n<strong><span style="font-size: 14pt;">CHỨC NĂNG HỆ THỐNG</span></strong>\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cho phép cán bộ công nhân viên mượn, trả các vật dụng cần thiết để đi vào lò tự\nđộng bằng việc quẹt thẻ qua các bộ đọc thẻ\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động đóng mở barie, một người/ 1 lần/1 cổng\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Báo cáo thống kê, kiểm soát, hiển thị số lượng người mượn trả trên phần mềm theo\nca kíp.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Thông tin hệ thống là cơ sở để quản lý đối chiếu với hệ thống quản lý người ra vào\nlò.</span> </span>', 'Hệ thống quản lý tự mượn quần áo, đèn lò, bình tự cứu', 'Hệ thống quản lý tự mượn quần áo, đèn lò, bình tự cứu là hệ thống quản lý việc mượn trả các vật dụng cần thiết cho cán bộ công nhân viên như quần áo, ủng, đèn lò, bình tự cứu…tự động thông qua việc quét qua các đầu đọc được lắp đặt tại các cửa mượn và cửa trả.', 'inherit', 'closed', 'closed', '', '812-autosave-v1', '', '', '2018-10-08 07:49:42', '2018-10-08 07:49:42', '', 812, 'http://elatec.com.vn/?p=867', 0, 'revision', '', 0),
(868, 1, '2018-10-08 07:49:38', '2018-10-08 07:49:38', '', 'he thong tu muon quan ao den lo', '', 'inherit', 'open', 'closed', '', 'he-thong-tu-muon-quan-ao-den-lo', '', '', '2018-10-08 07:49:38', '2018-10-08 07:49:38', '', 812, 'http://elatec.com.vn/wp-content/uploads/2018/09/he-thong-tu-muon-quan-ao-den-lo.png', 0, 'attachment', 'image/png', 0),
(869, 1, '2018-10-08 07:51:57', '2018-10-08 07:51:57', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\n</span><span class="fontstyle2">Hàng ngày có rất nhiều phương tiện ô tô qua lại và ra vào công trường bao gồm xe\nđưa đón cán bộ công nhân, xe vận chuyển vật liệu, xe vận chuyển than. Hiện nay hầu hết\ncác cửa ra vào có bố trí các nhân viên bảo vệ kiểm soát ghi chép biển số, thời điểm ra\nvào bằng tay, gác chắn barie đóng mở bằng tay hoặc bán tự động. Để khắc phục những\nhạn chế của phương pháp barie kéo tay truyền thống giải pháp đề xuất là lắp đặt các thiết\nbị kỹ thuật số giám sát, kiểm soát tự động các phương tiện qua cổng.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\n</span><span class="fontstyle0"><span style="font-size: 14pt;">CẤU TRÚC HỆ THỐNG</span>\n</span><span class="fontstyle2">Hệ thống kiểm soát ra vào tại trạm bảo vệ khai trường có cấu trúc:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mạng Ethenet kết nối các thiết bị và máy tính.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống barie đóng mở kiểm soát phương tiện vào ra mỏ.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera nhận dạng xe và lưu trữ biển số xe ra vào.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển và cấu hình hệ thống.\n</span><span class="fontstyle4">HỆ THỐNG\n</span><span class="fontstyle0">KIỂM SOÁT RA VÀO TẠI TRẠM BẢO VỆ KHAI TRƯỜNG\nCHỨC NĂNG HỆ THỐNG\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Điều khiển đóng mở barie bằng nút bấm nhanh chóng dễ dàng.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng biến số xe cơ giới khi qua cổng.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Báo cáo, thống kê, đối chiếu số liệu tức thời, trong các ca sản xuất.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ video từ camera để kiểm tra khi cần.\n</span><span class="fontstyle0">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span> </span>', 'Hệ thống kiểm soát trạm bảo vệ', 'Hàng ngày có rất nhiều phương tiện ô tô qua lại và ra vào công trường bao gồm xe đưa đón cán bộ công nhân, xe vận chuyển vật liệu, xe vận chuyển than. Hiện nay hầu hết các cửa ra vào có bố trí các nhân viên bảo vệ kiểm soát ghi chép biển số, thời điểm ra vào bằng tay, gác chắn barie đóng mở bằng tay hoặc bán tự động. ', 'inherit', 'closed', 'closed', '', '814-autosave-v1', '', '', '2018-10-08 07:51:57', '2018-10-08 07:51:57', '', 814, 'http://elatec.com.vn/?p=869', 0, 'revision', '', 0),
(870, 1, '2018-10-08 07:53:04', '2018-10-08 07:53:04', '', 'He thong tram bao ve', '', 'inherit', 'open', 'closed', '', 'he-thong-tram-bao-ve', '', '', '2018-10-08 07:53:04', '2018-10-08 07:53:04', '', 814, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-tram-bao-ve.png', 0, 'attachment', 'image/png', 0),
(871, 1, '2018-10-09 08:35:52', '2018-10-09 08:35:52', '<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><span style="font-size: 12pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\n</span><span class="fontstyle2">Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua\ntrạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển\nthan, tăng tốc độ lưu thông. Hệ thống cũng tích hợp chức năng nhận dạng biến số xe\nTất cả dữ liệu hệ thống đọc được sẽ được lưu trữ đồng bộ lên cơ sở dữ liệu giúp người\nvận hành có thể tổng hợp, khai thác dữ liệu dễ dàng, đồng thời hệ thống hỗ trợ theo dõi\nqua Internet.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\n</span><span class="fontstyle0"><span style="font-size: 12pt;"><strong>CẤU TRÚC HỆ THỐNG</strong></span>\n</span><span class="fontstyle2">Hệ thống gồm:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Barie điện chế độ điều khiển tự động hoặc bán tự động.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cân ô tô (có thể dùng sẵn của mỏ ).\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát xe.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><span style="font-size: 14pt;"><strong><span style="font-size: 12pt;">CHỨC NĂNG HỆ THỐNG\n</span></strong></span></span></span><span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle3">• </span><span class="fontstyle2">Tự động mở barie khi có xe chuẩn bị vào cân.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng xe qua biển số xe và thẻ UHF.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận diện vị trí xe trên cân.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động ổn định trọng lượng.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mã hóa phiếu cân bằng mã QR code.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Xem dữ liệu báo cáo từ xa (dữ liệu báo cáo được tập trung và xem trên web).\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ hình ảnh biển số xe và toàn cảnh xe khi qua cân.</span></span>', 'Hệ thống cân băng tải, cân xe ô tô', 'Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua trạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển than, tăng tốc độ lưu thông.', 'inherit', 'closed', 'closed', '', '813-autosave-v1', '', '', '2018-10-09 08:35:52', '2018-10-09 08:35:52', '', 813, 'http://elatec.com.vn/?p=871', 0, 'revision', '', 0),
(872, 1, '2018-10-08 07:56:35', '2018-10-08 07:56:35', '', 'He thong can bang tai oto', '', 'inherit', 'open', 'closed', '', 'he-thong-can-bang-tai-oto', '', '', '2018-10-08 07:56:35', '2018-10-08 07:56:35', '', 813, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-can-bang-tai-oto.png', 0, 'attachment', 'image/png', 0),
(873, 1, '2018-10-08 08:01:22', '2018-10-08 08:01:22', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><span style="font-size: 14pt;"><strong>GIỚI THIỆU HỆ THỐNG</strong></span>\n</span><span class="fontstyle2">Hệ thống Giám sát điều khiển tập trung toàn bộ các hệ thống công nghệ chính trong\nsản xuất than như: trạm biến áp, trạm phân phối điện, trạm bơm, trạm nén khí, trạm\nquạt, trạm cân, trạm băng tải,…..trên nền tảng các công nghệ CMCN 4.0.</span> </span>\n\n<span style="font-size: 14pt;"><strong><span style="font-family: arial, helvetica, sans-serif;">CÁC HỆ THỐNG CON</span></strong></span>\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ nền tảng công nghệ internet vạn vật kết nối (IoT), cho phép giám sát và điều\nkhiển từ xa các thiết bị / máy móc qua mạng internet và mạng LAN.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Ứng dụng trí tuệ nhân tạo (mạng nơron, hệ thống mờ, …) trong quá trình giám sát\nđiều khiển, chuẩn đoán, cảnh báo.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hỗ trợ các công cụ phân tích dữ liệu hiệu quả như dashboard, trend phục vụ hỗ trợ\nra quyết định.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động tính toán các chỉ số hiệu quả của quá trình sản xuất hoặc thiết bị trong thời\ngian thực để điều chỉnh kịp thời.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Các trạm điều khiển phân tán DCS có khả năng tự trị cao, thực hiện chia sẻ thông\ntin để tăng khả năng xử lý, tính toán và dự phòng cảnh báo.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động điều khiển thay thế khi có tài nguyên dự phòng như: tự động chuyển\nnguồn điện cho trạm bơm/quạt, tự động đưa thiết bị dự phòng vào hoạt động, tự động\nthay thế CPU, ...\n</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle4"><span style="font-size: 14pt;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span> </strong></span>\n</span><span class="fontstyle3">Hệ thống giám sát điều khiển tập trung trên mặt bằng bao gồm:\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống màn hình ghép công nghiệp.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm điện.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm khí nén.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống điều khiển giám sát trạm quạt.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống hoàn toàn có thể tích hợp thêm các hệ thống khác có giao thức TCP/IP\nkết nối Ethernet.</span> </span>', 'Hệ thống điều khiển giám sát trên mặt bằng', 'Hệ thống Giám sát điều khiển tập trung toàn bộ các hệ thống công nghệ chính trong sản xuất than như: trạm biến áp, trạm phân phối điện, trạm bơm, trạm nén khí, trạm quạt, trạm cân, trạm băng tải,…..trên nền tảng các công nghệ CMCN 4.0.', 'inherit', 'closed', 'closed', '', '861-autosave-v1', '', '', '2018-10-08 08:01:22', '2018-10-08 08:01:22', '', 861, 'http://elatec.com.vn/?p=873', 0, 'revision', '', 0),
(874, 1, '2018-10-08 08:03:10', '2018-10-08 08:03:10', '', 'He thong dieu khien giam sat tren mat bang', '', 'inherit', 'open', 'closed', '', 'he-thong-dieu-khien-giam-sat-tren-mat-bang-2', '', '', '2018-10-08 08:03:10', '2018-10-08 08:03:10', '', 861, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tren-mat-bang.png', 0, 'attachment', 'image/png', 0),
(875, 1, '2018-10-08 08:07:28', '2018-10-08 08:07:28', '<span class="fontstyle0">GIỚI THIỆU HỆ THỐNG\n</span><span class="fontstyle2">Hệ thống hiển thị màn hình ghép ma trận LCD được cung cấp theo yêu cầu thiết kế\n(3x4 hoặc 4x6 với màn hình 46", 55"), khoảng cách ghép giữa các màn hình nhỏ. Đây là\nkỹ thuật hiển thị LCD tiên tiến nhất trên thế giới, với kỹ thuật xử lý đồ họa đa hình ảnh,\nkỹ thuật chuyển đổi thông tin được ứng dụng tổng hợp đồng nhất, hình thành hệ thống\nmàn hình LCD có độ nét cao, điều khiển thông minh, phương pháp thao tác tiên tiến.\nThông qua hệ thống màn hình ghép ma trận LCD có thể hiển thị trên màn hình lớn tín\nhiệu từ các máy tính, tín hiệu hình ảnh từ camera, thông số dữ liệu của các hệ thống, ...</span>\n\n<span class="fontstyle0">CẤU TRÚC HỆ THỐNG\n</span><span class="fontstyle2">Hệ thống giám sát màn hình công nghiệp gồm các bộ phận cấu thành:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Các màn hình công nghiệp: Mỗi màn hình có kích thước 46" hay 55", độ phân giải\ncao Full HD 1920x1080. Khoảng cách ghép giữa các màn hình: 3.5÷ 5.5mm\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Bộ ma trận VGA/HDMI: để lựa chọn các tín hiệu vào, cho phép lựa chọn và điều\nkhiển ra đồng thời nhiều luồng đi tới màn hình.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Bộ điều khiển liên kết: Dùng để ghép màn hình hoặc chia màn hình thông qua máy\ntính điều khiển.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span>\n\n<span class="fontstyle0">CHỨC NĂNG HỆ THỐNG\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống kết hợp kỹ thuật giám sát truyền hình công nghiệp và kỹ thuật xử lý hình\nảnh, thực hiện xử lý tức thời hệ thống giám sát hình ảnh, lưu giữ và phát lại.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống có thể đấu nối với cổng kết nối khác nhau để hiển thị các thông tin lên\nmàn hình như VGA, HDMI, DVI...\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hệ thống có thể lựa chọn các nguồn dữ liệu để hiển thị lên màn hình thông qua bộ\nđiều khiển ma trận. Dùng các thao tác trên phần mềm để điều khiển hiển thị hình ảnh\nmong muốn khi cần thiết, dễ dàng phóng to hay thu nhỏ khi cần thiết.</span>', 'Hệ thống màn hình ghép công nghiệp', 'Hệ thống hiển thị màn hình ghép ma trận LCD được cung cấp theo yêu cầu thiết kế (3x4 hoặc 4x6 với màn hình 46", 55"), khoảng cách ghép giữa các màn hình nhỏ. Đây là kỹ thuật hiển thị LCD tiên tiến nhất trên thế giới, với kỹ thuật xử lý đồ họa đa hình ảnh, kỹ thuật chuyển đổi thông tin được ứng dụng tổng hợp đồng nhất, hình thành hệ thống\nmàn hình LCD có độ nét cao, điều khiển thông minh, phương pháp thao tác tiên tiến.\nThông qua hệ thống màn hình ghép ma trận LCD có thể hiển thị trên màn hình lớn tín\nhiệu từ các máy tính, tín hiệu hình ảnh từ camera, thông số dữ liệu của các hệ thống, ...', 'inherit', 'closed', 'closed', '', '815-autosave-v1', '', '', '2018-10-08 08:07:28', '2018-10-08 08:07:28', '', 815, 'http://elatec.com.vn/?p=875', 0, 'revision', '', 0),
