(877, 1, '2018-10-08 08:10:47', '2018-10-08 08:10:47', '<span class="fontstyle0">GIỚI THIỆU HỆ THỐNG\n</span><span class="fontstyle2">Hệ thống giám sát điều khiển các trạm biến áp và trạm phân phối từ xa qua mạng\ninternet và mạng LAN. Cho phép điều khiển từ xa các thiết bị đóng cắt ngoài trời đảm\nbảo an toàn khi thời tiết xấu. Liên động tự động chuyển nguồn cho trạm bơm và trạm\nquạt khi có sự cố mất một nguồn hoặc liên động khóa các trường hợp điều khiển sai\n(nếu có). Ngoài ra còn quản lý hiệu quả tiêu thụ điện năng trong sản xuất.</span>\n\n<span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span><span class="fontstyle0">\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị sơ đồ đơn tuyến hệ thống điện của trạm biến áp 35KV, 6KV và các trạm\nphân phối.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị các thông số điện năng cơ bản như: dòng điện các pha, điện áp các pha,\ncông suất phản kháng, công suất hiệu dụng, cos phi, tần số,...\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị trạng thái các máy cắt.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Hiển thị các thông số thống kê về thời gian vận hành, số lần đóng/cắt để phục vụ\nbảo trì.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cài đặt các tham số cấu hình hệ thống.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Cảnh báo khi có sự cố.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Lưu trữ các thông số điện năng và lưu trữ cảnh báo.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Báo cáo thống kê thông số điện năng và báo cáo cảnh báo.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Tự động gửi báo cáo và cảnh báo vào email của người vận hành, quản lý.\n</span><span class="fontstyle2">• </span><span class="fontstyle3">Có các công cụ phân tích dữ liệu hiệu quả như dashboard, online trend.</span>\n\n&nbsp;', 'Hệ thống điều khiển giám sát trạm điện', 'Hệ thống giám sát điều khiển các trạm biến áp và trạm phân phối từ xa qua mạng internet và mạng LAN. Cho phép điều khiển từ xa các thiết bị đóng cắt ngoài trời đảm bảo an toàn khi thời tiết xấu. Liên động tự động chuyển nguồn cho trạm bơm và trạm quạt khi có sự cố mất một nguồn hoặc liên động khóa các trường hợp điều khiển sai\n(nếu có). Ngoài ra còn quản lý hiệu quả tiêu thụ điện năng trong sản xuất.', 'inherit', 'closed', 'closed', '', '816-autosave-v1', '', '', '2018-10-08 08:10:47', '2018-10-08 08:10:47', '', 816, 'http://elatec.com.vn/?p=877', 0, 'revision', '', 0),
(878, 1, '2018-10-08 08:11:52', '2018-10-08 08:11:52', '', 'He thong dieu khien giam sat tram dien', '', 'inherit', 'open', 'closed', '', 'he-thong-dieu-khien-giam-sat-tram-dien-2', '', '', '2018-10-08 08:11:52', '2018-10-08 08:11:52', '', 816, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-dieu-khien-giam-sat-tram-dien.png', 0, 'attachment', 'image/png', 0),
(879, 1, '2018-10-08 08:17:25', '2018-10-08 08:17:25', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát và điều khiển trạm quạt thông gió giám sát các thông số thiết bị,\r\nmôi trường trong quá trình vận hành thông gió, giúp cho công tác quản lý vận hành\r\nđược tập trung, thông suốt, nhanh chóng phát hiện sự cố cũng như có các biện pháp xử\r\nlý kịp thời để không làm gián đoạn ảnh hưởng đến công tác sản xuất của mỏ. Hệ thống\r\ncho phép điều khiển vận hành trạm quạt thông gió một cách tự động, từ xa theo đúng\r\nquy trình thông gió của Mỏ đề ra. Dựa vào việc theo dõi và lưu trữ dữ liệu thông số trạm\r\nquạt gió hệ thống hỗ trợ người dùng trong việc đánh giá thiết bị động cơ, chẩn đoán lỗi,\r\nthực hiện bảo trì.\r\nHệ thống giám sát điều khiển tự động sử dụng công nghệ tiên tiến và mạng Ethernet\r\ncáp quang công nghiệp phục vụ cho việc giám sát và điều khiển từ xa tại Phòng điều\r\nhành trung tâm của Mỏ.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát và điều khiển trạm quạt thông gió gồm ba thành phần chính:\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tại phòng điều hành trung tâm: Máy tính chủ cài đặt phần mềm hệ thống và kết nối\r\nvới màn hình hệ thống giám sát tập trung của toàn mỏ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Phần trạm quạt: Tủ giám sát điều khiển VIELINA-DKG.01: 01 tủ.\r\nCác bộ cảm biến: nhiệt độ, áp suất, độ rung.\r\nTủ điều khiển và máy tính tại phòng trung tâm được kết nối với nhau thông qua cáp\r\nquang Ethernet.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span></strong><span class="fontstyle2">\r\n</span><span class="fontstyle3">Hệ thống hỗ trợ giám sát và điều khiển trạm quạt thông gió chính của mỏ 3 chế độ:\r\nbằng tay (tại Tủ giám sát điều khiển VIELINA-DKG.01); từ xa (Phòng điều hành trung\r\ntâm của Mỏ); tự động.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển tự động</span><span class="fontstyle3">: Cho phép các quạt gió được vận hành tự động,\r\ntuần tự các bước theo quy trình vận hành trạm quạt của Mỏ đã quy định. Điều khiển bởi\r\nchương trình cài đặt sẵn trong tủ giám sát điều khiển.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển từ xa</span><span class="fontstyle3">: Các thao tác điều khiển từ xa gồm: đóng/mở van\r\ngió, đóng/cắt động cơ quạt, giám sát các số liệu trạm quạt gió. Toàn bộ số liệu trạm quạt\r\nđược lưu trữ, in báo cáo tại hệ thống máy tính phòng điều hành trung tâm.\r\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển bằng tay</span><span class="fontstyle3">: Cho phép nhân viên vận hành có thể ra lệnh\r\nđiều khiển đóng/mở thiết bị của trạm quạt theo quy trình vận hành bằng các phím bấm\r\ntại tủ giám sát điều khiển. Đồng thời thiết bị cũng có màn hình để hiện thị các thông số\r\nvà trạng thái làm việc của trạm quạt cũng như lưu trữ, in ấn báo cáo.\r\nNgoài ra hệ thống còn thống kế được các thông số: tốc độ gió, lưu lượng gió, hiệu\r\nsuất thông gió, áp suất, thông số động cơ quạt, thời gian vận hành quạt,… hỗ trợ công\r\ntác lập báo cáo, thống kê và tra cứu thông tin.</span> </span>\r\n\r\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ CẤU TRÚC HỆ THỐNG </span></strong>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-va-dieu-khien-tram-quat-thong-gio.png"><img class="alignnone size-medium wp-image-880" src="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-va-dieu-khien-tram-quat-thong-gio-227x300.png" alt="" width="227" height="300" /></a>\r\n\r\n&nbsp;', 'HT giám sát và điều khiển trạm quạt thông gió', 'Hệ thống giám sát và điều khiển trạm quạt thông gió giám sát các thông số thiết bị,\r\nmôi trường trong quá trình vận hành thông gió, giúp cho công tác quản lý vận hành\r\nđược tập trung, thông suốt, nhanh chóng phát hiện sự cố cũng như có các biện pháp xử\r\nlý kịp thời để không làm gián đoạn ảnh hưởng đến công tác sản xuất của mỏ. Hệ thống cho phép điều khiển vận hành trạm quạt thông gió một cách tự động, từ xa theo đúng quy trình thông gió của Mỏ đề ra. Dựa vào việc theo dõi và lưu trữ dữ liệu thông số trạm quạt gió hệ thống hỗ trợ người dùng trong việc đánh giá thiết bị động cơ, chẩn đoán lỗi, thực hiện bảo trì.', 'publish', 'closed', 'closed', '', 'he-thong-giam-sat-va-dieu-khien-tram-quat-thong-gio', '', '', '2018-10-09 07:35:15', '2018-10-09 07:35:15', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=879', 0, 'san_pham', '', 0),
