ng gió chính của mỏ 3 chế độ:\nbằng tay (tại Tủ giám sát điều khiển VIELINA-DKG.01); từ xa (Phòng điều hành trung\ntâm của Mỏ); tự động.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển tự động</span><span class="fontstyle3">: Cho phép các quạt gió được vận hành tự động,\ntuần tự các bước theo quy trình vận hành trạm quạt của Mỏ đã quy định. Điều khiển bởi\nchương trình cài đặt sẵn trong tủ giám sát điều khiển.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển từ xa</span><span class="fontstyle3">: Các thao tác điều khiển từ xa gồm: đóng/mở van\ngió, đóng/cắt động cơ quạt, giám sát các số liệu trạm quạt gió. Toàn bộ số liệu trạm quạt\nđược lưu trữ, in báo cáo tại hệ thống máy tính phòng điều hành trung tâm.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Giám sát và điều khiển bằng tay</span><span class="fontstyle3">: Cho phép nhân viên vận hành có thể ra lệnh\nđiều khiển đóng/mở thiết bị của trạm quạt theo quy trình vận hành bằng các phím bấm\ntại tủ giám sát điều khiển. Đồng thời thiết bị cũng có màn hình để hiện thị các thông số\nvà trạng thái làm việc của trạm quạt cũng như lưu trữ, in ấn báo cáo.\nNgoài ra hệ thống còn thống kế được các thông số: tốc độ gió, lưu lượng gió, hiệu\nsuất thông gió, áp suất, thông số động cơ quạt, thời gian vận hành quạt,… hỗ trợ công\ntác lập báo cáo, thống kê và tra cứu thông tin.</span> </span>\n\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ CẤU TRÚC HỆ THỐNG </span></strong>\n\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-va-dieu-khien-tram-quat-thong-gio.png"><img class="alignnone size-medium wp-image-880" src="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-va-dieu-khien-tram-quat-thong-gio-227x300.png" alt="" width="227" height="300" /></a>\n\n&nbsp;', 'Hệ thống giám sát và điều khiển trạm quạt thông gió', 'Hệ thống giám sát và điều khiển trạm quạt thông gió giám sát các thông số thiết bị,\nmôi trường trong quá trình vận hành thông gió, giúp cho công tác quản lý vận hành\nđược tập trung, thông suốt, nhanh chóng phát hiện sự cố cũng như có các biện pháp xử\nlý kịp thời để không làm gián đoạn ảnh hưởng đến công tác sản xuất của mỏ. Hệ thống cho phép điều khiển vận hành trạm quạt thông gió một cách tự động, từ xa theo đúng quy trình thông gió của Mỏ đề ra. Dựa vào việc theo dõi và lưu trữ dữ liệu thông số trạm quạt gió hệ thống hỗ trợ người dùng trong việc đánh giá thiết bị động cơ, chẩn đoán lỗi, thực hiện bảo trì.', 'inherit', 'closed', 'closed', '', '879-autosave-v1', '', '', '2018-10-08 08:19:11', '2018-10-08 08:19:11', '', 879, 'http://elatec.com.vn/?p=881', 0, 'revision', '', 0),
(882, 1, '2018-10-08 08:24:20', '2018-10-08 08:24:20', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">GIỚI THIỆU HỆ THỐNG\n</span><span class="fontstyle2">Hệ thống GSĐK trạm khí nén là hệ thống đồng bộ hoạt động các trạm khí nén. Tự\nđộng điều khiển bật/tắt các trạm khí nén khi có sự thay đổi của áp suất và theo quy trình\nvận hành nâng cao hiệu suất hoạt động của thiết bị. Đưa ra dự báo tình trạng hoạt động\ncủa trạm và các cảnh báo kịp thời khi có sự cố.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\n</span><span class="fontstyle0">CẤU TRÚC HỆ THỐNG\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Trạm DCS1.1 sẽ được đặt tại nhà máy nén khí.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính chủ đặt tại phòng điều khiển trung tâm sẽ trao đổi dữ liệu với DCS1.1 qua\nmạng cáp quang. Máy tính chủ cài đặt phần mềm có các chức năng cho hệ thống giám\nsát điều khiển trạm nén khí.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống điều khiển sẽ gồm 02 CPU kiểm tra giám sát chéo nhau và 01 màn hình\nhiển thị tại khu vực.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">\n</span><span class="fontstyle0">SƠ ĐỒ CẤU TRÚC HỆ THỐNG</span><span class="fontstyle0">\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Chức năng phần mềm điều khiển PLC của trạm DCS1.1\n</span><span class="fontstyle2">- Có hai chế độ điều khiển từ PLC:\n+ Tự động hoàn toàn (Full Auto – FAUT): Điều khiển tự động hoàn toàn trạm khí nén\ntheo setpoint áp suất đặt trước.\n+ Bán tự động (Half Auto – HAUT): Điều khiển các máy nén khí từ xa qua Internet,\nmạng LAN và màn hình chạm TP.\n- Điều khiển luân phiên máy nén khí, tự động dừng khi chạy không tải.\n- Thu thập dữ liệu về dòng điện, điện áp cấp máy nén khí phục vụ cho chuẩn đoán tình\ntrạng của máy.\n- Cảnh báo các sự cố qua đèn, còi tại chỗ và đưa về hiển thị trên PC và TP.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Chức năng cơ bản của phần mềm trên TP của trạm DCS1.1\n</span><span class="fontstyle2">- Điều khiển hoàn toàn tự động, cho phép giảm thiểu nhân công vận hành.\n- Giám sát điều khiển qua mạng internet và mạng LAN.\n- Điều khiển chống sốc cho máy nén khí.\n- Tự động gửi báo cáo và cảnh báo vào email.\n- Giám sát chéo CPU và dự phòng online cảnh báo SMS khi có một CPU bị sự cố.</span> </span>', 'Hệ thống điều khiển giám sát trạm khí nén', 'Hệ thống GSĐK trạm khí nén là hệ thống đồng bộ hoạt động các trạm khí nén. Tự động điều khiển bật/tắt các trạm khí nén khi có sự thay đổi của áp suất và theo quy trình vận hành nâng cao hiệu suất hoạt động của thiết bị. Đưa ra dự báo tình trạng hoạt động của trạm và các cảnh báo kịp thời khi có sự cố.', 'inherit', 'closed', 'closed', '', '817-autosave-v1', '', '', '2018-10-08 08:24:20', '2018-10-08 08:24:20', '', 817, 'http://elatec.com.vn/?p=882', 0, 'revision', '', 0),
(883, 1, '2018-10-08 08:25:24', '2018-10-08 08:25:24', '', 'He thong giam sat khi nen', '', 'inherit', 'open', 'closed', '', 'he-thong-giam-sat-khi-nen', '', '', '2018-10-08 08:25:24', '2018-10-08 08:25:24', '', 817, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-khi-nen.png', 0, 'attachment', 'image/png', 0),
(884, 1, '2018-10-08 08:30:20', '2018-10-08 08:30:20', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống mạng Ethernet cáp quang công nghiệp được thiết kế trên cơ sở cấu trúc\nmạng vòng Ethernet, đây là là mạng đường trục của toàn bộ hệ thống giám sát điều\nkhiển tập trung. Hệ thống cho phép truyền tải toàn bộ thông tin, dữ liệu hai chiều giữa\ncác thiết bị với trung tâm điều khiển và ngược lại qua hệ thống cáp quang của các hệ\nthống con khác.\nHệ thống mạng Ethernet cáp quang công nghiệp sẽ linh hoạt trong thiết kế theo từng\ncấu hình ứng dụng khác nhau.</span> </span>\n\n<strong><span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span> </span></strong>\n<span style="font-family: arial, helvetica, sans-serif;">Hệ thống mạng Ethernet cáp quang công nghiệp có cấu trúc:</span>\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle2">• </span><span class="fontstyle0">Cáp quang kết nối trên mặt bằng và dưới hầm lò.\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Kết nối các thiết bị chuyển mạch mạng vòng (Server) dưới lò với nhau và với bộ\nchuyển mạch tốc độ cao trên mặt bằng.</span></span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong> CHỨC NĂNG HỆ THỐNG</strong>\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Cấu trúc mạng vòng đảm bảo tính dự phòng cao, các dữ liệu truyền tải trên hệ thống\ncó thể đi theo hai hướng tới trung tâm điều khiển.\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Hệ thống có thiết bị chuyển mạch mạng vòng (Server) có cấu hình mạnh, tốc độ cho\nphép lên đến 1000Mbps và kết nối với các thiết bị theo chuẩn giao thức TCP/IP.\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Mỗi Server có thể đấu nối với 7 thiết bị khác (giao thức TCP/IP). Server có nguồn\ndự phòng nên hệ thống đảm bảo làm việc liên tục không bị gián đoạn (tối thiểu 2h)</span> </span>\n\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\n\n&nbsp;', 'Hệ thống mạng vòng Ethernet cáp quang công nghiệp trong lò', 'Hệ thống mạng Ethernet cáp quang công nghiệp được thiết kế trên cơ sở cấu trúc mạng vòng Ethernet, đây là là mạng đường trục của toàn bộ hệ thống giám sát điều khiển tập trung. Hệ thống cho phép truyền tải toàn bộ thông tin, dữ liệu hai chiều giữa các thiết bị với trung tâm điều khiển và ngược lại qua hệ thống cáp quang của các hệ thống con khác.', 'inherit', 'closed', 'closed', '', '818-autosave-v1', '', '', '2018-10-08 08:30:20', '2018-10-08 08:30:20', '', 818, 'http://elatec.com.vn/?p=884', 0, 'revision', '', 0),
(885, 1, '2018-10-08 08:30:31', '2018-10-08 08:30:31', '', 'He thong Ethernet cap quang cong nghiep', '', 'inherit', 'open', 'closed', '', 'he-thong-ethernet-cap-quang-cong-nghiep', '', '', '2018-10-08 08:30:31', '2018-10-08 08:30:31', '', 818, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-Ethernet-cap-quang-cong-nghiep.png', 0, 'attachment', 'image/png', 0),
(886, 1, '2018-10-08 08:39:26', '2018-10-08 08:39:26', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống dùng để giám sát liên tục trong quá trình sản xuất và khai thác, để theo dõi các hoạt động, hỗ trợ cho công tác an toàn và điều hành sản xuất, kiểm soát các hoạt động cả trên mặt bằng và dưới lò. Hệ thống có thể theo dõi hình ảnh ở các khu vực quan trọng cần giám sát (như trạm bảo vệ, sân kho vật tư, nhà chờ bến xe, các vị trí hầm bơm, băng tải, máng cào, tời trục...) đồng thời tự động lưu trữ dữ liệu hình ảnh để làm dữ liệu, thuận tiện trong tìm kiếm hay xử lý công việc liên quan khi cần thiết.</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong><span class="fontstyle2">\n</span><span class="fontstyle3">Hệ thống giám sát bằng hình ảnh bao gồm: hệ thống camera; hệ thống truyền dẫn, điều khiển; hệ thống hiển thị và lưu trữ.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống camera</span><span class="fontstyle3">: Thu nhận dữ liệu hình ảnh, xử lý hình ảnh, số hóa và thông qua mạng lưới truyền dẫn để truyền hình ảnh đến trung tâm điều khiển.\n- </span><span class="fontstyle6">Trên mặt bằng</span><span class="fontstyle3">:\n+ Camera cầu màu toàn phương vị.\n+ Camera cố định.\n- </span><span class="fontstyle6">Dưới hầm lò</span><span class="fontstyle3">:\n+ Camera hồng ngoại phòng nổ.\n+ Camera IP không dây.\nCác tín hiệu camera (dùng camera IP) được kết nối trực tiếp với thiết bị chuyển mạch mạng bằng cáp quang.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống truyền dẫn tín hiệu</span><span class="fontstyle3">: Truyền dẫn tín hiệu hình ảnh từ các camera về trung tâm điều khiển, đồng thời truyền các tín hiệu điều khiển từ trung tâm tới các camera. Cáp quang chống cháy dùng trong lò, cáp quang thông dụng trên mặt đất, cáp đồng trục, cổng nối dữ liệu, bộ chuyển đổi quang điện, bộ giải mã. Truyền dẫn tín hiệu thông qua hệ thống Ethernet cáp quang công nghiệp.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hệ thống lưu trữ, hiển thị và điều khiển</span><span class="fontstyle3">:\n- Hệ thống được lưu trữ trong đầu ghi video có nhiều ổ cứng dung lượng lớn.\n- Hiển thị: Hình ảnh được hiển thị trên hệ thống màn hình ghép.\n</span><span class="fontstyle0">CHỨC NĂNG HỆ THỐNG\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Hiển thị hình ảnh từ các camera giám sát lên màn hình máy tính, màn hình lớn lắp đặt tại phòng điều hành trung tâm\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Lưu trữ các video theo thời gian để kiểm tra theo dõi\n</span><span class="fontstyle4">• </span><span class="fontstyle3">Tương thích với nhiều dòng camera khác nhau.</span> </span>\n\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\n\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-bang-hinh-anh.png"><img class="alignnone size-medium wp-image-887" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-bang-hinh-anh-300x300.png" alt="" width="300" height="300" /></a>', 'Hệ thống giám sát bằng hình ảnh', 'Hệ thống dùng để giám sát liên tục trong quá trình sản xuất và khai thác, để theo dõi các hoạt động, hỗ trợ cho công tác an toàn và điều hành sản xuất, kiểm soát các hoạt động cả trên mặt bằng và dưới lò. Hệ thống có thể theo dõi hình ảnh ở các khu vực quan trọng cần giám sát (như trạm bảo vệ, sân kho vật tư, nhà chờ bến xe, các vị trí hầm bơm,\nbăng tải, máng cào, tời trục...) đồng thời tự động lưu trữ dữ liệu hình ảnh để làm dữ liệu,\nthuận tiện trong tìm kiếm hay xử lý công việc liên quan khi cần thiết.', 'inherit', 'closed', 'closed', '', '819-autosave-v1', '', '', '2018-10-08 08:39:26', '2018-10-08 08:39:26', '', 819, 'http://elatec.com.vn/?p=886', 0, 'revision', '', 0),
(887, 1, '2018-10-08 08:39:20', '2018-10-08 08:39:20', '', 'He thong giam sat bang hinh anh', '', 'inherit', 'open', 'closed', '', 'he-thong-giam-sat-bang-hinh-anh-2', '', '', '2018-10-08 08:39:20', '2018-10-08 08:39:20', '', 819, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-giam-sat-bang-hinh-anh.png', 0, 'attachment', 'image/png', 0),
(888, 1, '2018-10-08 08:50:14', '2018-10-08 08:50:14', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Đây là một hệ thống dùng để cung cấp thông tin về hình ảnh, âm thanh trực tiếp từ hiện trường trong lò - nơi xảy ra sự cố, về trung tâm chỉ huy cứu hộ. Hệ thống được thiết kế sử dụng kết hợp 02 phương thức truyền thông cáp quang và phát lặp wifi phù hợp với điều kiện hầm lò Việt Nam là nhỏ, hẹp và nhiều khúc cua. Tại trung tâm cứu hộ, Ban chỉ huy cứu hộ hoàn toàn quan sát trên phần mềm các hình ảnh từ các Thiết bị thu thập thông tin đầu cuối đa phương tiện gắn trên mũ nhân viên cứu hộ, biết được tình trạng xuất khí tại nơi xảy ra sự cố và có thể được trao đổi, chỉ huy trực tiếp với nhân viên cứu hộ qua điện thoại di động hoặc micro gắn trên mũ</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle5"><span class="fontstyle0"><strong>CẤU TRÚC  HỆ THỐNG</strong>\n</span></span><span class="fontstyle4">• </span><span class="fontstyle2">Trên mặt bằng</span><span class="fontstyle5">:\n- Tổng đài điện thoại VoIP, bàn điện thoại viên; máy tính chủ cài đặt phần mềm quản lý và điều khiển cuộc gọi; phần mềm hiển thị hình ảnh; </span><span class="fontstyle5">loa và micro để nghe và phát lệnh xuống khu vực sự cố</span><span class="fontstyle5">.\n</span><span class="fontstyle4">• </span><span class="fontstyle2">Dưới hầm lò</span><span class="fontstyle5">:\n- Điện thoại di động dùng trong hầm lò.\n- May đo khí cầm tay đa thông số.\n- Thiết bị đầu cuối đa phương tiện: có camera di động dạng đèn lò, micro và loa\n- Các bộ thu phát tín hiệu Wifi:\n+ Các thiết bị tích hợp lắp đặt cố định: thiết bị đầu cuối VIELINA-SW.02; thiết bị chuyển mạch mạng vòng VIELINA-SW.01.\n+ Các thiết bị di động: thiết bị thu phát lặp VIELINA-WAPM được triển khai di động tới các vị trí chưa có sóng wifi.\n</span><span class="fontstyle5">+ Dây cáp quang loại nhỏ nhẹ tiện mang vác, di chuyển</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Dữ liệu về nồng độ các loại khí (CH4, CO, O2, CO2) thông qua các máy đo khí đa thông số mang bên người và hình ảnh trực tiếp từ hiện trường theo thời gian thực thông qua các camera IP không dây gắn trên mũ của nhân viên cứu hộ được thu thập, truyền về là lưu trữ bằng phần mềm tại trung tâm ứng cứu trên mặt bằng.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Hỗ trợ đàm thoại 02 chiều qua các điện thoại di động hầm lò.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Truyền thông bằng hệ thống cáp quang kéo dài từ trên mặt bằng xuống đảm bảo tốc độ truyền cao ổn định, ít nhiễu, cho phép kết nối nhiều thiết bị đồng thời.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Khoảng cách lặp không dây giữa các trạm thu phát lặp lên tới 1000m và truyền không dây tới các thiết bị thu wifi tới 150m.\n</span><span class="fontstyle4">• </span><span class="fontstyle5">Các thiết bị mang theo trong lò đều có trang bị ắc qui cho phép hoạt động trong nhiều giờ.</span></span>\n\n<strong><span class="fontstyle0" style="font-family: arial, helvetica, sans-serif;"> SƠ ĐỒ KHỐI HỆ THỐNG </span></strong>\n\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thong-tin-cuu-ho-cuu-nan.png"><img class="alignnone size-medium wp-image-889" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thong-tin-cuu-ho-cuu-nan-300x260.png" alt="" width="300" height="260" /></a>', 'Hệ thống thông tin cứu hộ cứu nạn, ứng cứu khắc phục sự cố', 'Đây là một hệ thống dùng để cung cấp thông tin về hình ảnh, âm thanh trực tiếp từ hiện trường trong lò - nơi xảy ra sự cố, về trung tâm chỉ huy cứu hộ. Hệ thống được thiết kế sử dụng kết hợp 02 phương thức truyền thông cáp quang và phát lặp wifi phù hợp với điều kiện hầm lò Việt Nam là nhỏ, hẹp và nhiều khúc cua.', 'inherit', 'closed', 'closed', '', '820-autosave-v1', '', '', '2018-10-08 08:50:14', '2018-10-08 08:50:14', '', 820, 'http://elatec.com.vn/?p=888', 0, 'revision', '', 0),
(889, 1, '2018-10-08 08:49:15', '2018-10-08 08:49:15', '', 'He thong thong tin cuu ho cuu nan', '', 'inherit', 'open', 'closed', '', 'he-thong-thong-tin-cuu-ho-cuu-nan', '', '', '2018-10-08 08:49:15', '2018-10-08 08:49:15', '', 820, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-thong-tin-cuu-ho-cuu-nan.png', 0, 'attachment', 'image/png', 0),
(890, 1, '2018-10-08 09:00:14', '2018-10-08 09:00:14', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\r\n</span><span class="fontstyle2">Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong> </span>\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">Hệ thống giám sát, định vị nhân sự cấu trúc bao gồm:\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Máy chủ cài đặt phần mềm của hệ thống, để giám sát, điều khiển và quản lý, lưu trú hay tra cứu thông tin nhân viên tại phòng điều khiển trung tâm.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thiết bị đầu cuối VIELINA-SW.02: chứa đầu đọc thẻ được bố trí tại các cửa lò, dọc theo đường lò.\r\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thẻ giám sát và định vị nhân viên VIELINA-TAG.01: Được mỗi nhân viên mang bên mình khi làm việc. Hệ thống còn có mạng lưới cáp quang kết nối với thiết bị chuyển mạch mạng vòng.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span></strong> </span>\r\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">•</span> <span class="fontstyle0">Giám sát</span><span class="fontstyle2">: Mỗi cán bộ, nhân viên xuống lò đều mang thẻ định vị riêng tương ứng với mã số cá nhân của từng người. Thông qua các trạm đọc hệ thống sẽ giám sát được thời điểm ra vào lò, định vị được vị trí hiện tại của người mang thẻ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Quản lý</span><span class="fontstyle2">: Thống kê, kiểm soát tổng số nhân viên làm việc trong lò hay từng phòng ban, số nhân viên làm thêm giờ.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tìm kiếm, cảnh báo</span><span class="fontstyle2">: Hệ thống có chức năng tìm gọi bất kì một nhân viên đang mang thẻ từ trung tâm điều khiển. Cũng từ thẻ định vị nhân viên có thể bấm nút khẩn cấp để gọi lên phòng điều hành trung tâm.\r\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tra cứu</span><span class="fontstyle2">: Hỗ trợ tra cứu quỹ đạo di chuyển của từng nhân viên làm việc trong lò.</span> </span>\r\n\r\n<span style="font-family: arial, helvetica, sans-serif;"> <strong><span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG\r\n</span></strong> </span>\r\n\r\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo.png"><img class="alignnone size-medium wp-image-892" src="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo-300x196.png" alt="" width="300" height="196" /></a>', 'HT giám sát, định vị nhân sự trong hầm lò', 'Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.', 'publish', 'closed', 'closed', '', 'he-thong-giam-sat-dinh-vi-nhan-su-trong-ham-lo', '', '', '2018-10-09 07:35:26', '2018-10-09 07:35:26', '', 0, 'http://elatec.com.vn/?post_type=san_pham&#038;p=890', 0, 'san_pham', '', 0),
(891, 1, '2018-10-08 09:03:19', '2018-10-08 09:03:19', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong> </span>\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">Hệ thống giám sát, định vị nhân sự cấu trúc bao gồm:\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Máy chủ cài đặt phần mềm của hệ thống, để giám sát, điều khiển và quản lý, lưu trú hay tra cứu thông tin nhân viên tại phòng điều khiển trung tâm.\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thiết bị đầu cuối VIELINA-SW.02: chứa đầu đọc thẻ được bố trí tại các cửa lò, dọc theo đường lò.\n</span><span class="fontstyle2">• </span><span class="fontstyle0">Thẻ giám sát và định vị nhân viên VIELINA-TAG.01: Được mỗi nhân viên mang bên mình khi làm việc. Hệ thống còn có mạng lưới cáp quang kết nối với thiết bị chuyển mạch mạng vòng.</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"><strong> <span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span></strong> </span>\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0">•</span> <span class="fontstyle0">Giám sát</span><span class="fontstyle2">: Mỗi cán bộ, nhân viên xuống lò đều mang thẻ định vị riêng tương ứng với mã số cá nhân của từng người. Thông qua các trạm đọc hệ thống sẽ giám sát được thời điểm ra vào lò, định vị được vị trí hiện tại của người mang thẻ.\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Quản lý</span><span class="fontstyle2">: Thống kê, kiểm soát tổng số nhân viên làm việc trong lò hay từng phòng ban, số nhân viên làm thêm giờ.\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tìm kiếm, cảnh báo</span><span class="fontstyle2">: Hệ thống có chức năng tìm gọi bất kì một nhân viên đang mang thẻ từ trung tâm điều khiển. Cũng từ thẻ định vị nhân viên có thể bấm nút khẩn cấp để gọi lên phòng điều hành trung tâm.\n</span><span class="fontstyle3">• </span><span class="fontstyle0">Tra cứu</span><span class="fontstyle2">: Hỗ trợ tra cứu quỹ đạo di chuyển của từng nhân viên làm việc trong lò.</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"> <strong><span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG\n</span></strong> </span>\n\n<a href="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo.png"><img class="alignnone size-medium wp-image-892" src="http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo-300x196.png" alt="" width="300" height="196" /></a>', 'Hệ thống giám sát, định vị nhân sự trong hầm lò', 'Hệ thống giám sát, định vị nhân sự trong mỏ dùng để kiểm soát các nhân viên trong quá trình lao động sản xuất, xác định vị trí của từng nhân viên trong lò phục vụ trong công tác quản lý đồng thời hỗ trợ nhanh chóng cứu hộ, cứu nạn khi tình huống sự cố xảy ra. Ngoài ra hệ thống quản lý được trực tuyến số lượng nhân viên đang làm việc, khu vực làm việc, thời gian làm việc trong lò cũng như quỹ đạo di chuyển trong lò của từng nhân viên.', 'inherit', 'closed', 'closed', '', '890-autosave-v1', '', '', '2018-10-08 09:03:19', '2018-10-08 09:03:19', '', 890, 'http://elatec.com.vn/?p=891', 0, 'revision', '', 0),
(892, 1, '2018-10-08 09:01:35', '2018-10-08 09:01:35', '', 'He thong giam sat, dinh vi trong ham lo', '', 'inherit', 'open', 'closed', '', 'he-thong-giam-sat-dinh-vi-trong-ham-lo', '', '', '2018-10-08 09:01:35', '2018-10-08 09:01:35', '', 890, 'http://elatec.com.vn/wp-content/uploads/2018/10/He-thong-giam-sat-dinh-vi-trong-ham-lo.png', 0, 'attachment', 'image/png', 0),
(893, 1, '2018-10-08 09:15:49', '2018-10-08 09:15:49', '<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống Phát thanh được thiết kế theo tiêu chuẩn, quy cách an toàn trong môi trường mỏ hầm lò. Hệ thống sử dụng trong các trường hợp sơ tán khẩn cấp khi có sự cố, phát thông báo các bản tin hoạt động của mỏ, tuyên truyền giáo dục ý thức, kỷ luật lao động hay các bản nhạc nhằm tạo tâm lý sảng khoái, thoải mái cho người lao động trước, trong và sau mỗi ca làm việc mệt nhọc. Hệ thống ứng dụng công nghệ mạng Ethernet cáp quang để truyền âm thanh từ Máy tính chủ tại Phòng điều khiển trung tâm tới các Phân trạm phát thanh từ đó phát tới các thùng loa âm ly hay chiều ngược lại. Hệ thống phát thanh có thể quản lý lên tới 100 Phân trạm.</span> </span>\n\n<span style="font-family: arial, helvetica, sans-serif;"> <span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\nHệ thống phát thanh trong mỏ hầm lò cấu hình bao gồm:\n<span class="fontstyle2">• </span><span class="fontstyle3">Trên mặt bằng</span>: Máy chủ cài đặt phần mềm của hệ thống, để giám sát, điều khiển và quản lý các thiết bị của hệ thống; loa gọi tìm kiếm.\n<span class="fontstyle2">• </span><span class="fontstyle3">Dưới hầm lò</span>:\n- Phân trạm phát thanh an toàn tia lửa VIELINA-PTM.AT.\n- Thùng loa âm ly phòng nổ VIELINA-PTM.PN.\nCác phân trạm phát thanh và thùng loa âm ly được đặt dọc theo đường lò, các khu khai thác. Hệ thống truyền dẫn âm thanh thông qua mạng vòng ethernet cáp quang.\n</span><span class="fontstyle2">\n</span><span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Từ phòng điều tiết trung tâm có thể thông báo các bản tin xuống tất cả các phân trạm phát thanh và âm ly trong hầm lò hay một khu vực được lựa chọn. Trong cùng một thời điểm có thể phát các bản tin khác nhau đồng thời tới các khu vực khác nhau.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trao đổi, liên lạc trực tiếp hai chiều từ trung tâm tới một phân trạm phát thanh cụ thể và chiều ngược lại hay hai phân trạm với nhau.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Hệ thống được quản lý, giám sát điều khiển một cách trực quan từ phòng trung tâm.</span></span>\n\n<span class="fontstyle4" style="font-family: arial, helvetica, sans-serif;">\n<strong> <span class="fontstyle0">SƠ ĐỒ KHỐI HỆ THỐNG</span>\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-phat-thanh.png"><img class="alignnone size-medium wp-image-894" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-phat-thanh-300x221.png" alt="" width="300" height="221" /></a>\n</strong></span>\n\n&nbsp;', 'Hệ thống phát thanh mỏ', 'Hệ thống Phát thanh được thiết kế theo tiêu chuẩn, quy cách an toàn trong môi trường mỏ hầm lò. Hệ thống sử dụng trong các trường hợp sơ tán khẩn cấp khi có sự cố, phát thông báo các bản tin hoạt động của mỏ, tuyên truyền giáo dục ý thức, kỷ luật lao động hay các bản nhạc nhằm tạo tâm lý sảng khoái, thoải mái cho người lao động trước,\ntrong và sau mỗi ca làm việc mệt nhọc.', 'inherit', 'closed', 'closed', '', '821-autosave-v1', '', '', '2018-10-08 09:15:49', '2018-10-08 09:15:49', '', 821, 'http://elatec.com.vn/?p=893', 0, 'revision', '', 0),
