(895, 1, '2018-10-08 09:23:03', '2018-10-08 09:23:03', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống giám sát khí mỏ kiểm soát liên tục về tình trạng xuất khí đồng thời đưa ra cảnh báo cũng như ra lệnh điều khiển ngắt các nguồn điện có thể phát sinh nguy hiểm về cháy nổ một cách kịp thời. Hệ thống cho phép quản lý, giám sát, lưu trữ các dữ liệu cũng như thông tin hoạt động của hệ thống. Các hệ thống đầu đo, cảm biến hoạt động liên tục 24/24h và hệ thống nguồn điện dự phòng đảm bảo hoạt động ngay cả khi mất điện lưới.</span>\n\n<strong><span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span>\n<span class="fontstyle0">Hệ thống giám sát khí mỏ bao gồm:\n</span></strong><span class="fontstyle2">• </span><span class="fontstyle3">Trên mặt bằng:\n</span><span class="fontstyle0">- </span><span class="fontstyle4">Máy tính chủ điều khiển</span><span class="fontstyle0">: Được cài đặt phần mềm của hệ thống đặt tại Phòng quan trắc dùng để cấu hình hệ thống, điều hành mọi hoạt động của hệ thống như cài đặt ngưỡng cảnh báo, ngưỡng cắt điện, cho phép đầu đo điều khiển đóng cắt liên động. Ngoài ra phần mềm cho phép thu thập, hiển thị dữ liệu trên giao diện có đường lò, lưu trữ thông tin cần thiết theo thời gian, thống kê và phục vụ in ấn.\n</span><span class="fontstyle4">- Máy tính khách</span><span class="fontstyle0">: Đặt tại các phòng ban hoặc các cán bộ có liên quan để theo dõi số liệu đo phục vụ cho công tác điều hành sản xuất. Máy tính được kết nối thông qua mạng LAN.\n</span><span class="fontstyle4">- Tủ điều khiển giám sát trung tâm</span><span class="fontstyle0">: Được đặt tại phòng quan trắc dùng để cài đặt cấu hình hệ thống, điều khiển và giám sát các đầu đo, tự động cảnh báo khi có đầu đo của hệ thống vượt ngưỡng.\n</span><span class="fontstyle2">• </span><strong><span class="fontstyle3">Dưới hầm lò</span></strong><span class="fontstyle0">:\n- Các thiết bị đầu đo khí: CH4, CO, CO2, O2, H2, tốc độ gió, nhiệt độ, hạ áp,… lắp đặt tại các vị trí cần giám sát trong lò.\n- Thiết bị nguồn và điều khiển đóng cắt liên động.</span>\n\n<strong>\n<span class="fontstyle0">CHỨC NĂNG HỆ THỐNG</span>\n</strong><span class="fontstyle0">Hệ thống đảm bảo chức năng kiểm soát khí mỏ tự động và hoạt động liên lục 24/24\ngiờ.\n- Các dữ liệu đo được hiển thị tại chỗ và truyền về trung tâm phục vụ giám sát, cảnh\nbáo và lưu trữ số liệu.\n- Vị trí và số liệu đo được hiển thị trực quan trên màn hình sơ đồ đường lò, dễ dàng\ncập nhật và di chuyển vị trí phù hợp với hiện trạng khai thác.\n- Các đầu đo, tủ điều khiển và máy tính điều khiển đều có tín hiệu cảnh bằng còi và\nđèn.</span> <strong>\n</strong>\n\n<span class="fontstyle0">- Hệ thống có chức năng điều khiển đóng cắt điện tự động khi nồng độ khí vượt\nngưỡng cảnh báo nguy hiểm đặt trước. Các tín hiệu giải trừ được thực hiện tại máy tính\nhoặc tủ điều khiển trung tâm.\n- Các đầu đo có thể được cài đặt cấu hình ở chế độ hoạt động độc lập hoặc đồng bộ\nvới hệ thống.\n- Hệ thống có giao diện tiếng Việt dễ dàng vận hành, sử dụng.</span>\n\n&nbsp;', 'Hệ thống giám sát khí mỏ', 'Hệ thống giám sát khí mỏ kiểm soát liên tục về tình trạng xuất khí đồng thời đưa ra cảnh báo cũng như ra lệnh điều khiển ngắt các nguồn điện có thể phát sinh nguy hiểm về cháy nổ một cách kịp thời. Hệ thống cho phép quản lý, giám sát, lưu trữ các dữ liệu cũng như thông tin hoạt động của hệ thống. Các hệ thống đầu đo, cảm biến hoạt động liên tục 24/24h và hệ thống nguồn điện dự phòng đảm bảo hoạt động ngay cả khi mất điện lưới.', 'inherit', 'closed', 'closed', '', '822-autosave-v1', '', '', '2018-10-08 09:23:03', '2018-10-08 09:23:03', '', 822, 'http://elatec.com.vn/?p=895', 0, 'revision', '', 0),
