(898, 1, '2018-10-08 09:39:39', '2018-10-08 09:39:39', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống điều khiển cửa gió tự động đảm nhiệm việc tự động mở/đóng cửa khi có người hoặc các phương tiện qua lại, đồng thời các trạng thái hoạt động của hệ thống được hiển thị, cảnh báo thông qua màn hình giám sát tại trung tâm. Hệ thống gồm có các cảm biến tự động nhận biết có người hoặc phương tiện đến gần cửa để tủ điều khiển ra lệnh điều khiển mở/đóng cửa thông qua bộ điều khiển thủy lực.</span>\n\n<strong> <span class="fontstyle0">CẤU TRÚC HỆ THỐNG</span></strong><span class="fontstyle3">\n</span><span class="fontstyle4">Cấu trúc hệ thống gồm 2 phần:\n</span><span class="fontstyle5">• </span><span class="fontstyle4">Phần trên mặt bằng là máy tính có cài đặt phần mềm giám sát trạng thái hoạt động của các cửa gió tự động trong lò.\n</span><span class="fontstyle5">• </span><span class="fontstyle2">Phần dưới hầm lò:\n</span><span class="fontstyle4">- Các cảm biến tự động nhận biết có người hay phương tiện đến gần,\n- Tủ điều khiển ra lệnh điều khiển bơm dầu, đóng mở van cấp dầu cho xy lanh điều khiển đóng mở cửa gió.</span>\n\n<span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống có các chức năng sau:\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Tự động điều khiển: </span><span class="fontstyle2">Tự động phát hiện có người và tàu để ra lệnh đóng mở cửa.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Điều khiển bằng tay</span><span class="fontstyle2">: Ngoài tính năng tự động, hệ thống cho phép đóng mở cửa bằng tay.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trạng thái khẩn cấp</span><span class="fontstyle2">: Trong quá trình cửa đang đóng lại mà gặp vật cản, hệ thống sẽ điều khiển cửa gió mở cửa trở lại và đóng lại sau khi người hoặc phương tiện đã đi qua do hệ thống tích hợp cảm biến va chạm.\n</span><span class="fontstyle3">• </span><span class="fontstyle4">Trạng thái sự cố</span><span class="fontstyle2">: Trong trường hợp có sự cố mất điện đột ngột, bộ phận bơm dầu và các van không hoạt động thì người dùng có thể sử dụng các van xả tay kết hợp với kết cấu cửa gió ngược khi đó sức người có thể đóng mở cửa gió được.</span>\n\n<strong> <span class="fontstyle0">MÔ HÌNH HỆ THỐNG</span>\n<a href="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-cua-gio-tu-dong.png"><img class="alignnone size-medium wp-image-899" src="http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-cua-gio-tu-dong-300x157.png" alt="" width="300" height="157" /></a></strong>', 'Hệ thống điều khiển cửa gió tự động', 'Hệ thống điều khiển cửa gió tự động đảm nhiệm việc tự động mở/đóng cửa khi có người hoặc các phương tiện qua lại, đồng thời các trạng thái hoạt động của hệ thống được hiển thị, cảnh báo thông qua màn hình giám sát tại trung tâm. Hệ thống gồm có các cảm biến tự động nhận biết có người hoặc phương tiện đến gần cửa để tủ điều khiển ra lệnh điều khiển mở/đóng cửa thông qua bộ điều khiển thủy lực.', 'inherit', 'closed', 'closed', '', '826-autosave-v1', '', '', '2018-10-08 09:39:39', '2018-10-08 09:39:39', '', 826, 'http://elatec.com.vn/?p=898', 0, 'revision', '', 0),
(899, 1, '2018-10-08 09:39:10', '2018-10-08 09:39:10', '', 'He thong cua gio tu dong', '', 'inherit', 'open', 'closed', '', 'he-thong-cua-gio-tu-dong', '', '', '2018-10-08 09:39:10', '2018-10-08 09:39:10', '', 826, 'http://elatec.com.vn/wp-content/uploads/2018/09/He-thong-cua-gio-tu-dong.png', 0, 'attachment', 'image/png', 0),
(900, 1, '2018-10-08 09:45:43', '2018-10-08 09:45:43', '<span class="fontstyle0">GIỚI THIỆU HỆ THỐNG\n</span><span class="fontstyle2">Hệ thống giám sát và điều khiển tự động toàn bộ các công đoạn của quá trình xử lý nước thải. Các thiết bị như máy bơm, máy khuấy, máy cào rác, máy thổi khí … được giám sát, điều khiển hoàn toàn tự động. Phần mềm có nhiều chức năng như: cảnh báo, lưu trữ, thống kê, bảo mật và cấu hình hệ thống.</span>\n\n&nbsp;', 'Hệ thống tự động xử lý nước thải', 'Hệ thống giám sát và điều khiển tự động toàn bộ các công đoạn của quá trình xử lý nước thải. Các thiết bị như máy bơm, máy khuấy, máy cào rác, máy thổi khí … được giám sát, điều khiển hoàn toàn tự động. Phần mềm có nhiều chức năng như: cảnh báo, lưu trữ, thống kê, bảo mật và cấu hình hệ thống.', 'inherit', 'closed', 'closed', '', '828-autosave-v1', '', '', '2018-10-08 09:45:43', '2018-10-08 09:45:43', '', 828, 'http://elatec.com.vn/?p=900', 0, 'revision', '', 0),
(901, 1, '2018-10-09 08:35:31', '2018-10-09 08:35:31', '<span class="fontstyle0"><strong>GIỚI THIỆU HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống tự động cân ô tô, đồng bộ cân là hệ thống cân tự động các xe khi đi qua\ntrạm cân giúp cho người vận hành dễ dàng kiểm soát khối lượng các xe vận chuyển\nthan, tăng tốc độ lưu thông. Hệ thống cũng tích hợp chức năng nhận dạng biến số xe\nTất cả dữ liệu hệ thống đọc được sẽ được lưu trữ đồng bộ lên cơ sở dữ liệu giúp người\nvận hành có thể tổng hợp, khai thác dữ liệu dễ dàng, đồng thời hệ thống hỗ trợ theo dõi\nqua Internet.</span>\n\n<span class="fontstyle2">\n</span><span class="fontstyle0"><strong>CẤU TRÚC HỆ THỐNG</strong>\n</span><span class="fontstyle2">Hệ thống gồm:\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Barie điện chế độ điều khiển tự động hoặc bán tự động.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Cân ô tô (có thể dùng sẵn của mỏ ).\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Hệ thống camera giám sát xe.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Máy tính điều khiển: Cài đặt phần mềm điều khiển, lựa chọn và cấu hình hệ thống.</span>\n\n<span class="fontstyle0"><strong>CHỨC NĂNG HỆ THỐNG</strong>\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động mở barie khi có xe chuẩn bị vào cân.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận dạng xe qua biển số xe và thẻ UHF.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động nhận diện vị trí xe trên cân.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Tự động ổn định trọng lượng.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Mã hóa phiếu cân bằng mã QR code.\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Xem dữ liệu báo cáo từ xa (dữ liệu báo cáo được tập trung và xem trên web).\n</span><span class="fontstyle3">• </span><span class="fontstyle2">Lưu trữ hình ảnh biển số xe và toàn cảnh xe khi qua cân.</span>', 'Hệ thống cân băng tải, cân xe ô tô', 'Lorem Ipsum is simply dummy text of the printing and typesetting industry. Lorem Ipsum has been the industry''s standard dummy text ever since the 1500s, when an unknown printer took a galley of type and scrambled it to make a type specimen book. It has survived not only five centuries, but also the leap into electronic typesetting, remaining essentially unchanged. It was popularised in the 1960s with the release of Letraset sheets containing Lorem Ipsum passages, and more recently with desktop publishing software like Aldus PageMaker including versions of Lorem Ipsum.', 'inherit', 'closed', 'closed', '', '859-autosave-v1', '', '', '2018-10-09 08:35:31', '2018-10-09 08:35:31', '', 859, 'http://elatec.com.vn/?p=901', 0, 'revision', '', 0);
